INSERT INTO `tbl_news` (`id`, `name`, `subject`, `url`, `synopsis`, `text`, `media`, `attribute`, `allow_comment`, `tags`, `order`, `user_id`, `count`, `status`, `added`, `modified`) VALUES
(1, NULL, 'KEWPIE, Now in Indonesia', 'kewpie-now-in-indonesia', '<p>\n	After developing the business in 5 countries, KEWPIE Corporation opened a new business in Indonesia. It began with opening a factory in Cikarang, West Java, <a href="http://www.kewpie.co.id/" target="_blank">PT. KEWPIE INDONESIA</a> started selling for food service in October 2014 and for retail in May 2015. Not only providing quality and safe products, all <a href="http://www.kewpie.co.id/" target="_blank">KEWPIE INDONESIA</a> products are halal certified from MUI. With its good intentions, we wish to have all KEWPIE Products enjoyed by all ages of Indonesian.</p>\n', '<p>\n	After developing the business in 5 countries, KEWPIE Corporation opened a new business in Indonesia. It began with opening a factory in Cikarang, West Java, <a href="http://www.kewpie.co.id/" target="_blank">PT. KEWPIE INDONESIA</a> started selling for food service in October 2014 and for retail in May 2015. Not only providing quality and safe products, all <a href="http://www.kewpie.co.id/" target="_blank">KEWPIE INDONESIA</a> products are halal certified from MUI. With its good intentions, we wish to have all KEWPIE Products enjoyed by all ages of Indonesian.</p>\n', '12044-2da95-05.jpg', NULL, NULL, NULL, NULL, NULL, NULL, 'publish', 1432878494, 1444976889),
(2, NULL, 'KEWPIE INDONESIA at the Grand Opening AEON Mall (May 30, 2015)', 'kewpie-indonesia-at-the-grand-opening-aeon-mall-may-30-2015', '<div>\n	KEWPIE INDONESIA was participating in the grand opening event of AEON Retail&#39;s first store, in Alam Sutera, Serpong, Banten. In this occasion, <a href="http://www.kewpie.co.id/" target="_blank">KEWPIE INDONESIA</a> launched its first four products: KEWPIE MAYONNAISE ORIGINAL, KEWPIE Dressing Roasted Sesame, KEWPIE Dressing Spicy Tomato and KEWPIE Dressing Thousand Island. This launching event also marked the incoming of KEWPIE retail products.&nbsp;</div>\n<div>\n	Not only did some sampling activities in this event, <a href="http://www.kewpie.co.id/" target="_blank">KEWPIE INDONESIA</a> also conducted cooking demo to introduce all range of launched products to the mall visitors.</div>\n<div>\n	&nbsp;</div>\n', '<div>\n	KEWPIE INDONESIA was participating in the grand opening event of AEON Retail&#39;s first store, in Alam Sutera, Serpong, Banten. In this occasion, <a href="http://www.kewpie.co.id/" target="_blank">KEWPIE INDONESIA</a> launched its first four products:&nbsp;<span style="font-size: 11.9999990463257px;">KEWPIE MAYONNAISE ORIGINAL</span>, KEWPIE Dressing Roasted Sesame, KEWPIE Dressing Spicy Tomato and KEWPIE Dressing Thousand Island. This launching event also marked the incoming of KEWPIE retail products.&nbsp;</div>\n<div>\n	Not only did some sampling activities in this event, <a href="http://www.kewpie.co.id/" target="_blank">KEWPIE INDONESIA</a> also conducted cooking demo to introduce all range of launched products to the mall visitors.</div>\n<div>\n	&nbsp;</div>\n', '759d0-7a821-33218.jpg', NULL, NULL, NULL, NULL, NULL, NULL, 'publish', 1432878572, 1444976917),
(6, NULL, 'NEW IN KEWPIE FAMILY', 'new-in-kewpie-family', '<p>\n	<span style="font-size: 12.0120115280151px;"><a href="http://www.kewpie.co.id/" target="_blank">KEWPIE INDONESIA</a> launched 6 new variants in August 2015, took place in AEON Supermarket BSD.</span></p>\n', '<p>\n	<span style="font-size: 12px;"><a href="http://www.kewpie.co.id/" target="_blank">KEWPIE INDONESIA</a> launched 6 new variants in August 2015, took place in AEON Supermarket BSD. These new variants are from the family of dressing, mayonnaise and sandwich spread. They are KEWPIE Salad Dressing with Japanese Soy Sauce, KEWPIE Salad Dressing Caesar, KEWPIE MAYONNAISE SAVORY SAUCE, KEWPIE SANDWICH SPREAD ORIGINAL, KEWPIE Banana Chocolate Spread and KEWPIE Coffee Chocolate Spread. The sandwich spreads line particularly have the unique and new kind of flavors that expected to add more ways of Indonesian people in enjoying bread.</span></p>\n', 'a6cca-picture1.jpg', NULL, NULL, NULL, NULL, NULL, NULL, 'publish', 1440480115, 1452999508),
(8, NULL, '15 KEWPIE Product are Market Available', '15-kewpie-product-are-market-available', '<p>\n	On September 2015 KEWPIE MAYONNAISE ORIGINAL SWEET, KEWPIE SAUS MAYO GURIH, &amp; KEWPIE Vanilla Strawberry Spread were launched to the market</p>\n', '<div>\n	On September 2015 KEWPIE MAYONNAISE ORIGINAL SWEET, KEWPIE SAUS MAYO GURIH, &amp; KEWPIE Vanilla Strawberry Spread were launched to the market. KEWPIE SANDWICH SPREAD CHEESE, KEWPIE Orange Chocolate Spread, and KEWPIE Vanilla Pineapple Spread were launched two months afterwards to further complement &nbsp;KEWPIE INDONESIA&#39;s range of product. With such variety of products, KEWPIE INDONESIA wished to achieve better consumer satisfaction and to further develop better products in the future.</div>\n<div>\n	&nbsp;</div>\n<div>\n	&nbsp;</div>\n', '8c020-news.jpg', NULL, NULL, NULL, NULL, NULL, NULL, 'publish', 1452999304, 1453100110);
INSERT INTO `tbl_pages` (`id`, `menu_id`, `name`, `subject`, `url`, `synopsis`, `text`, `media`, `attribute`, `publish_date`, `unpublish_date`, `allow_comment`, `tags`, `order`, `user_id`, `count`, `status`, `added`, `modified`) VALUES
(1, 1, '', 'KEWPIE is now available in Indonesia!', 'kewpie-is-now-available-in-indonesia', NULL, '<div>\n	With 100 years of experience in Japan, KEWPIE comes with richness and delicious taste for Indonesia.</div>\n', NULL, NULL, '2015-02-13', '2015-02-28', 1, NULL, NULL, NULL, NULL, 'publish', NULL, 1455711042),
(15, 5, NULL, 'Corporate Philosophy', 'corporate-philosophy', NULL, '<h2 class="p1">\n	<span style="font-size:16px;"><strong>Corporate Motto</strong></span></h2>\n<p>\n	<span style="font-size:16px;"><strong><input alt="" src="/uploads/static/content/files/japan-word-1.jpg" style="width: 469px; height: 169px;" type="image" /></strong></span></p>\n<p class="p1">\n	<em>Raku Goyu Kai Etsu.</em></p>\n<p class="p1">\n	In conducting work, real happiness comes from a cooperation of bringing the same vision to life. By going through this process, one will be able to feel confident and capable. These feelings can increase individual skill, thus will support company development from the inside.</p>\n<p class="p1">\n	&nbsp;</p>\n<h2 class="p1">\n	<span style="font-size:16px;"><strong>Corporate Principles</strong></span></h2>\n<p>\n	<span style="font-size:16px;"><strong><input alt="" src="/uploads/static/content/files/japan-word-2%282%29.jpg" style="width: 469px; height: 169px;" type="image" /></strong></span></p>\n<p class="p1">\n	<cite>&quot;Act on Moral Principles&quot;,&nbsp;</cite></p>\n<p class="p1">\n	<cite>&quot;Strive for Originality and Ingenuity&quot;,</cite></p>\n<p class="p1">\n	<cite>&quot;Look After Parent&#39;s Well Being&quot;</cite></p>\n<p class="p1">\n	<cite>Cherished Doctrine: &ldquo;The world is fair beyond expectations&rdquo;</cite></p>\n<p class="p1">\n	&nbsp;</p>\n<h2 class="p1">\n	<span style="font-size:16px;"><strong>Vision</strong></span></h2>\n<p class="p1">\n	We aim to be a group contributing to the food culture and health of the world through &ldquo;great taste, empathy, and uniqueness.</p>\n<h2 class="p1">\n	<span style="font-size: 16px;">Mission</span></h2>\n<p class="p1">\n	We will observe our Group Policies, and strive to earn the highest degree of trust from our customers and all our other stakeholders</p>\n<div>\n	&nbsp;</div>\n<h2 class="p1">\n	<span style="font-size:16px;"><strong>Aim</strong></span></h2>\n<ul>\n	<li class="p1">\n		Creating delicious food products Indonesia will love.</li>\n	<li class="p1">\n		Provide goodness and simplicity in food products that made from quality raw materials, safely packed and easy to apply.</li>\n	<li class="p1">\n		Delivers uniqueness by promoting creativity in product development.</li>\n</ul>\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'publish', 1432892204, 1457060635),
(16, 5, NULL, 'President Director''s Message', 'president-directors-message', '<p class="p1">\n	With &quot;delicacy, goodness and uniqueness&quot;, KEWPIE INDONESIA is contributing to Indonesian diet.</p>\n', '<p class="p1">\n	<span style="font-size:16px;">With &quot;delicacy, goodness and uniqueness&quot;, KEWPIE INDONESIA is contributing to Indonesian diet.</span></p>\n<p class="p1">\n	Since it was established in 1919, KEWPIE GROUP has been always using good raw ingredients following the idea of &quot;good products only born from good ingredients&quot;, and will continually maintain the quality.</p>\n<p class="p1">\n	Along with this idea, KEWPIE INDONESIA is dedicating safe and guaranteed range of halal products, made in a production line with a comprehensive quality control, for the people of Indonesia.&nbsp;</p>\n<p class="p1">\n	Then, with the spirit of a pioneer, KEWPIE GROUP marketed the first mayonnaise and dressings in Japan. With this pioneering spirit, we also propose healthy diet in Indonesia by developing new delicious sauce products.&nbsp;</p>\n<p class="p1">\n	At last, with emphasizing on the consumer, we are implementing the idea of &quot;Top Quality Products&quot;. &quot;Bringing Tastes Favored by Indonesian Diet&quot;, and &quot;Creating a New Eating Lifestyle&quot;.<br />\n	<img alt="" src="/uploads/static/content/images/Yamashita-san-signature.png" style="width: 110px; height: 91px;" /><br />\n	Yamashita Tomomi</p>\n', '5fb6d-pesan-presiden-direktur.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'publish', 1432894234, 1441195805),
(17, 5, NULL, 'Contact Us', 'contact-us', '<p class="p1 hidden">\n	Ruko Kebayoran Arcade 3 Blok KA/E1-09 Bintaro Jaya, Tangerang Selatan, Indonesia</p>\n<p class="maps">\n	&nbsp;</p>\n', '<h2 class="p1">\n	<strong>Head Office/Factory </strong></h2>\n<p class="p1">\n	Kawasan GIIC Blok CC NO.5&nbsp;<span>Kota Deltamas</span></p>\n<p class="p1">\n	Cikarang Pusat, Bekasi&nbsp;</p>\n<p class="p1">\n	Jawa Barat, Indonesia.&nbsp;</p>\n<p class="p1">\n	&nbsp;</p>\n<h2 class="p1">\n	<strong>Sales Office </strong></h2>\n<p class="p1">\n	Ruko Kebayoran Arcade 3 Blok KA/E1-09</p>\n<p class="p1">\n	Bintaro Jaya, Tangerang Selatan, Indonesia</p>\n<p class="p1">\n	&nbsp;</p>\n<h2 class="p1">\n	<strong>Email for Sales Inquiries </strong></h2>\n<p class="p1">\n	sales@ml.kewpie.co.id<br />\n	<br />\n	<br />\n	<br />\n	<br />\n	&nbsp;</p>\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'publish', 1432894310, 1441011799),
(12, 1, NULL, 'The Origins of KEWPIE Mayonnaise', 'the-origins-of-kewpie-mayonnaise', '<p class="food-service-text">\n	It is said that mayonnaise was accidentally created by Duke de Richelieu&#39;s French chef in the mid 18th century. Instead of using cream, the chef used oil and eggs when making the Duke&#39;s victory feast. He was so pleased with the creation that it was named &quot;Mahonnaise&quot; in honour of the Duke&#39;s defeat of the British at the Port of Mahon, Menorca.</p>\n', '<p class="food-service-text">\n	It is said that mayonnaise was accidentally created by Duke de Richelieu&#39;s French chef in the mid 18th century. Instead of using cream, the chef used oil and eggs when making the Duke&#39;s victory feast. He was so pleased with the creation that it was named &quot;Mahonnaise&quot; in honour of the Duke&#39;s defeat of the British at the Port of Mahon, Menorca.</p>\n<p class="food-service-text">\n	Mr Nakashima Toichiro (founder of KEWPIE Corporation) learned about mayonnaise 160 years later when he travelled to the United States to learn about canned food. Back then, Americans often ate vegetables with dressings that contained mayonnaise. Mr Nakashima then returned to Japan to develop a nutritious mayonnaise that was high in egg yolk content, eventually selling the western condiment to Japan in 1925. KEWPIE Mayonnaise would then go on to capture the hearts of mayonnaise lovers all around the world.</p>\n', '83dad-inside-kewpie.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'publish', 1432767310, 1440063261);
