INSERT INTO `tbl_page_menus` (`id`, `parent_id`, `type`, `name`, `subject`, `synopsis`, `text`, `url`, `media`, `position`, `sub_level`, `order`, `is_system`, `has_child`, `user_id`, `count`, `status`, `added`, `modified`) VALUES
(2, NULL, 'product', NULL, 'Our Product', NULL, '<p>\n	From mayonnaise, dressing to sandwich spread, KEWPIE INDONESIA brings a wide range of products to add deliciousness to all the food you like!</p>\n', 'our-product', NULL, 'top', NULL, NULL, NULL, NULL, NULL, NULL, 'publish', NULL, 1439544530),
(3, NULL, 'page', NULL, 'Inside KEWPIE', '<h2>\n	What&#39;s in Our Mayonnaise</h2>\n<p class="p2">\n	Made from egg, vinegar and soy oil processed with KEWPIE technology, KEWPIE Mayonnaise is produced in a good emulsion process. The emulsion process produces smaller and thicker particles compared to other mayonnaise products, thus making KEWPIE MAYONNAISE tastes soft but dense.</p>\n', '<h2 class="p1">\n	<strong>KEWPIE Mayonnaise Origins</strong></h2>\n<p class="p3">\n	Touichiro Nakashima (inventor of the Kewpie mayonnaise) introduced to mayonnaise for the first time in 1912 during his trip to the USA to study canned food. At that time, Americans eat potato salad with mayonnaise as their everyday meal. The tasty and nutritious potato salad with mayonnaise had become very memorable for Nakashima until he decided to share the goodness of mayonnaise in Japan.</p>\n<p class="p3">\n	He then returned to Japan and started developing a highly nutritious mayonnaise, which contains more egg yolks. Nakashima mayonnaise went on sale in Japan in 1925 in the name of KEWPIE. KEWPIE mayonnaise is the first Japan made mayonnaise.</p>\n<p class="p3">\n	Along with its products development, in addition to mayonnaise, KEWPIE also provides high quality food products for all ages marketed to various countries in the world.</p>\n<p class="p3">\n	&nbsp;</p>\n<h2 class="p1">\n	<strong>What&#39;s in Our Mayonnaise</strong></h2>\n<p class="p2">\n	Made from egg, vinegar and soy oil processed with KEWPIE technology, KEWPIE Mayonnaise is produced in a good emulsion process. The emulsion process produces smaller and thicker particles compared to other mayonnaise products, thus making KEWPIE mayonnaise tastes soft but dense.</p>\n<p class="p2">\n	&nbsp;</p>\n<h2 class="p1">\n	<strong>KEWPIE Mayonnaise Production</strong></h2>\n<p class="p1">\n	All products from KEWPIE INDONESIA are made from high quality materials, well processed into products that are safe for consumption. Packed in food standards tubes, KEWPIE Mayonnaise, KEWPIE Sandwich Spread and KEWPIE Sweet Sauce is easy to apply or to carry. With KEWPIE, you can easily make lines over the food or simply draw on bread.</p>\n<p class="p3">\n	&nbsp;</p>\n', 'inside-kewpie', 'd20d8-kewpie-factory.png', 'top', NULL, NULL, NULL, NULL, NULL, NULL, 'publish', NULL, 1440558283),
(4, NULL, 'recipe', NULL, 'Recipes', NULL, '<p>\n	Recipes Page Menu Description</p>\n', 'recipes', NULL, 'top', NULL, NULL, NULL, NULL, NULL, NULL, 'publish', 1432635063, 1432757350),
(5, NULL, 'page', NULL, 'About KEWPIE', NULL, '<p class="p1">\n	PT. KEWPIE INDONESIA started business in Indonesia in 2013 and in October 2014, it started selling Food Service products. As a halal and NKV certified products, KEWPIE INDONESIA provides halal, safe and high quality food products for all Indonesian consumers.</p>\n<p class="p1">\n	&nbsp;</p>\n<h2 class="p1">\n	<strong><span style="font-size:16px;">Corporate Timeline</span></strong></h2>\n<p class="p1">\n	<strong>1919</strong></p>\n<p class="p1">\n	Shokuhin Kogyo Co., Ltd, a company that started KEWPIE Corporation established in Otaki-cho, Nakano-ku, Tokyo, began producing and processing many kind of food products.&nbsp;</p>\n<p class="p1">\n	&nbsp;</p>\n<p class="p1">\n	<strong>1925</strong></p>\n<p class="p1">\n	KEWPIE Mayonnaise hit the market in 100 gram and 128 gram glass jars, also as the first Japan mayonnaise in jars.</p>\n<p class="p1">\n	&nbsp;</p>\n<p class="p1">\n	<strong>1957</strong></p>\n<p class="p1">\n	The company name changed to KEWPIE Corporation, following the famous mayonnaise brand.</p>\n<p class="p1">\n	&nbsp;</p>\n<p class="p1">\n	<strong>2013</strong></p>\n<p class="p1">\n	PT. KEWPIE INDONESIA established</p>\n<p class="p1">\n	&nbsp;</p>\n<p class="p1">\n	<strong>2014</strong></p>\n<p class="p1">\n	PT. KEWPIE INDONESIA products got halal certification and NKV, also starts the selling of Food Service.</p>\n<p class="p1">\n	&nbsp;</p>\n<p class="p1">\n	<strong>2015</strong></p>\n<p class="p1">\n	PT KEWPIE INDONESIA begins to sell retail products</p>\n<p class="p1">\n	&nbsp;</p>\n<h2 class="p1">\n	<span style="font-size:16px;"><strong>Halal Certification and NKV</strong></span></h2>\n<p class="p1">\n	All KEWPIE Indonesia products are halal certified, issued by LPPOM MUI. All egg based products also have NKV certification.</p>\n<p class="p1">\n	<img alt="" class="pull-right" src="/uploads/static/content/images/halal.png" style="width: 197px; height: 72px;" /></p>\n', 'who-are-we', 'd88f0-ba71d-baby-kewpie.jpg', 'top', NULL, NULL, NULL, NULL, NULL, NULL, 'publish', 1432635116, 1455711332),
(6, NULL, 'news', NULL, 'Latest News', NULL, '<p>\n	Latest News menu description</p>\n', 'latest-news', '', 'top', NULL, NULL, NULL, NULL, NULL, NULL, 'publish', 1432635133, 1452999608),
