(1, 1, NULL, 'KEWPIE MAYONNAISE ORIGINAL', 'kewpie-mayonnaise-original', '<p>\n	Japanese Style</p>\n', '<p class="p1">\n	Rich in eggs, KEWPIE MAYONNAISE ORIGINAL is a perfect match for salads or any fried snacks.<br />\n	Also available in plastic bag and sachet</p>\n', '55f6a-kewpie-mayonais-original.png', '<h3 class="p1 panel-title panel-title-landing">\n	Nutrition Fact</h3>\n<div class="panel-body panel-body-landing">\n	<table class="table">\n		<tbody>\n			<tr>\n				<td>\n					Energy (kcal)</td>\n				<td width="50px">\n					100</td>\n			</tr>\n			<tr>\n				<td>\n					Energy from Fat (kcal)&nbsp;</td>\n				<td width="50px">\n					100</td>\n			</tr>\n			<tr>\n				<td>\n					Total Fat (g)</td>\n				<td width="50px">\n					11</td>\n			</tr>\n			<tr>\n				<td>\n					Protein (g)</td>\n				<td width="50px">\n					1</td>\n			</tr>\n			<tr>\n				<td>\n					Carbohydrate (g)</td>\n				<td width="50px">\n					0</td>\n			</tr>\n			<tr>\n				<td>\n					Sodium (mg)</td>\n				<td width="50px">\n					70</td>\n			</tr>\n		</tbody>\n	</table>\n</div>\n<p>\n	&nbsp;</p>\n', NULL, NULL, 'yes', NULL, 1, NULL, NULL, 'publish', 1432736374, 1454557691),
(2, 1, NULL, 'KEWPIE MAYONNAISE ORIGINAL SWEET', 'kewpie-mayonnaise-original-sweet', '<p>\n	Mild Type</p>\n', '<p class="p1">\n	KEWPIE MAYONNAISE ORIGINAL SWEET comes with a sweeter taste. Tasty and soft, suitable for a mixed condiment or as dressing for fruit salad.<br />\n	Also available in sachet&nbsp;</p>\n', '1d4b4-kewpie333738-mayonais-rev.png', '<h3 class="p1 panel-title panel-title-landing">\n	Nutrition Fact</h3>\n<div class="panel-body panel-body-landing">\n	<table class="table">\n		<tbody>\n			<tr>\n				<td>\n					Energy (kcal)</td>\n				<td width="50px">\n					104</td>\n			</tr>\n			<tr>\n				<td>\n					Energy from Fat (kcal)&nbsp;</td>\n				<td width="50px">\n					-</td>\n			</tr>\n			<tr>\n				<td>\n					Total Fat (g)</td>\n				<td width="50px">\n					11</td>\n			</tr>\n			<tr>\n				<td>\n					Protein (g)</td>\n				<td width="50px">\n					1</td>\n			</tr>\n			<tr>\n				<td>\n					Carbohydrate (g)</td>\n				<td width="50px">\n					2</td>\n			</tr>\n			<tr>\n				<td>\n					Sodium (mg)</td>\n				<td width="50px">\n					80</td>\n			</tr>\n		</tbody>\n	</table>\n</div>\n<p>\n	&nbsp;</p>\n', NULL, NULL, 'no', NULL, 2, NULL, NULL, 'publish', 1432736461, 1455073199),
(3, 1, NULL, 'KEWPIE SAUS MAYO GURIH', 'kewpie-saus-mayo-gurih', '<p>\n	Half Salad Dressing</p>\n', '<p class="p1">\n	Made from a variety of seasonings, KEWPIE SAUS MAYO GURIH makes any kinds of fried snacks become more delicious.<br />\n	Also available in sachet</p>\n', '6cb93-kewpie333738-saosmayo-rev.png', '<h3 class="p1 panel-title panel-title-landing">\n	Nutrition Fact</h3>\n<div class="panel-body panel-body-landing">\n	<table class="table">\n		<tbody>\n			<tr>\n				<td>\n					Energy (kcal)</td>\n				<td width="50px">\n					70</td>\n			</tr>\n			<tr>\n				<td>\n					Energy from Fat (kcal)&nbsp;</td>\n				<td width="50px">\n					-</td>\n			</tr>\n			<tr>\n				<td>\n					Total Fat (g)</td>\n				<td width="50px">\n					0</td>\n			</tr>\n			<tr>\n				<td>\n					Protein (g)</td>\n				<td width="50px">\n					6</td>\n			</tr>\n			<tr>\n				<td>\n					Carbohydrate (g)</td>\n				<td width="50px">\n					4</td>\n			</tr>\n			<tr>\n				<td>\n					Sodium (mg)</td>\n				<td width="50px">\n					5</td>\n			</tr>\n		</tbody>\n	</table>\n</div>\n<p>\n	&nbsp;</p>\n', NULL, NULL, 'no', NULL, 3, NULL, NULL, 'publish', 1432736506, 1455073362),
(4, 2, NULL, 'KEWPIE Salad Dressing Roasted Sesame', 'kewpie-salad-dressing-roasted-sesame', '<p>\n	Mayo Sauce</p>\n', '<p class="p1">\n	The unique aroma of roasted sesame makes KEWPIE Salad Dressing Roasted Sesame perfect for stir fry or stewed dish.<br />\n	Also available in sachet and 1 L bottle</p>\n', 'b1544-kewpie333771-wijensangrai-rev-3.png', '<h3 class="p1 panel-title panel-title-landing">\n	Nutrition Fact</h3>\n<div class="panel-body panel-body-landing">\n	<table class="table">\n		<tbody>\n			<tr>\n				<td>\n					Energy (kcal)</td>\n				<td width="50px">\n					90</td>\n			</tr>\n			<tr>\n				<td>\n					Energy from Fat (kcal)&nbsp;</td>\n				<td width="50px">\n					60</td>\n			</tr>\n			<tr>\n				<td>\n					Total Fat (g)</td>\n				<td width="50px">\n					7</td>\n			</tr>\n			<tr>\n				<td>\n					Protein (g)</td>\n				<td width="50px">\n					1</td>\n			</tr>\n			<tr>\n				<td>\n					Carbohydrate (g)</td>\n				<td width="50px">\n					5</td>\n			</tr>\n			<tr>\n				<td>\n					Sodium (mg)</td>\n				<td width="50px">\n					190</td>\n			</tr>\n		</tbody>\n	</table>\n</div>\n<p>\n	&nbsp;</p>\n', NULL, NULL, 'yes', NULL, 1, NULL, NULL, 'publish', 1432736525, 1454559742),
(5, 2, NULL, 'KEWPIE Salad Dressing Soy Sauce', 'kewpie-salad-dressing-soy-sauce', '<p>\n	Sesame Soy Sauce</p>\n', '<p class="p1">\n	Sesame and onion delights in KEWPIE Salad Dressing Sauce make a best combo with vegetables, fish or fruit.<br />\n	Also available in sachet and 1 L bottle</p>\n', '787c0-kewpie333785-kecapalajepang-botolataspenuh-rev-3.png', '<h3 class="p1 panel-title panel-title-landing">\n	Nutrition Fact</h3>\n<div class="panel-body panel-body-landing">\n	<table class="table">\n		<tbody>\n			<tr>\n				<td>\n					Energy (kcal)</td>\n				<td width="50px">\n					60</td>\n			</tr>\n			<tr>\n				<td>\n					Energy from Fat (kcal)&nbsp;</td>\n				<td width="50px">\n					45</td>\n			</tr>\n			<tr>\n				<td>\n					Total Fat (g)</td>\n				<td width="50px">\n					5</td>\n			</tr>\n			<tr>\n				<td>\n					Protein (g)</td>\n				<td width="50px">\n					1</td>\n			</tr>\n			<tr>\n				<td>\n					Carbohydrate (g)</td>\n				<td width="50px">\n					3</td>\n			</tr>\n			<tr>\n				<td>\n					Sodium (mg)</td>\n				<td width="50px">\n					260</td>\n			</tr>\n		</tbody>\n	</table>\n</div>\n<p>\n	&nbsp;</p>\n', NULL, NULL, 'no', NULL, 2, NULL, NULL, 'publish', 1432736561, 1454559963),
(6, 2, NULL, 'KEWPIE Salad Dressing Spicy Tomato ', 'kewpie-salad-dressing-spicy-tomato', '<p>\n	Roasted Sesame</p>\n', '<p class="p1">\n	KEWPIE Salad Dressing Spicy Tomato is where tomato delicacy combined with a gentle spicy taste, delicious for any kind of salads, pasta and chicken.<br />\n	Also available in sachet and 1 L bottle</p>\n', '99993-product-kewpie333751-tomatpedas.png', '<h3 class="p1 panel-title panel-title-landing">\n	Nutrition Fact</h3>\n<div class="panel-body panel-body-landing">\n	<table class="table">\n		<tbody>\n			<tr>\n				<td>\n					Energy (kcal)</td>\n				<td width="50px">\n					80</td>\n			</tr>\n			<tr>\n				<td>\n					Energy from Fat (kcal)&nbsp;</td>\n				<td width="50px">\n					50</td>\n			</tr>\n			<tr>\n				<td>\n					Total Fat (g)</td>\n				<td width="50px">\n					6</td>\n			</tr>\n			<tr>\n				<td>\n					Protein (g)</td>\n				<td width="50px">\n					1</td>\n			</tr>\n			<tr>\n				<td>\n					Carbohydrate (g)</td>\n				<td width="50px">\n					5</td>\n			</tr>\n			<tr>\n				<td>\n					Total Sugar</td>\n				<td width="50px">\n					6</td>\n			</tr>\n			<tr>\n				<td>\n					Sodium (mg)</td>\n				<td width="50px">\n					350</td>\n			</tr>\n		</tbody>\n	</table>\n</div>\n<p>\n	&nbsp;</p>\n', NULL, NULL, 'no', NULL, 3, NULL, NULL, 'publish', 1432736577, 1454570740),
(7, 2, NULL, 'KEWPIE Salad Dressing Caesar ', 'kewpie-salad-dressing-caesar', '<p>\n	Wasabi Taste</p>\n', '<p class="p1">\n	Perfectly made from two kind of cheeses, KEWPIE Salad Dressing Caesar&nbsp;will add delicacy to your Caesar Salad, also goes great with any chicken menus.&nbsp;<br />\n	Also available in sachet and 1 L bottle</p>\n', '3b5c4-kewpie-caesar.png', '<h3 class="p1 panel-title panel-title-landing">\n	Nutrition Fact</h3>\n<div class="panel-body panel-body-landing">\n	<table class="table">\n		<tbody>\n			<tr>\n				<td>\n					Energy (kcal)</td>\n				<td width="50px">\n					70</td>\n			</tr>\n			<tr>\n				<td>\n					Energy from Fat (kcal)&nbsp;</td>\n				<td width="50px">\n					50</td>\n			</tr>\n			<tr>\n				<td>\n					Total Fat (g)</td>\n				<td width="50px">\n					6</td>\n			</tr>\n			<tr>\n				<td>\n					Protein (g)</td>\n				<td width="50px">\n					1</td>\n			</tr>\n			<tr>\n				<td>\n					Carbohydrate (g)</td>\n				<td width="50px">\n					3</td>\n			</tr>\n			<tr>\n				<td>\n					Sodium (mg)</td>\n				<td width="50px">\n					190</td>\n			</tr>\n		</tbody>\n	</table>\n</div>\n<p>\n	&nbsp;</p>\n', NULL, NULL, 'no', NULL, 4, NULL, NULL, 'publish', 1432736599, 1454417120),
(8, 2, NULL, 'KEWPIE Salad Dressing Thousand Island', 'kewpie-salad-dressing-thousand-island', '<p>\n	Caesar</p>\n', '<p class="p1">\n	Add KEWPIE Salad Dressing Thousand Island into any vegetables and fruit salad. Also good to go with shrimp, for a richer taste of the food.<br />\n	Also available in sachet and 1 L bottle</p>\n', '20577-kewpie-thousand-island.png', '<h3 class="p1 panel-title panel-title-landing">\n	Nutrition Fact</h3>\n<div class="panel-body panel-body-landing">\n	<table class="table">\n		<tbody>\n			<tr>\n				<td>\n					Energy (kcal)</td>\n				<td width="50px">\n					70</td>\n			</tr>\n			<tr>\n				<td>\n					Energy From Fat (kcal)&nbsp;</td>\n				<td width="50px">\n					50</td>\n			</tr>\n			<tr>\n				<td>\n					Total Fat (g)</td>\n				<td width="50px">\n					6</td>\n			</tr>\n			<tr>\n				<td>\n					Protein (g)</td>\n				<td width="50px">\n					1</td>\n			</tr>\n			<tr>\n				<td>\n					Carbohydrate (g)</td>\n				<td width="50px">\n					4</td>\n			</tr>\n			<tr>\n				<td>\n					Sodium (mg)</td>\n				<td width="50px">\n					260</td>\n			</tr>\n		</tbody>\n	</table>\n</div>\n<p>\n	&nbsp;</p>\n', NULL, NULL, 'no', NULL, 5, NULL, NULL, 'publish', 1432736638, 1454417180),
(9, 5, NULL, 'KEWPIE SANDWICH SPREAD ORIGINAL', 'kewpie-sandwich-spread-original', '<p>\n	Hot Spicy</p>\n', '<p class="p1">\n	Sandwich spread with original flavor, perfect for any sandwich with vegetables or boiled eggs. KEWPIE SANDWICH SPREAD ORIGINAL, so handy and easy to create your home made sandwich.<br />\n	Also available in sachet&nbsp;</p>\n', '10b4c-kewpie-olesan-sandwich-original-2-2.png', '<h3 class="p1 panel-title panel-title-landing">\n	Nutrition Fact</h3>\n<div class="panel-body panel-body-landing">\n	<table class="table">\n		<tbody>\n			<tr>\n				<td>\n					Energy (kcal)</td>\n				<td width="50px">\n					70</td>\n			</tr>\n			<tr>\n				<td>\n					Energy from Fat (kcal)&nbsp;</td>\n				<td width="50px">\n					50</td>\n			</tr>\n			<tr>\n				<td>\n					Total Fat (g)</td>\n				<td width="50px">\n					6</td>\n			</tr>\n			<tr>\n				<td>\n					Protein (g)</td>\n				<td width="50px">\n					0</td>\n			</tr>\n			<tr>\n				<td>\n					Carbohydrate (g)</td>\n				<td width="50px">\n					4</td>\n			</tr>\n			<tr>\n				<td>\n					Sodium (mg)</td>\n				<td width="50px">\n					85</td>\n			</tr>\n		</tbody>\n	</table>\n</div>\n<p>\n	&nbsp;</p>\n', NULL, NULL, 'yes', NULL, 1, NULL, NULL, 'publish', 1432736661, 1454562129),
(10, 5, NULL, 'KEWPIE SANDWICH SPREAD CHEESE', 'kewpie-sandwich-spread-cheese', '<p>\n	Original</p>\n', '<p class="p1">\n	Apply KEWPIE SANDWICH SPREAD CHEESE to your smoked beef sandwich or hotdog to treat your taste buds and get the yumminess instantly.<br />\n	Also available in sachet&nbsp;</p>\n', 'c5e88-kewpie-rasa-keju.png', '<h3 class="p1 panel-title panel-title-landing">\n	Nutrition Fact</h3>\n<div class="panel-body panel-body-landing">\n	<table class="table">\n		<tbody>\n			<tr>\n				<td>\n					Energy (kcal)</td>\n				<td width="50px">\n					60</td>\n			</tr>\n			<tr>\n				<td>\n					Energy from Fat (kcal)&nbsp;</td>\n				<td width="50px">\n					40</td>\n			</tr>\n			<tr>\n				<td>\n					Total Fat (g)</td>\n				<td width="50px">\n					4,5</td>\n			</tr>\n			<tr>\n				<td>\n					Protein (g)</td>\n				<td width="50px">\n					0</td>\n			</tr>\n			<tr>\n				<td>\n					Carbohydrate (g)</td>\n				<td width="50px">\n					4</td>\n			</tr>\n			<tr>\n				<td>\n					Sodium (mg)</td>\n				<td width="50px">\n					115</td>\n			</tr>\n		</tbody>\n	</table>\n</div>\n<p class="p1">\n	&nbsp;</p>\n', NULL, NULL, 'no', NULL, 2, NULL, NULL, 'publish', 1432736680, 1454558488),
(11, 5, NULL, 'Kewpie Sandwich Spread Coconut', 'kewpie-sandwich-spread-coconut', '<p>\n	Spicy Black Pepper</p>\n', '<p class="p1">\n	KEWPIE SANDWICH SPREAD COCONUT has the unique coconut flavor never existed before. It will give any bread, fruit salad and sweet snacks the freshness and extraordinary taste you&rsquo;ve never had.<br />\n	And available with sachet and 1 L bottle</p>\n', NULL, '<h3 class="p1 panel-title panel-title-landing">\n	Average Composition Per 15 gr</h3>\n<div class="panel-body panel-body-landing">\n	<table class="table">\n		<tbody>\n			<tr>\n				<td>\n					Energy (kcal)</td>\n				<td width="50px">\n					60</td>\n			</tr>\n			<tr>\n				<td>\n					Energy From Fat (kcal)&nbsp;</td>\n				<td width="50px">\n					45</td>\n			</tr>\n			<tr>\n				<td>\n					Protein (g)</td>\n				<td width="50px">\n					0</td>\n			</tr>\n			<tr>\n				<td>\n					Fat (g)</td>\n				<td width="50px">\n					5</td>\n			</tr>\n			<tr>\n				<td>\n					Carbohidrate (g)</td>\n				<td width="50px">\n					3</td>\n			</tr>\n			<tr>\n				<td>\n					Natrium</td>\n				<td width="50px">\n					115</td>\n			</tr>\n		</tbody>\n	</table>\n</div>\n<p>\n	&nbsp;</p>\n', NULL, NULL, 'no', NULL, 3, NULL, NULL, 'unpublish', 1432736698, 1440392646),
(12, 6, NULL, 'Food Service - Commercial Products', 'food-service-commercial-products', '<p>\n	Cheesy Cheese</p>\n', '<p class="p1">\n	&nbsp;</p>\n<p class="p1">\n	We provide products tailored for food service. We have lines of Mayonnaise, Dressing and Cooking Sauce, to support high quality food creation in your business.</p>\n<p class="p1">\n	For further information, please contact for Sales Inquiries to sales@ml.kewpie.co.id&nbsp;</p>\n<p class="p1">\n	<img alt="" src="/uploads/static/content/images/contact-tag.png" style="width: 475px; height: 202px;" /></p>\n', '86da8-kewpie-big.png', NULL, NULL, NULL, 'no', NULL, 1, NULL, NULL, 'publish', 1432736716, 1441700579),
(13, 3, NULL, 'KEWPIE Banana Chocolate Spread ', 'kewpie-banana-chocolate-spread', '<p>\n	Commercial Products</p>\n', '<p class="p1">\n	KEWPIE Banana Chocolate Spread brings you joyful flavor with its unique combination. Carry this delicious sweetness everywhere in an easy to use tube pack.<br />\n	Also available in sachet</p>\n', 'b26c0-kewpie-cokelat-pisang.png', '<h3 class="p1 panel-title panel-title-landing">\n	Nutrition Fact</h3>\n<div class="panel-body panel-body-landing">\n	<table class="table">\n		<tbody>\n			<tr>\n				<td>\n					Energy (kcal)</td>\n				<td width="50px">\n					90</td>\n			</tr>\n			<tr>\n				<td>\n					Energy from Fat (kcal)&nbsp;</td>\n				<td width="50px">\n					50</td>\n			</tr>\n			<tr>\n				<td>\n					Total Fat (g)</td>\n				<td width="50px">\n					6</td>\n			</tr>\n			<tr>\n				<td>\n					Protein (g)</td>\n				<td width="50px">\n					1</td>\n			</tr>\n			<tr>\n				<td>\n					Carbohydrate (g)</td>\n				<td width="50px">\n					8</td>\n			</tr>\n			<tr>\n				<td>\n					Sodium (mg)</td>\n				<td width="50px">\n					0</td>\n			</tr>\n		</tbody>\n	</table>\n</div>\n<p>\n	&nbsp;</p>\n', NULL, NULL, 'no', NULL, 1, NULL, NULL, 'publish', 1432736779, 1454562817),
(14, 3, NULL, 'KEWPIE Coffee Chocolate Spread', 'kewpie-coffee-chocolate-spread', '<p>\n	Kewpie Original Mayonnaise</p>\n', '<p class="p1">\n	KEWPIE Coffee Chocolate Spread with a special taste of coffee, has been all ages favorite. Enjoy this sweet deliciousness in easy to carry tube pack.<br />\n	Also available in sachet</p>\n', '0bea1-kewpie-cokelat-kopi.png', '<h3 class="p1 panel-title panel-title-landing">\n	Nutrition Fact</h3>\n<div class="panel-body panel-body-landing">\n	<table class="table">\n		<tbody>\n			<tr>\n				<td>\n					<p>\n						Energy (kcal)</p>\n				</td>\n				<td>\n					<p>\n						90</p>\n				</td>\n			</tr>\n			<tr>\n				<td>\n					<p>\n						Energy from Fat (kcal)&nbsp;</p>\n				</td>\n				<td>\n					<p>\n						50</p>\n				</td>\n			</tr>\n			<tr>\n				<td>\n					<p>\n						Total Fat (g)</p>\n				</td>\n				<td>\n					<p>\n						5</p>\n				</td>\n			</tr>\n			<tr>\n				<td>\n					<p>\n						Protein (g)</p>\n				</td>\n				<td>\n					<p>\n						1</p>\n				</td>\n			</tr>\n			<tr>\n				<td>\n					<p>\n						Carbohydrate (g)</p>\n				</td>\n				<td>\n					<p>\n						9</p>\n				</td>\n			</tr>\n			<tr>\n				<td>\n					<p>\n						Sodium (mg)</p>\n				</td>\n				<td>\n					<p>\n						0</p>\n				</td>\n			</tr>\n		</tbody>\n	</table>\n</div>\n<p>\n	&nbsp;</p>\n', NULL, NULL, 'yes', NULL, 2, NULL, NULL, 'publish', 1432737543, 1454563168),
(15, 3, NULL, 'KEWPIE Orange Chocolate Spread', 'kewpie-orange-chocolate-spread', '<p>\n	Oyster Sauce</p>\n', '<p class="p1">\n	KEWPIE Orange Chocolate Spread with its orange flavors give you a new experience of enjoying bread. Enjoy this sweet deliciousness in easy to carry tube pack.<br />\n	Also available in sachet&nbsp;</p>\n', '2811e-kewpie-cokelat-jeruk.png', '<h3 class="p1 panel-title panel-title-landing">\n	Nutrition Fact</h3>\n<div class="panel-body panel-body-landing">\n	<table class="table">\n		<tbody>\n			<tr>\n				<td>\n					<p>\n						Energy (kcal)</p>\n				</td>\n				<td>\n					<p>\n						80</p>\n				</td>\n			</tr>\n			<tr>\n				<td>\n					<p>\n						Energy from Fat (kcal)&nbsp;</p>\n				</td>\n				<td>\n					<p>\n						45</p>\n				</td>\n			</tr>\n			<tr>\n				<td>\n					<p>\n						Total Fat (g)</p>\n				</td>\n				<td>\n					<p>\n						5</p>\n				</td>\n			</tr>\n			<tr>\n				<td>\n					<p>\n						Protein (g)</p>\n				</td>\n				<td>\n					<p>\n						0</p>\n				</td>\n			</tr>\n			<tr>\n				<td>\n					<p>\n						Carbohydrate (g)</p>\n				</td>\n				<td>\n					<p>\n						9</p>\n				</td>\n			</tr>\n			<tr>\n				<td>\n					<p>\n						Sodium (mg)</p>\n				</td>\n				<td>\n					<p>\n						0</p>\n				</td>\n			</tr>\n		</tbody>\n	</table>\n</div>\n<p>\n	&nbsp;</p>\n', NULL, NULL, 'no', NULL, 3, NULL, NULL, 'publish', 1432737703, 1454563264),
(16, 3, NULL, 'KEWPIE Vanilla Strawberry Spread', 'kewpie-vanilla-strawberry-spread', '<p>\n	Sandwich Spread</p>\n', '<p class="p1">\n	Discover the softness of vanilla flavor combined with strawberries in KEWPIE Vanilla Strawberry Spread. The sweetness of vanilla in soft textures, you can bring easily anytime anywhere.<br />\n	Also available in sachet</p>\n', '28386-kewpie-vanila-stroberi.png', '<h3 class="p1 panel-title panel-title-landing">\n	Nutrition Fact</h3>\n<div class="panel-body panel-body-landing">\n	<table class="table">\n		<tbody>\n			<tr>\n				<td style="height:16px;">\n					<p>\n						Energy (kcal)</p>\n				</td>\n				<td style="height:16px;">\n					<p>\n						90</p>\n				</td>\n			</tr>\n			<tr>\n				<td style="height:17px;">\n					<p>\n						Energy from Fat (kcal)&nbsp;</p>\n				</td>\n				<td style="height:17px;">\n					<p>\n						50</p>\n				</td>\n			</tr>\n			<tr>\n				<td style="height:17px;">\n					<p>\n						Total Fat (g)</p>\n				</td>\n				<td style="height:17px;">\n					<p>\n						6</p>\n				</td>\n			</tr>\n			<tr>\n				<td style="height:17px;">\n					<p>\n						Protein (g)</p>\n				</td>\n				<td style="height:17px;">\n					<p>\n						0</p>\n				</td>\n			</tr>\n			<tr>\n				<td style="height:17px;">\n					<p>\n						Carbohydrate (g)</p>\n				</td>\n				<td style="height:17px;">\n					<p>\n						9</p>\n				</td>\n			</tr>\n			<tr>\n				<td style="height:19px;">\n					<p>\n						Sodium (mg)</p>\n				</td>\n				<td style="height:19px;">\n					<p>\n						0</p>\n				</td>\n			</tr>\n		</tbody>\n	</table>\n</div>\n<p>\n	&nbsp;</p>\n', NULL, NULL, 'no', NULL, 4, NULL, NULL, 'publish', 1432737769, 1454563314),
