INSERT INTO `tbl_translations` (`id`, `table`, `field_id`, `lang_id`, `name`, `subject`, `url`, `synopsis`, `text`, `attribute`, `messages`, `user_id`, `count`, `status`, `added`, `modified`) VALUES
(1, 'tbl_pages', 1, 1, NULL, 'Kini KEWPIE Hadir di Indonesia!', 'kini-kewpie-hadir-di-indonesia', NULL, '<p>\n	Dengan pengalaman hampir 100 tahun di Jepang. KEWPIE kini menghadirkan produk-produk lezat dan bermanfaat untuk Anda di Indonesia.</p>\n', NULL, NULL, 1, NULL, 1, 1432742665, 1455709981),
(2, 'tbl_pages', 8, 1, NULL, 'Mayonais', 'mayonais', '<p>\n	Mayonais</p>\n', '<p>\n	Mayonais</p>\n', NULL, NULL, 1, NULL, 1, 1432742735, 1432742819),
(5, 'tbl_page_menus', 2, 1, NULL, 'Produk Kami', 'produk-kami', NULL, '<p>\n	Mulai dari mayonais, dressing, hingga olesan untuk roti, KEWPIE INDONESIA menghadirkan berbagai jenis produk yang &nbsp;menjadi pelezat hidangan Anda!&nbsp;</p>\n', NULL, NULL, 1, NULL, 1, 1432743088, 1439539269),
(6, 'tbl_page_menus', 3, 1, NULL, 'Di Dalam KEWPIE', 'di-dalam-kewpie', '<h3>\n	Bahan Dasar KEWPIE&nbsp;MAYONAIS</h3>\n<p class="p1">\n	Terbuat dari telur, cuka dan minyak sayur yang diproses dengan teknologi modern KEWPIE, Mayonais KEWPIE diproduksi melalui proses emulsi yang sangat baik. Proses emulsi ini menghasilkan partikel yang lebih kecil dan lebih rapat dibanding produk mayonais lain, sehingga KEWPIE MAYONAIS memiliki rasa yang lembut dan padat.</p>\n', '<h2 class="p1">\n	<strong>Asal Mula Mayonais KEWPIE</strong></h2>\n<p class="p1">\n	Touichiro Nakashima (penemu KEWPIE mayonais) pertama kali mengenal mayonais pada tahun 1912, saat ia berkunjung ke Amerika Serikat untuk mempelajari makanan kaleng. Saat itu, dalam kesehariannya orang Amerika menyantap salad kentang dengan mayonais. Santapan yang lezat dan bergizi ini begitu berkesan bagi Nakashima sehingga ia bertekad untuk menyebarluaskan mayonais di Jepang.</p>\n<p class="p1">\n	Sekembalinya ke Jepang, Nakashima mulai mengembangkan mayonais bergizi tinggi, yang banyak mengandung kuning telur. Mayonais tersebut mulai dijual di Jepang pada tahun 1925 dengan merek KEWPIE. KEWPIE Mayonais merupakan mayonais produksi dalam negeri pertama di Jepang.</p>\n<p class="p1">\n	Pada perkembangannya sekarang, selain mayonais, KEWPIE menyediakan produk-produk makanan yang berkualitas untuk segala usia di berbagai negara di dunia.&nbsp;</p>\n<p class="p1">\n	&nbsp;</p>\n<h2 class="p1">\n	<strong>Bahan Dasar KEWPIE Mayonais</strong></h2>\n<p class="p1">\n	Terbuat dari telur, cuka dan minyak sayur yang diproses dengan teknologi modern KEWPIE, Mayonais KEWPIE diproduksi melalui proses emulsi yang sangat baik. Proses emulsi ini menghasilkan partikel yang lebih kecil dan lebih rapat, dibanding produk mayonais lain. Sehingga KEWPIE mayonais memiliki rasa yang lembut dan padat.</p>\n<p class="p1">\n	&nbsp;</p>\n<h2 class="p1">\n	<strong>Proses Produksi</strong></h2>\n<p class="p1">\n	Semua varian produk dari KEWPIE INDONESIA dibuat dari bahan-bahan berkualitas, diproses dengan baik sehingga menghasilkan produk yang aman dikonsumsi. Dengan tube berstandar pangan, produk-produk Mayonais, Olesan Sandwich serta Saus Manis mudah digunakan dan dibawa. Sangat praktis untuk membuat lining pada makanan atau kreasi gambar pada roti.</p>\n', NULL, NULL, 1, NULL, 1, 1432743463, 1441008600),
(7, 'tbl_page_menus', 4, 1, NULL, 'Resep', 'resep', NULL, '<p>\n	Resep</p>\n', NULL, NULL, 1, NULL, 1, 1432743483, 1432756684),
(8, 'tbl_page_menus', 5, 1, NULL, 'Tentang Kewpie', 'tentang-kewpie', NULL, '<p class="p1">\n	PT. KEWPIE INDONESIA berdiri pada tahun 2013 dan memulai penjualan pertama khusus Food Service pada bulan Oktober 2014 . Dengan sertifikat halal dan NKV, KEWPIE INDONESIA menyediakan produk makanan halal, aman serta berkualitas untuk masyarakat Indonesia.&nbsp;</p>\n<p class="p1">\n	&nbsp;</p>\n<h2 class="p1">\n	<span style="font-size:16px;"><strong>Timeline Perusahaan</strong></span></h2>\n<p class="p1">\n	<strong>1919</strong></p>\n<p class="p1">\n	Shokuhin Kogyo Co., Ltd, perusahaan awal yang sekarang disebut KEWPIE Corporation berdiri di Otaki-cho, Nakano-ku, Tokyo dan mulai memproduksi serta mengolah berbagai macam produk makanan.</p>\n<p class="p1">\n	&nbsp;</p>\n<p class="p1">\n	<strong>1925</strong></p>\n<p class="p1">\n	Penjualan KEWPIE Mayonais dimulai. Mayonais KEWPIE dijual dalam kemasan toples kaca dengan berat 100 gram dan 128 gram, serta merupakan mayonais dalam kemasan toples pertama di Jepang.</p>\n<p class="p1">\n	&nbsp;</p>\n<p class="p1">\n	<strong>1957</strong></p>\n<p class="p1">\n	Perusahaan berganti nama menjadi KEWPIE Corporation, sesuai dengan nama merek mayonais yang sudah terkenal.</p>\n<p class="p1">\n	&nbsp;</p>\n<p class="p1">\n	<strong>2013</strong></p>\n<p class="p1">\n	PT. KEWPIE INDONESIA berdiri.</p>\n<p class="p1">\n	&nbsp;</p>\n<p class="p1">\n	<strong>2014</strong></p>\n<p class="p1">\n	Produk-produk PT. KEWPIE INDONESIA mendapatkan sertifikasi Halal dan NKV, serta memulai penjualan untuk produk Food Service.&nbsp;</p>\n<p class="p1">\n	&nbsp;</p>\n<p class="p1">\n	<strong>2015</strong></p>\n<p class="p1">\n	Penjualan produk retail PT. KEWPIE INDONESIA dimulai.&nbsp;</p>\n<p class="p1">\n	&nbsp;</p>\n<h2 class="p1">\n	<span style="font-size:16px;"><strong>Sertifikasi Halal dan NKV</strong></span></h2>\n<p class="p1">\n	Seluruh produk KEWPIE INDONESIA bersertifikat halal resmi yang dikeluarkan oleh LPPOM MUI. Produk-produk yang berbahan dasar telur telah memiliki NKV resmi.&nbsp;</p>\n<p class="p1">\n	<img alt="" class="pull-right" src="/uploads/static/content/images/halal.png" style="width: 197px; height: 72px;" /></p>\n', NULL, NULL, 1, NULL, 1, 1432743493, 1441196604),
(9, 'tbl_page_menus', 6, 1, NULL, 'Berita Terbaru', 'berita-terbaru', NULL, '<p>\n	Berita Terbaru</p>\n', NULL, NULL, 1, NULL, 1, 1432743507, 1432756696),
(10, 'tbl_page_menus', 1, 1, NULL, 'Beranda', 'beranda', NULL, '<p>\n	Beranda</p>\n', NULL, NULL, 1, NULL, 1, 1432743518, 1432756702),
(14, 'tbl_products', 2, 1, NULL, 'KEWPIE MAYONAIS ORIGINAL RASA MANIS', 'kewpie-mayonais-original-rasa-manis', '<p>\n	Tipe yg lembut</p>\n', '<p class="p1">\n	KEWPIE MAYONAIS ORIGINAL RASA MANIS,&nbsp; hadir dengan rasa yang lebih manis. Lezat dan lembut, cocok untuk campuran sambal maupun saus untuk salad buah.&nbsp;<br />\n	Tersedia juga kemasan sachet&nbsp;</p>\n', '<h3 class="p1 panel-title panel-title-landing">\n	Informasi Nilai Gizi</h3>\n<div class="panel-body panel-body-landing">\n	<table class="table">\n		<tbody>\n			<tr>\n				<td>\n					Energi (kkal)</td>\n				<td width="50px">\n					104</td>\n			</tr>\n			<tr>\n				<td>\n					Energi dari Lemak (kkal)&nbsp;</td>\n				<td width="50px">\n					-</td>\n			</tr>\n			<tr>\n				<td>\n					Lemak Total (g)</td>\n				<td width="50px">\n					11</td>\n			</tr>\n			<tr>\n				<td>\n					Protein (g)</td>\n				<td width="50px">\n					1</td>\n			</tr>\n			<tr>\n				<td>\n					Karbohidrat (g)</td>\n				<td width="50px">\n					<p>\n						2</p>\n				</td>\n			</tr>\n			<tr>\n				<td>\n					Natrium (mg)</td>\n				<td width="50px">\n					80</td>\n			</tr>\n		</tbody>\n	</table>\n</div>\n<p>\n	&nbsp;</p>\n', NULL, 1, NULL, 1, 1432744963, 1441009091),
(13, 'tbl_products', 1, 1, NULL, 'KEWPIE MAYONAIS ORIGINAL', 'kewpie-mayonais-original', '<p>\n	Ala Orang Jepang</p>\n', '<p class="p1">\n	Kaya akan telur, membuat KEWPIE MAYONAIS ORIGINAL sangat cocok untuk ditambahkan pada salad maupun teman makan gorengan.<br />\n	Tersedia juga kemasan plastic bag dan sachet</p>\n', '<h3 class="p1 panel-title panel-title-landing">\n	Informasi Nilai Gizi</h3>\n<div class="panel-body panel-body-landing">\n	<table class="table">\n		<tbody>\n			<tr>\n				<td>\n					Energi (kkal)</td>\n				<td width="50px">\n					100</td>\n			</tr>\n			<tr>\n				<td>\n					Energi dari Lemak (kkal)&nbsp;</td>\n				<td width="50px">\n					100</td>\n			</tr>\n			<tr>\n				<td>\n					Lemak Total (g)</td>\n				<td width="50px">\n					11</td>\n			</tr>\n			<tr>\n				<td>\n					Protein (g)</td>\n				<td width="50px">\n					1</td>\n			</tr>\n			<tr>\n				<td>\n					Karbohidrat (g)</td>\n				<td width="50px">\n					<p>\n						0</p>\n				</td>\n			</tr>\n			<tr>\n				<td>\n					Natrium (mg)</td>\n				<td width="50px">\n					70</td>\n			</tr>\n		</tbody>\n	</table>\n</div>\n<p class="p1">\n	&nbsp;</p>\n', NULL, 1, NULL, 1, 1432744925, 1441009071),
(15, 'tbl_products', 14, 1, NULL, 'KEWPIE SAUS MANIS Rasa Cokelat Kopi', 'kewpie-saus-manis-rasa-cokelat-kopi', '<p>\n	Mayonais</p>\n', '<p>\n	KEWPIE SAUS MANIS Rasa Cokelat Kopi dengan rasa kopi yang spesial, disukai segala usia. Saus manis cokelat yang lezat, mudah digunakan dan dibawa.&nbsp;<br />\n	Tersedia kemasan sachet.</p>\n', '<h3 class="p1 panel-title panel-title-landing">\n	Informasi Nilai Gizi</h3>\n<div class="panel-body panel-body-landing">\n	<table class="table">\n		<tbody>\n			<tr>\n				<td>\n					<p>\n						Energi (kkal)</p>\n				</td>\n				<td>\n					<p>\n						80</p>\n				</td>\n			</tr>\n			<tr>\n				<td>\n					<p>\n						Energi dari Lemak (kkal)&nbsp;</p>\n				</td>\n				<td>\n					<p>\n						45</p>\n				</td>\n			</tr>\n			<tr>\n				<td>\n					<p>\n						Lemak Total (g)</p>\n				</td>\n				<td>\n					<p>\n						5</p>\n				</td>\n			</tr>\n			<tr>\n				<td>\n					<p>\n						Protein (g)</p>\n				</td>\n				<td>\n					<p>\n						0</p>\n				</td>\n			</tr>\n			<tr>\n				<td>\n					<p>\n						Karbohidrat (g)</p>\n				</td>\n				<td>\n					<p>\n						9</p>\n				</td>\n			</tr>\n			<tr>\n				<td>\n					<p>\n						Natrium (mg)</p>\n				</td>\n				<td>\n					<p>\n						0</p>\n				</td>\n			</tr>\n		</tbody>\n	</table>\n</div>\n<p>\n	&nbsp;</p>\n', NULL, 1, NULL, 1, 1432744987, 1441009384),
(16, 'tbl_products', 15, 1, NULL, 'KEWPIE SAUS MANIS Rasa Cokelat Jeruk', 'kewpie-saus-manis-rasa-cokelat-jeruk', '<p>\n	Saus Tiram</p>\n', '<p>\n	KEWPIE SAUS MANIS Rasa Cokelat Jeruk, rasa jeruknya memberikan pengalaman baru makan roti. Saus manis cokelat yang lezat, mudah digunakan dan dibawa.&nbsp;<br />\n	Tersedia juga kemasan sachet&nbsp;</p>\n', '<h3 class="p1 panel-title panel-title-landing">\n	Infromasi Nilai Gizi</h3>\n<div class="panel-body panel-body-landing">\n	<table class="table">\n		<tbody>\n			<tr>\n				<td>\n					<p>\n						Energi (kkal)</p>\n				</td>\n				<td>\n					<p>\n						80</p>\n				</td>\n			</tr>\n			<tr>\n				<td>\n					<p>\n						Energi dari Lemak (kkal)&nbsp;</p>\n				</td>\n				<td>\n					<p>\n						45</p>\n				</td>\n			</tr>\n			<tr>\n				<td>\n					<p>\n						Lemak Total (g)</p>\n				</td>\n				<td>\n					<p>\n						5</p>\n				</td>\n			</tr>\n			<tr>\n				<td>\n					<p>\n						Protein (g)</p>\n				</td>\n				<td>\n					<p>\n						0</p>\n				</td>\n			</tr>\n			<tr>\n				<td>\n					<p>\n						Karbohidrat (g)</p>\n				</td>\n				<td>\n					<p>\n						9</p>\n				</td>\n			</tr>\n			<tr>\n				<td>\n					<p>\n						Natrium (mg)</p>\n				</td>\n				<td>\n					<p>\n						0</p>\n				</td>\n			</tr>\n		</tbody>\n	</table>\n</div>\n<p>\n	&nbsp;</p>\n', NULL, 1, NULL, 1, 1432745001, 1441009431),
(17, 'tbl_products', 16, 1, NULL, 'KEWPIE SAUS MANIS Rasa Vanila Stroberi', 'kewpie-saus-manis-rasa-vanila-stroberi', '<p>\n	Sandwich Tebar</p>\n', '<p>\n	Temukan kelembutan rasa vanila yang berpadu dengan stroberi dalam KEWPIE SAUS MANIS Rasa Vanila Stroberi. Saus manis vanila yang lembut, mudah digunakan dan dibawa.&nbsp;<br />\n	Tersedia juga kemasan sachet.</p>\n', '<h3 class="p1 panel-title panel-title-landing">\n	Informasi Nilai Gizi</h3>\n<div class="panel-body panel-body-landing">\n	<table class="table">\n		<tbody>\n			<tr>\n				<td style="height:16px;">\n					<p>\n						Energi (kkal)</p>\n				</td>\n				<td style="height:16px;">\n					<p>\n						90</p>\n				</td>\n			</tr>\n			<tr>\n				<td style="height:17px;">\n					<p>\n						Energi dari Lemak (kkal)&nbsp;</p>\n				</td>\n				<td style="height:17px;">\n					<p>\n						50</p>\n				</td>\n			</tr>\n			<tr>\n				<td style="height:17px;">\n					<p>\n						Lemak Total (g)</p>\n				</td>\n				<td style="height:17px;">\n					<p>\n						6</p>\n				</td>\n			</tr>\n			<tr>\n				<td style="height:17px;">\n					<p>\n						Protein (g)</p>\n				</td>\n				<td style="height:17px;">\n					<p>\n						0</p>\n				</td>\n			</tr>\n			<tr>\n				<td style="height:17px;">\n					<p>\n						Karbohidrat (g)</p>\n				</td>\n				<td style="height:17px;">\n					<p>\n						9</p>\n				</td>\n			</tr>\n			<tr>\n				<td style="height:19px;">\n					<p>\n						Natrium&nbsp;<span style="font-size: 12px;">(mg)</span></p>\n				</td>\n				<td style="height:19px;">\n					<p>\n						0</p>\n				</td>\n			</tr>\n		</tbody>\n	</table>\n</div>\n<p>\n	&nbsp;</p>\n', NULL, 1, NULL, 1, 1432745011, 1441009458),
(18, 'tbl_products', 17, 1, NULL, 'KEWPIE SAUS MANIS Rasa Vanila Nanas', 'kewpie-saus-manis-rasa-vanila-nanas', '<p>\n	Saus Manis</p>\n', '<p>\n	KEWPIE SAUS MANIS Rasa Vanila Nanas, hadirkan rasa nanas segar baru untuk roti dan cemilan. Saus manis vanila yang lembut, mudah digunakan dan dibawa.&nbsp;<br />\n	Tersedia juga kemasan sachet</p>\n', '<h3 class="p1 panel-title panel-title-landing">\n	Informasi Nilai Gizi</h3>\n<div class="panel-body panel-body-landing">\n	<table class="table">\n		<tbody>\n			<tr>\n				<td style="height:16px;">\n					<p>\n						Energi (kkal)</p>\n				</td>\n				<td style="height:16px;">\n					<p>\n						90</p>\n				</td>\n			</tr>\n			<tr>\n				<td style="height:17px;">\n					<p>\n						Energi dari Lemak (kkal)&nbsp;</p>\n				</td>\n				<td style="height:17px;">\n					<p>\n						50</p>\n				</td>\n			</tr>\n			<tr>\n				<td style="height:17px;">\n					<p>\n						Lemak Total (g)</p>\n				</td>\n				<td style="height:17px;">\n					<p>\n						5</p>\n				</td>\n			</tr>\n			<tr>\n				<td style="height:17px;">\n					<p>\n						Protein (g)</p>\n				</td>\n				<td style="height:17px;">\n					<p>\n						0</p>\n				</td>\n			</tr>\n			<tr>\n				<td style="height:17px;">\n					<p>\n						Karbohidrat (g)</p>\n				</td>\n				<td style="height:17px;">\n					<p>\n						9</p>\n				</td>\n			</tr>\n			<tr>\n				<td style="height:19px;">\n					Gula Total (g)</td>\n				<td style="height:19px;">\n					10</td>\n			</tr>\n			<tr>\n				<td style="height:19px;">\n					<p>\n						Natrium (mg)</p>\n				</td>\n				<td style="height:19px;">\n					<p>\n						0</p>\n				</td>\n			</tr>\n		</tbody>\n	</table>\n</div>\n<p>\n	&nbsp;</p>\n', NULL, 1, NULL, 1, 1432745070, 1441009476),
