(23, 'tbl_pages', 12, 1, NULL, 'Asal Mula Mayones Kewpie', 'asal-mula-mayones-kewpie', '<p>\n	<span style="font-size: 12.222222328186px;">Touichiro Nakashima (penemu KEWPIE mayonnaise) pertama kali mengenal mayonais pada tahun 1912, saat ia berkunjung ke Amerika Serikat untuk mempelajari makanan kaleng. Saat itu, dalam kesehariannya orang Amerika menyantap salad kentang dengan mayonais. Santapan yang lezat dan bergizi ini begitu berkesan bagi Nakashima sehingga ia bertekad untuk menyebarluaskan mayonais di Jepang.&nbsp;</span></p>\n', '<p>\n	Touichiro Nakashima (penemu KEWPIE mayonais) pertama kali mengenal mayonais pada tahun 1912, saat ia berkunjung ke Amerika Serikat untuk mempelajari makanan kaleng. Saat itu, dalam kesehariannya orang Amerika menyantap salad kentang dengan mayonais. Santapan yang lezat dan bergizi ini begitu berkesan bagi Nakashima sehingga ia bertekad untuk menyebarluaskan mayonais di Jepang.</p>\n<p>\n	Sekembalinya ke Jepang, Nakashima mulai mengembangkan mayonais bergizi tinggi, yang banyak mengandung kuning telur. Mayonais tersebut mulai dijual di Jepang pada tahun 1925 dengan merek KEWPIE. KEWPIE Mayonais merupakan mayonais produksi dalam negeri pertama di Jepang.</p>\n<p>\n	Pada perkembangannya sekarang, selain mayonais, KEWPIE menyediakan produk-produk makanan yang berkualitas untuk segala usia di berbagai negara di dunia.&nbsp;</p>\n', NULL, NULL, 1, NULL, 1, 1432767369, 1439544916),
(24, 'tbl_pages', 13, 1, NULL, 'Proses Produksi', 'proses-produksi', NULL, '<p>\n	Semua varian produk dari Kewpie Indonesia dibuat dari bahan-bahan berkualitas, diproses dengan baik sehingga menghasilkan produk yang aman dikonsumsi. Dengan tube berstandar pangan, produk-produk Mayonais, Olesan Sandwich serta Saus Manis mudah digunakan dan dibawa. Sangat praktis untuk membuat lining pada makanan atau kreasi gambar pada roti.</p>\n', NULL, NULL, 1, NULL, 1, 1432768802, 1432889503),
(25, 'tbl_pages', 14, 1, NULL, 'Bahan Dasar Kewpie Mayonnaise', 'bahan-dasar-kewpie-mayonnaise', NULL, '<p>\n	Made from egg, vinegar and soy oil processed with Kewpie technology, Kewpie Mayonnaise is produced in a good emulsion process. The emulsion process produces smaller and thicker particles compared to other mayonnaise products, thus making Kewpie mayonnaise tastes soft but dense.</p>\n', NULL, NULL, 1, NULL, 1, 1432789092, 1432889419),
(26, 'tbl_products', 18, 1, NULL, 'Kewpie Olesan Kelapa Vanila', 'kewpie-olesan-kelapa-vanila', NULL, '<p>\n	Kewpie Olesan Kelapa Vanila<br />\n	Dan tersedia kemasan sachet&nbsp; &amp; botol 1 L</p>\n', '<div class="panel panel-primary" style="border: none;">\n	<div class="controle-header panel-heading panel-heading-landing">\n		<h3 class="panel-title panel-title-landing">\n			Komposisi Rata-rata Per 25ml</h3>\n	</div>\n	<!-- <div class="controle-panel-heading panel-heading panel-heading-landing-box">\n                                                    Best Choice\n                                                </div> -->\n	<div class="panel-body panel-body-landing">\n		<table class="table">\n			<tbody>\n				<tr>\n					<td>\n						Energi (kcal)</td>\n					<td width="50px">\n						90</td>\n				</tr>\n				<tr>\n					<td>\n						Protein (g)</td>\n					<td width="50px">\n						90</td>\n				</tr>\n				<tr>\n					<td>\n						Lemak (g)</td>\n					<td width="50px">\n						90</td>\n				</tr>\n				<tr>\n					<td>\n						Kabohidrat (g)</td>\n					<td width="50px">\n						90</td>\n				</tr>\n			</tbody>\n		</table>\n	</div>\n	<div class="panel-footer panel-footer-landing">\n		&nbsp;</div>\n</div>\n<p>\n	&nbsp;</p>\n', NULL, 1, NULL, 1, 1432801821, 1434552608),
(27, 'tbl_products', 13, 1, NULL, 'KEWPIE SAUS MANIS Rasa Cokelat Pisang', 'kewpie-saus-manis-rasa-cokelat-pisang', NULL, '<p>\n	Rasa pisang unik KEWPIE SAUS MANIS&nbsp;Rasa Cokelat Pisang&nbsp;menghadirkan keceriaan. Saus manis cokelat yang lezat, mudah digunakan dan dibawa.<br />\n	Tersedia juga kemasan sachet</p>\n<p>\n	&nbsp;</p>\n', '<h3 class="p1 panel-title panel-title-landing">\n	Informasi Nilai Gizi</h3>\n<div class="panel-body panel-body-landing">\n	<table class="table">\n		<tbody>\n			<tr>\n				<td>\n					Energi (kkal)</td>\n				<td width="50px">\n					90</td>\n			</tr>\n			<tr>\n				<td>\n					Energi dari Lemak (kkal)&nbsp;</td>\n				<td width="50px">\n					50</td>\n			</tr>\n			<tr>\n				<td>\n					Lemak Total (g)</td>\n				<td width="50px">\n					6</td>\n			</tr>\n			<tr>\n				<td>\n					Protein (g)</td>\n				<td width="50px">\n					1</td>\n			</tr>\n			<tr>\n				<td>\n					Karbohidrat (g)</td>\n				<td width="50px">\n					8</td>\n			</tr>\n			<tr>\n				<td>\n					Natrium (mg)</td>\n				<td width="50px">\n					0</td>\n			</tr>\n		</tbody>\n	</table>\n</div>\n<p>\n	&nbsp;</p>\n', NULL, 1, NULL, 1, 1432801936, 1441091093),
(28, 'tbl_product_recipes', 1, 1, NULL, 'Gado Gado Baru', 'gado-gado-baru', '<p>\n	Gado Gado Baru</p>\n', '<ul>\n	<li>\n		Kentang</li>\n	<li>\n		Wortel</li>\n	<li>\n		Telur Rebus</li>\n	<li>\n		Kerupuk Udang</li>\n	<li>\n		Kol</li>\n	<li>\n		Tauge</li>\n	<li>\n		Lontong</li>\n	<li>\n		Kewpie Saus Siram dengan Wijen Sangrai</li>\n</ul>\n', '<p>\n	Lebih enak di hidangkan Panas-panas</p>\n', '<ol>\n	<li>\n		Rebus kol, tauge, telur, wortel serta kentang.</li>\n	<li>\n		Potong-potong lontong.</li>\n	<li>\n		Goreng kerupuk udang.</li>\n	<li>\n		Sajikan semua bahan-bahan di atas piring</li>\n	<li>\n		Tuang saus siram di atasnya.</li>\n</ol>\n', 1, NULL, 1, 1432809431, 1433350281),
(29, 'tbl_product_recipes', 2, 1, NULL, 'Seafood Salad', 'seafood-salad', '<p>\n	Seafood Salad</p>\n', '<ul>\n	<li>\n		Udang</li>\n	<li>\n		Cumi</li>\n	<li>\n		Salmon</li>\n	<li>\n		Selada</li>\n	<li>\n		Tomat Ceri</li>\n	<li>\n		Paprika Kuning</li>\n	<li>\n		Kewpie Saus Siram dengan Kecap Ala Jepang</li>\n</ul>\n', '<p>\n	Lebih nikmat di hidangkan Hangat-hangat</p>\n', '<ol>\n	<li>\n		Rebus udang dan cumi.</li>\n	<li>\n		Panggang cumi di atas wajan.</li>\n	<li>\n		Potong paprika dan tomat ceri sesuai selera.</li>\n	<li>\n		Taruh selada di atas piring, tata semua bahan di atas selada</li>\n	<li>\n		Tuangkan saus siram di atasnya.</li>\n</ol>\n', 1, NULL, 1, 1432814048, 1433350367),
(30, 'tbl_product_recipes', 3, 1, NULL, 'Buffalo Chicken Salad', 'buffalo-chicken-salad', '<p>\n	Buffalo Chicken Salad</p>\n', '<ul>\n	<li>\n		Sayap Ayam Goreng</li>\n	<li>\n		Tomat</li>\n	<li>\n		Selada</li>\n	<li>\n		Daun Bawang</li>\n	<li>\n		Jeruk Nipis</li>\n	<li>\n		Kewpie Saus Siram Tomat Pedas</li>\n</ul>\n', '<p>\n	Hidangkan hangat lebih lezat</p>\n', '<ol>\n	<li>\n		Tata selada di atas piring.</li>\n	<li>\n		Taruh ayam goreng di atasnya.</li>\n	<li>\n		Taruh jeruk nipis dan bawang merah sesuai selera</li>\n	<li>\n		Tuang saus siram di atasnya.</li>\n</ol>\n', 1, NULL, 1, 1432814051, 1433350515),
(31, 'tbl_product_recipes', 4, 1, NULL, 'Caesar Salad ala Amerika', 'caesar-salad-ala-amerika', '<p>\n	Caesar Salad ala Amerika</p>\n', '<ul>\n	<li>\n		Ayam Panggang (daging dada)</li>\n	<li>\n		Buah Zaitun (potong membentuk lingkaran)</li>\n	<li>\n		Crouton</li>\n	<li>\n		Romaine Lettuce</li>\n	<li>\n		Kewpie Saus Siram Caesar</li>\n</ul>\n', '<p>\n	Hidangkan hangat akan menjadi sempurna</p>\n', '<ol>\n	<li>\n		Panggang ayam.</li>\n	<li>\n		Potong buah zaitun membentuk lingkaran</li>\n	<li>\n		Sobek-sobek daun selada.</li>\n	<li>\n		Taruh ayam dan buah zaitun di atas selada</li>\n	<li>\n		Tuangkan saus siram di atasnya.</li>\n</ol>\n', 1, NULL, 1, 1432818645, 1433350598),
(32, 'tbl_product_recipes', 5, 1, NULL, 'Salad Rebusan', 'salad-rebusan', '<p>\n	Salad Rebusan</p>\n', '<ul>\n	<li>\n		Udang</li>\n	<li>\n		Telur</li>\n	<li>\n		Brokoli</li>\n	<li>\n		Wortel</li>\n	<li>\n		Kentang</li>\n	<li>\n		Kewpie Saus Siram Thousand Island</li>\n</ul>\n<p>\n	&nbsp;</p>\n', '<p>\n	Lebih lezat di hidangkan hangat</p>\n', '<ol>\n	<li>\n		Rebus udang, brokoli, wortel, kentang serta telur.</li>\n	<li>\n		Tata sesuai selera</li>\n	<li>\n		Tuang saus siram di atasnya.</li>\n</ol>\n', 1, NULL, 1, 1432821791, 1433350688),
(33, 'tbl_product_recipes', 6, 1, NULL, 'Masakan Rumahan Bagi Yang Sibuk', 'masakan-rumahan-bagi-yang-sibuk', NULL, '<p>\n	Home Cooking for the Busy. Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry&#39;s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.</p>\n', NULL, NULL, 1, NULL, 1, 1432829886, 1432829903),
(34, 'tbl_pages', 15, 1, NULL, 'Filosofi Perusahaan', 'filosofi-perusahaan', NULL, '<h2>\n	<strong>Motto Perusahaan</strong></h2>\n<p>\n	<strong><input alt="" src="/uploads/static/content/files/japan-word-1%281%29.jpg" style="width: 469px; height: 169px;" type="image" /></strong></p>\n<p class="p1">\n	<cite><em>Raku Gyou Kai Etsu&nbsp; &nbsp; </em></cite></p>\n<p class="p1">\n	Dalam pekerjaan, rasa sukacita sejati muncul dari kerjasama untuk mewujudkan tujuan yang sama.&nbsp; Jika proses tersebut dapat dicapai, seseorang dapat merasa lapang dan percaya diri. Rasa lapang dan percaya diri tersebut dapat meningkatkan kemampuan individual, dan kemudian mendorong perkembangan perusahaan.&nbsp;</p>\n<p class="p1">\n	&nbsp;</p>\n<h2 class="p1">\n	<strong>Prinsip Perusahaan</strong></h2>\n<p>\n	<input alt="" src="/uploads/static/content/files/japan-word-2%281%29.jpg" style="width: 469px; height: 169px;" type="image" /></p>\n<p class="p1">\n	<cite>&quot;Bertindak Menurut Moralitas&quot;, </cite></p>\n<p class="p1">\n	<cite>&quot;Berupaya Demi Orisinalitas dan Kreativitas&quot;, </cite></p>\n<p class="p1">\n	<cite>&quot;Menghargai Orangtua&quot;</cite></p>\n<p class="p1">\n	<cite>Ajaran Berharga: &quot;Dunia itu adil di luar dugaan&ldquo;</cite></p>\n<p class="p1">\n	&nbsp;</p>\n<h2 class="p1">\n	Visi</h2>\n<p class="p1">\n	Kami bertujuan untuk menjadi grup yang berkontribusi kepada budaya makan dan kesehatan dunia melalui &quot;kelezatan, kebaikan dan keunikan&quot;.</p>\n<p class="p1">\n	&nbsp;</p>\n<h2 class="p1">\n	Misi</h2>\n<p class="p1">\n	Kami akan memenuhi Kebijakan Grup, dan berusaha untuk mendapatkan kepercayaan tertinggi dari costumer kami dan pihak berkepentingan lainnya.</p>\n<h2 class="p1">\n	&nbsp;</h2>\n<h2 class="p1">\n	<strong>Tujuan</strong></h2>\n<ul>\n	<li class="p1">\n		Menciptakan produk makanan lezat yang dapat dicintai oleh masyarakat Indonesia.&nbsp;</li>\n	<li class="p1">\n		Memberikan kebaikan serta kemudahan yang terwujud dalam produk yang dibuat dari bahan baku berkualitas, serta dikemas dalam kemasan yang aman dan mudah digunakan.&nbsp;</li>\n	<li class="p1">\n		Menghadirkan keunikan dengan mengedepankan kreativitas dalam pengembangan produk.</li>\n</ul>\n', NULL, NULL, 1, NULL, 1, 1432895023, 1457061705),
(35, 'tbl_pages', 16, 1, NULL, 'Pesan Presiden Direktur', 'pesan-presiden-direktur', '<p>\n	<strong style="font-size: 16px;">Dengan &ldquo;Kelezatan, Kebaikan dan Keunikan&rdquo;, KEWPIE INDONESIA berkontribusi kepada kebiasaan makan masyarakat Indonesia.</strong></p>\n', '<p class="p1">\n	<span style="font-size:16px;"><strong>Dengan &ldquo;Kelezatan, Kebaikan dan Keunikan&rdquo;, KEWPIE INDONESIA berkontribusi kepada kebiasaan makan masyarakat Indonesia.</strong></span></p>\n<p class="p1">\n	Sejak berdiri pada tahun 1919, perhatian besar KEWPIE GROUP terhadap bahan baku yang dituangkan dalam ide &ldquo;Produk yang baik hanya terlahir dari bahan baku yang baik&rdquo;, akan terus dijaga dalam pembuatan produk sampai kapanpun.</p>\n<p class="p1">\n	Dengan ide ini juga, KEWPIE INDONESIA mempersembahkan produk halal yang aman dan terjamin, yang dibuat di lini produksi dengan kontrol kualitas menyeluruh, bagi masyarakat Indonesia. &nbsp;</p>\n<p class="p1">\n	Lalu, dengan semangat pelopor, KEWPIE GROUP memasarkan mayonais dan dressing pertama di Jepang. Berdasarkan semangat ini, di Indonesia pun kami mengusulkan kebiasaan makan yang sehat dengan mengembangkan produk saus baru yang lezat.</p>\n<p class="p1">\n	Terakhir, dengan mengutamakan konsumen, kami berusaha dengan menerapkan ide &ldquo;Kualitas Produk yang Utama&rdquo;. &ldquo;Mempersembahkan Rasa yang Digemari dalam Budaya Makan Indonesia&rdquo;, serta &ldquo;Menciptakan Budaya Makan yang Baru&rdquo;.&nbsp;<br />\n	<img alt="" src="/uploads/static/content/images/Yamashita-san-signature.png" style="width: 157px; height: 129px;" /><br />\n	<span style="font-size: 11.9999990463257px;">Tomomi&nbsp;</span><span style="font-size: 12px;">Yamashita</span></p>\n', NULL, NULL, 1, NULL, 1, 1432895208, 1441196407),
(36, 'tbl_pages', 17, 1, NULL, 'Hubungi Kami', 'hubungi-kami', '<p class="p1 hidden">\n	<span style="font-size:12px;">Ruko Kebayoran Arcade 3 Blok KA/E1-09 Bintaro Jaya, Tangerang Selatan, Indonesia</span></p>\n<p class="maps">\n	&nbsp;</p>\n', '<h2 class="p1">\n	<strong>Head Office/Factory</strong></h2>\n<p class="p1">\n	<span>Kawasan GIIC Blok CC NO.5&nbsp;Kota Deltamas</p>\n<p class="p1">\n	Cikarang Pusat, Bekasi</p>\n<p class="p1">\n	Jawa Barat, Indonesia.</p>\n<p class="p1">\n	&nbsp;</p>\n<h2 class="p1">\n	<strong>Sales Office</strong></h2>\n<p class="p1">\n	Ruko Kebayoran Arcade 3 Blok KA/E1-09</p>\n<p class="p1">\n	Bintaro Jaya, Tangerang Selatan, Indonesia.</p>\n<p class="p1">\n	&nbsp;</p>\n<h2 class="p1">\n	<strong>Email for Sales Inquiries</strong></h2>\n<p class="p1">\n	sales@ml.kewpie.co.id<br />\n	<br />\n	<!--img alt="" src="../..//uploads/static/content/images/contact-tag.png" /></p--></p>\n', NULL, NULL, 1, NULL, 1, 1432895595, 1441092121),
