(38, 'tbl_products', 4, 1, NULL, 'KEWPIE Salad Dressing  dengan Wijen Sangrai', 'kewpie-salad-dressing-dengan-wijen-sangrai', NULL, '<p class="p1">\n	Aroma wijen sangrai khasnya membuat KEWPIE Salad Dressing&nbsp;dengan Wijen Sangrai sangat pas untuk hidangan tumisan maupun rebusan.&nbsp;<br />\n	Tersedia juga kemasan sachet&nbsp; &amp; botol 1 L</p>\n', '<h3 class="p1 panel-title panel-title-landing">\n	Informasi Nilai Gizi</h3>\n<div class="panel-body panel-body-landing">\n	<table class="table">\n		<tbody>\n			<tr>\n				<td>\n					Energi (kkal)</td>\n				<td width="50px">\n					90</td>\n			</tr>\n			<tr>\n				<td>\n					Energi dari Lemak (kkal)&nbsp;</td>\n				<td width="50px">\n					60</td>\n			</tr>\n			<tr>\n				<td>\n					Lemak Total (g)</td>\n				<td width="50px">\n					7</td>\n			</tr>\n			<tr>\n				<td>\n					Protein (g)</td>\n				<td width="50px">\n					1</td>\n			</tr>\n			<tr>\n				<td>\n					Karbohidrat (g)</td>\n				<td width="50px">\n					<p>\n						5</p>\n				</td>\n			</tr>\n			<tr>\n				<td>\n					Natrium (mg)</td>\n				<td width="50px">\n					190</td>\n			</tr>\n		</tbody>\n	</table>\n</div>\n<p>\n	&nbsp;</p>\n', NULL, 1, NULL, 1, 1432898662, 1441009134),
(58, 'tbl_products', 12, 1, NULL, 'Bisnis Makanan - Produk Komersial', 'bisnis-makanan-produk-komersial', NULL, '<p>\n	Kami menyediakan produk-produk yang disesuaikan dengan kebutuhan food service atau bisnis makanan. Terdiri dari Mayonnaise, Dressing dan Cooking Sauce, kami dapat mendukung penciptaan makanan yang berkualitas.</p>\n<p>\n	<br />\n	Untuk informasi lebih lanjut, silahkan hubungi sales@ml.kewpie.co.id</p>\n<p>\n	<img alt="" src="/uploads/static/content/images/contact-tag.png" style="width: 475px; height: 202px;" /></p>\n', NULL, NULL, 1, NULL, 1, 1434015781, 1441700718),
(39, 'tbl_products', 5, 1, NULL, 'KEWPIE Salad Dressing  dengan Kecap Ala Jepang', 'kewpie-salad-dressing-dengan-kecap-ala-jepang', NULL, '<p class="p1">\n	Kelezatan wijen dan bawang bombay yang terkandung dalam KEWPIE Salad Dressing&nbsp;dengan Kecap Ala Jepang sangat pas dipadukan dengan sayuran, ikan maupun buah.&nbsp;<br />\n	Tersedia juga kemasan sachet&nbsp; &amp; botol 1 L</p>\n', '<h3 class="p1 panel-title panel-title-landing">\n	Informasi Nilai Gizi</h3>\n<div class="panel-body panel-body-landing">\n	<table class="table">\n		<tbody>\n			<tr>\n				<td>\n					Energi (kkal)</td>\n				<td width="50px">\n					60</td>\n			</tr>\n			<tr>\n				<td>\n					Energi dari Lemak (kkal)&nbsp;</td>\n				<td width="50px">\n					45</td>\n			</tr>\n			<tr>\n				<td>\n					Lemak Total (g)</td>\n				<td width="50px">\n					5</td>\n			</tr>\n			<tr>\n				<td>\n					Protein (g)</td>\n				<td width="50px">\n					1</td>\n			</tr>\n			<tr>\n				<td>\n					Karbohidrat (g)</td>\n				<td width="50px">\n					<p>\n						3</p>\n				</td>\n			</tr>\n			<tr>\n				<td>\n					Natrium (mg)</td>\n				<td width="50px">\n					260</td>\n			</tr>\n		</tbody>\n	</table>\n</div>\n<p>\n	&nbsp;</p>\n', NULL, 1, NULL, 1, 1432899088, 1441091226),
(40, 'tbl_products', 6, 1, NULL, 'KEWPIE Salad Dressing  Tomat Pedas', 'kewpie-salad-dressing-tomat-pedas', NULL, '<p class="p1">\n	KEWPIE Salad Dressing&nbsp;Tomat Pedas, kelezatan tomat yang berpadu dengan rasa pedas yang lembut, lezat untuk hidangan salad, pasta dan ayam.&nbsp;<br />\n	Tersedia juga kemasan sachet&nbsp; &amp; botol 1 L</p>\n', '<h3 class="p1 panel-title panel-title-landing">\n	Informasi Nilai Gizi</h3>\n<div class="panel-body panel-body-landing">\n	<table class="table">\n		<tbody>\n			<tr>\n				<td>\n					Energi (kkal)</td>\n				<td width="50px">\n					80</td>\n			</tr>\n			<tr>\n				<td>\n					Energi dari Lemak (kkal)&nbsp;</td>\n				<td width="50px">\n					50</td>\n			</tr>\n			<tr>\n				<td>\n					Lemak Total (g)</td>\n				<td width="50px">\n					6</td>\n			</tr>\n			<tr>\n				<td>\n					Protein (g)</td>\n				<td width="50px">\n					1</td>\n			</tr>\n			<tr>\n				<td>\n					Karbohidrat (g)</td>\n				<td width="50px">\n					<p>\n						5</p>\n				</td>\n			</tr>\n			<tr>\n				<td>\n					Gula Total (g)</td>\n				<td width="50px">\n					6</td>\n			</tr>\n			<tr>\n				<td>\n					Natrium (mg)</td>\n				<td width="50px">\n					350</td>\n			</tr>\n		</tbody>\n	</table>\n</div>\n<p>\n	&nbsp;</p>\n', NULL, 1, NULL, 1, 1432899609, 1441091357),
(41, 'tbl_products', 7, 1, NULL, 'KEWPIE Salad Dressing  Caesar', 'kewpie-salad-dressing-caesar', NULL, '<p class="p1">\n	Dibuat dari perpaduan dua jenis keju yang kaya, KEWPIE Salad Dressing&nbsp;Caesar melezatkan salad caesar dan juga aneka hidangan ayam.&nbsp;<br />\n	Tersedia juga kemasan sachet&nbsp; &amp; botol 1 L</p>\n', '<h3 class="p1 panel-title panel-title-landing">\n	Informasi Nilai Gizi</h3>\n<div class="panel-body panel-body-landing">\n	<table class="table">\n		<tbody>\n			<tr>\n				<td>\n					Energi (kkal)</td>\n				<td width="50px">\n					70</td>\n			</tr>\n			<tr>\n				<td>\n					Energi dari Lemak (kkal)&nbsp;</td>\n				<td width="50px">\n					50</td>\n			</tr>\n			<tr>\n				<td>\n					Lemak Total (g)</td>\n				<td width="50px">\n					6</td>\n			</tr>\n			<tr>\n				<td>\n					Protein (g)</td>\n				<td width="50px">\n					1</td>\n			</tr>\n			<tr>\n				<td>\n					Karbohidrat (g)</td>\n				<td width="50px">\n					<p>\n						3</p>\n				</td>\n			</tr>\n			<tr>\n				<td>\n					Natrium (mg)</td>\n				<td width="50px">\n					190</td>\n			</tr>\n		</tbody>\n	</table>\n</div>\n<p>\n	&nbsp;</p>\n', NULL, 1, NULL, 1, 1432900654, 1441091372),
(42, 'tbl_products', 8, 1, NULL, 'KEWPIE Salad Dressing Thousand Island', 'kewpie-salad-dressing-thousand-island', NULL, '<p class="p1">\n	Tambahkan KEWPIE Salad Dressing&nbsp;Thousand Island pada hidangan salad sayur dan buah, serta udang, untuk rasa yang lebih kaya.<br />\n	Tersedia juga kemasan sachet&nbsp; &amp; botol 1 L</p>\n', '<h3 class="p1 panel-title panel-title-landing">\n	Informasi Nilai Gizi</h3>\n<div class="panel-body panel-body-landing">\n	<table class="table">\n		<tbody>\n			<tr>\n				<td>\n					Energi (kkal)</td>\n				<td width="50px">\n					70</td>\n			</tr>\n			<tr>\n				<td>\n					Energi dari Lemak (kkal)&nbsp;</td>\n				<td width="50px">\n					50</td>\n			</tr>\n			<tr>\n				<td>\n					Lemak Total (g)</td>\n				<td width="50px">\n					6</td>\n			</tr>\n			<tr>\n				<td>\n					Protein (g)</td>\n				<td width="50px">\n					1</td>\n			</tr>\n			<tr>\n				<td>\n					Karbohidrat (g)</td>\n				<td width="50px">\n					<p>\n						4</p>\n				</td>\n			</tr>\n			<tr>\n				<td>\n					Natrium (mg)</td>\n				<td width="50px">\n					260</td>\n			</tr>\n		</tbody>\n	</table>\n</div>\n<p>\n	&nbsp;</p>\n', NULL, 1, NULL, 1, 1432901075, 1441091402),
(56, 'tbl_products', 9, 1, NULL, 'KEWPIE OLESAN SANDWICH ORIGINAL', 'kewpie-olesan-sandwich-original', NULL, '<p>\n	Olesan sandwich dengan rasa original, pas untuk isian sayuran maupun telur rebus. KEWPIE OLESAN SANDWICH ORIGINAL, praktis digunakan untuk membuat sandwich di rumah.<br />\n	Tersedia juga kemasan sachet&nbsp;</p>\n', '<h3 class="p1 panel-title panel-title-landing">\n	Informasi Nilai Gizi</h3>\n<div class="panel-body panel-body-landing">\n	<table class="table">\n		<tbody>\n			<tr>\n				<td>\n					Energi (kkal)</td>\n				<td width="50px">\n					70</td>\n			</tr>\n			<tr>\n				<td>\n					Energi dari Lemak (kkal)&nbsp;</td>\n				<td width="50px">\n					50</td>\n			</tr>\n			<tr>\n				<td>\n					Lemak Total (g)</td>\n				<td width="50px">\n					6</td>\n			</tr>\n			<tr>\n				<td>\n					Protein (g)</td>\n				<td width="50px">\n					0</td>\n			</tr>\n			<tr>\n				<td>\n					Karbohidrat (g)</td>\n				<td width="50px">\n					4</td>\n			</tr>\n			<tr>\n				<td>\n					Natrium (mg)</td>\n				<td width="50px">\n					85</td>\n			</tr>\n		</tbody>\n	</table>\n</div>\n<p>\n	&nbsp;</p>\n', NULL, 1, NULL, 1, 1434012612, 1441091955),
(57, 'tbl_products', 10, 1, NULL, 'KEWPIE OLESAN SANDWICH RASA KEJU', 'kewpie-olesan-sandwich-rasa-keju', NULL, '<p>\n	Sandwich daging asap dan hotdog akan lebih lezat dengan KEWPIE OLESAN SANDWICH RASA KEJU. Cukup dioleskan, lezat dalam sekejap.&nbsp;<br />\n	Tersedia juga kemasan sachet&nbsp;</p>\n', '<h3 class="p1 panel-title panel-title-landing">\n	Informasi Nilai Gizi</h3>\n<div class="panel-body panel-body-landing">\n	<table class="table">\n		<tbody>\n			<tr>\n				<td>\n					Energi (kkal)</td>\n				<td width="50px">\n					60</td>\n			</tr>\n			<tr>\n				<td>\n					Energi dari Lemak (kkal)&nbsp;</td>\n				<td width="50px">\n					40</td>\n			</tr>\n			<tr>\n				<td>\n					Lemak Total (g)</td>\n				<td width="50px">\n					4,5</td>\n			</tr>\n			<tr>\n				<td>\n					Protein (g)</td>\n				<td width="50px">\n					0</td>\n			</tr>\n			<tr>\n				<td>\n					Karbohidrat (g)</td>\n				<td width="50px">\n					4</td>\n			</tr>\n			<tr>\n				<td>\n					Natrium (mg)</td>\n				<td width="50px">\n					115</td>\n			</tr>\n		</tbody>\n	</table>\n</div>\n<p class="p1">\n	&nbsp;</p>\n', NULL, 1, NULL, 1, 1434012627, 1441092074),
(43, 'tbl_products', 11, 1, NULL, 'Kewpie Olesan Sandwich Rasa Kelapa', 'kewpie-olesan-sandwich-rasa-kelapa', NULL, '<p class="p1">\n	KEWPIE OLESAN SANDWICH RASA KELAPA, olesan untuk sandwich dengan rasa kelapa unik yang belum pernah ada sebelumnya. Tambahkan pada roti, salad buah maupun cemilan manis, untuk rasa yang segar!</p>\n', '<div class="col-xs-6 col-sm-6 col-md-6">\n	<div class="col-md-12" style="margin-top: 20px;">\n		<div class="pricing-table">\n			<div class="controle-header panel-heading panel-heading-landing">\n				<h3 class="panel-title panel-title-landing">\n					Komposisi Rata-rata Per 15 g</h3>\n			</div>\n			<div class="panel-body panel-body-landing">\n				<table class="table">\n					<tbody>\n						<tr>\n							<td>\n								Energi (kcal)</td>\n							<td width="50px">\n								60</td>\n						</tr>\n						<tr>\n							<td>\n								Energi dari lemak (kcal)&nbsp;</td>\n							<td width="50px">\n								45 g</td>\n						</tr>\n						<tr>\n							<td>\n								Protein (g)</td>\n							<td width="50px">\n								0 g</td>\n						</tr>\n						<tr>\n							<td>\n								Lemak (g)</td>\n							<td width="50px">\n								5 g</td>\n						</tr>\n						<tr>\n							<td>\n								Kabohidrat (g)</td>\n							<td width="50px">\n								<p>\n									3 g</p>\n							</td>\n						</tr>\n						<tr>\n							<td>\n								Natrium</td>\n							<td width="50px">\n								115 mg</td>\n						</tr>\n					</tbody>\n				</table>\n			</div>\n		</div>\n	</div>\n</div>\n<p>\n	&nbsp;</p>\n', NULL, 1, NULL, 1, 1432902127, 1434039346),
(44, 'tbl_products', 3, 1, NULL, 'KEWPIE SAUS MAYO GURIH', 'kewpie-saus-mayo-gurih', NULL, '<p class="p1">\n	Terbuat dari berbagai macam bumbu, KEWPIE SAUS MAYO GURIH cocok untuk cocolan aneka macam gorengan.<br />\n	Tersedia juga kemasan sachet</p>\n', '<div class="controle-header panel-heading panel-heading-landing">\n	<h3 class="panel-title panel-title-landing">\n		Informasi Nilai Gizi</h3>\n</div>\n<div class="panel-body panel-body-landing">\n	<table class="table">\n		<tbody>\n			<tr>\n				<td>\n					Energi (kkal)</td>\n				<td width="50px">\n					70</td>\n			</tr>\n			<tr>\n				<td>\n					Energi dari Lemak (kkal)&nbsp;</td>\n				<td width="50px">\n					-</td>\n			</tr>\n			<tr>\n				<td>\n					Lemak Total (g)</td>\n				<td width="50px">\n					6</td>\n			</tr>\n			<tr>\n				<td>\n					Protein (g)</td>\n				<td width="50px">\n					0</td>\n			</tr>\n			<tr>\n				<td>\n					Karbohidrat (g)</td>\n				<td width="50px">\n					<p>\n						4</p>\n				</td>\n			</tr>\n			<tr>\n				<td>\n					Natrium (mg)</td>\n				<td width="50px">\n					5</td>\n			</tr>\n		</tbody>\n	</table>\n</div>\n<p class="p1">\n	&nbsp;</p>\n', NULL, 1, NULL, 1, 1432907562, 1441091165),
(45, 'tbl_product_recipes', 10, 1, NULL, 'Roti Isi Telur', 'roti-isi-telur', '<p>\n	Roti Isi Telur (untuk 2 orang)</p>\n', '<ul>\n	<li>\n		3 lembar Roti Tawar Tanpa Kulit</li>\n	<li>\n		2 butir &nbsp;Telur Rebus</li>\n	<li>\n		Garam secukupnya</li>\n	<li>\n		2 sdm Kewpie Mayonais Original</li>\n</ul>\n', '<p>\n	Lebih enak di hidangkan hangat</p>\n', '<ol>\n	<li>\n		Masukkan telur rebus ke dalam mangkuk, kecil. Tambahkahancurkan dengan garpu sampai menjadi gumpalan-gumpalan. Tambahkan garam dan mayonais, campur hingga rata.</li>\n	<li>\n		Siapkan roti, oleskan mayonais di atasnya sesuai selera, tambahkan campuran telur rebus lalu tumpuk. Lakukan berulang sampai roti habis, lalu potong berbentuk segitiga. Sandwich siap disajikan.</li>\n</ol>\n', 1, NULL, 1, 1432912959, 1433351133),
(46, 'tbl_product_recipes', 13, 1, NULL, 'Sandwich Brokoli dan Telur Tumis Mayonais', 'sandwich-brokoli-dan-telur-tumis-mayonais', NULL, '<ul>\n	<li>\n		6 lembar Roti Tawar</li>\n	<li>\n		&frac12; bonggol Brokoli&nbsp;</li>\n	<li>\n		2 lembar Beef Bacon</li>\n	<li>\n		2 butir Telur&nbsp;</li>\n	<li>\n		Lada&nbsp; secukupnya</li>\n	<li>\n		&frac12; sdm KEWPIE MAYONAIS ORIGINAL</li>\n</ul>\n', '<p>\n	Lebih nikmat di hidangkan selagi hangat</p>\n', '<ol>\n	<li>\n		Pisahkan brokoli menjadi bagian-bagian kecil. Potong beef bacon sehingga lebarnya menjadi kira-kira 1 cm.</li>\n	<li>\n		Kocok telur dalam mangkuk, tambahkan mayonais &frac12; sdm, campur hingga rata.</li>\n	<li>\n		Masukkan mayonais 1 sdm ke dalam wajan, nyalakan api, tumis (1). Selagi api menyala, tambahkan mayonais lagi, tumis sebentar.</li>\n	<li>\n		Sisihkan (3) ke bagian pinggir wajan, tambahkan (2) pada tempat yang kosong dalam wajan, kecilkan api, campur semuanya hingga merata.</li>\n	<li>\n		Taruh (4) di atas roti, taburkan lada, tumpuk roti lalu potong sesuai selera.</li>\n</ol>\n', 1, NULL, 1, 1432913657, 1440479771),
(47, 'tbl_product_recipes', 12, 1, NULL, 'Roti dengan Salad Telur', 'roti-dengan-salad-telur', NULL, '<ul>\n	<li>\n		Roti Tawar &nbsp; &nbsp;&nbsp; 2 lembar</li>\n	<li>\n		Selada&nbsp; 2 lembar</li>\n	<li>\n		Telur &nbsp; 2 butir</li>\n	<li>\n		Beef Bacon* &nbsp;1 buah</li>\n	<li>\n		Minyak Goreng&nbsp; secukupnya</li>\n	<li>\n		Kewpie Mayonais Original&nbsp;&nbsp; secukupnya</li>\n</ul>\n<p style="margin-left: 40px;">\n	*) Beef bacon dapat diganti smoked beef</p>\n', '<p>\n	Lezat dan nikmat di hidangkan hangat</p>\n', '<ol>\n	<li>\n		Cuci selada dengan air dingin, lalu tiriskan airnya. Sobek menjadi ukuran yang mudah dimakan</li>\n	<li>\n		Potong bacon sehingga lebarnya menjadi kira- kira 2 cm, tumis di atas wajan tanpa menggunakan minyak. Setelah itu, tambahkan minyak di wajan yang sama, tunggu sampai panas, masukkan telur yang sudah dikocok lalu aduk secara acak.</li>\n	<li>\n		Taruh selada dan bacon di atas roti, tambahkan mayonais di atasnya</li>\n</ol>\n', 1, NULL, 1, 1432913838, 1433351205),
(48, 'tbl_product_recipes', 11, 1, NULL, 'Sandwich Tuna Gulung ', 'roti-gulung-2-jenis', NULL, '<ul>\n	<li>\n		4 lembar Roti Tawar tanpa Kulit &nbsp;&nbsp;</li>\n	<li>\n		Tuna Kalengan secukupnya</li>\n	<li>\n		1 lembar Selada keriting</li>\n	<li>\n		&frac12; lembar &nbsp;Nori/Rumput Laut Kering&nbsp;</li>\n	<li>\n		KEWPIE OLESAN SANDWICH ORIGINAL secukupnya</li>\n</ul>\n<p>\n	&nbsp;</p>\n', '<p>\n	Bentuknya unik, sangat cocok untuk bekal piknik atau makanan saat pesta</p>\n', '<ol>\n	<li>\n		Potong nori sedikit lebih kecil dari ukuran roti tawar.</li>\n	<li>\n		Oleskan KEWPIE OLESAN SANDWICH ORIGINAL di atas roti, taruh selada yang sudah disobek, nori, dan tuna secara berurutan, gulung lalu potong serong menjadi dua bagian.</li>\n</ol>\n<div>\n	*) Sebelum mengisi roti, Anda bisa meratakan roti dengan penggulung roti terlebih dahulu agar roti lebih mudah digulung.</div>\n<div>\n	**) Anda bisa menggulung roti menggunakan tatami pembuat sushi agar gulungan roti lebih rapi</div>\n', 1, NULL, 1, 1432914077, 1439363428),
(49, 'tbl_news', 2, 1, NULL, 'KEWPIE INDONESIA di Grand Opening AEON Retail (30 Mei 2015)', 'kewpie-indonesia-di-grand-opening-aeon-retail-30-mei-2015', '<div>\n	KEWPIE INDONESIA turut hadir pada event grand opening toko pertama AEON Retail, di Alam Sutera, Serpong.&nbsp;</div>\n<div>\n	Dalam kesempatan ini, <a href="http://www.kewpie.co.id/" target="_blank">KEWPIE INDONESIA</a> meluncurkan 4 produk pertamanya, yaitu MAYONAIS ORIGINAL,&nbsp;</div>\n<div>\n	Salad Dressing&nbsp;dengan Wijen Sangrai,&nbsp;Salad Dressing Tomat Pedas dan&nbsp;Salad Dressing&nbsp;Thousand Island. &nbsp;</div>\n<div>\n	Peluncuran ini juga merupakan peluncuran pertama produk KEWPIE pada retail.</div>\n<div>\n	Selain kegiatan sampling, <a href="http://www.kewpie.co.id/" target="_blank">KEWPIE INDONESIA</a> juga melakukan aktivitas cooking demo&nbsp;</div>\n<div>\n	untuk memperkenalkan produk-produk kepada para pengunjung.</div>\n', '<div>\n	KEWPIE INDONESIA turut hadir pada event grand opening toko pertama AEON Retail, di Alam Sutera, Serpong.&nbsp;</div>\n<div>\n	Dalam kesempatan ini, <a href="http://www.kewpie.co.id/" target="_blank">KEWPIE INDONESIA</a> meluncurkan 4 produk pertamanya, yaitu MAYONAIS ORIGINAL,&nbsp;</div>\n<div>\n	Salad Dressing&nbsp;dengan Wijen Sangrai, Salad Dressing Tomat Pedas dan&nbsp;Salad Dressing&nbsp;Thousand Island. &nbsp;</div>\n<div>\n	Peluncuran ini juga merupakan peluncuran pertama produk Kewpie pada retail.</div>\n<div>\n	Selain kegiatan sampling, <a href="http://www.kewpie.co.id/" target="_blank">KEWPIE INDONESIA</a> juga melakukan aktivitas cooking demo&nbsp;</div>\n<div>\n	untuk memperkenalkan produk-produk kepada para pengunjung.</div>\n', NULL, NULL, 1, NULL, 1, 1433132042, 1444976977),
(50, 'tbl_news', 3, 1, NULL, 'Ada banyak variasi tulisan Lorem Ipsum yang tersedia', 'ada-banyak-variasi-tulisan-lorem-ipsum-yang-tersedia', '<p>\r\n	Ada banyak variasi tulisan Lorem Ipsum yang tersedia, tapi kebanyakan sudah mengalami perubahan dalam beberapa bentuk, dengan humor disuntikkan, atau acak kata yang tidak terlihat bahkan sedikit dipercaya.</p>\r\n', '<p>\r\n	Ada banyak variasi tulisan Lorem Ipsum yang tersedia, tapi kebanyakan sudah mengalami perubahan dalam beberapa bentuk, dengan humor disuntikkan, atau acak kata yang tidak terlihat bahkan sedikit dipercaya. Jika Anda akan menggunakan bagian dari Lorem Ipsum, anda harus yakin tidak ada sesuatu yang memalukan yang tersembunyi di tengah-tengah teks. Semua generator Lorem Ipsum di internet cenderung untuk mengulang potongan yang telah ditetapkan sebagai diperlukan, membuat ini generator pertama yang sebenarnya di internet. Menggunakan kamus lebih dari 200 kata Latin, dikombinasikan dengan beberapa contoh struktur kalimat untuk menghasilkan Lorem Ipsum yang terlihat wajar. Oleh karena itu dihasilkan Lorem Ipsum selalu bebas dari pengulangan, humor disuntikkan, atau kata-kata non-karakteristik dll</p>\r\n', NULL, NULL, 1, NULL, 1, 1433132078, 1433132079),
(51, 'tbl_news', 1, 1, NULL, 'KEWPIE Hadir di Indonesia', 'kewpie-hadir-di-indonesia', '<div>\n	Setelah mengembangkan bisnis di 5 negara, KEWPIE Corporation membuka bisnis baru di Indonesia.&nbsp;</div>\n<div>\n	Didirikan pada tahun 2013 dengan pabrik di daerah Cikarang, <a href="http://www.kewpie.co.id/" target="_blank">PT. KEWPIE INDONESIA</a> memulai penjualan&nbsp;</div>\n<div>\n	untuk food service pada bulan Oktober 2014 dan untuk retail pada bulan Mei 2015.&nbsp;</div>\n<div>\n	Tidak hanya berkualitas dan aman, <a href="http://www.kewpie.co.id/">KEWPIE INDONESIA</a> menyediakan produk-produk yang halal dan diharapkan dapat dinikmati oleh kalangan luas di seluruh Indonesia</div>\n<div>\n	&nbsp;</div>\n', '<div>\n	Setelah mengembangkan bisnis di 5 negara, KEWPIE Corporation membuka bisnis baru di Indonesia.&nbsp;</div>\n<div>\n	Didirikan pada tahun 2013 dengan pabrik di daerah Cikarang, <a href="http://www.kewpie.co.id/" target="_blank">PT. KEWPIE INDONESIA</a> memulai penjualan&nbsp;</div>\n<div>\n	untuk food service pada bulan Oktober 2014 dan untuk retail pada bulan Mei 2015.&nbsp;</div>\n<div>\n	Tidak hanya berkualitas dan aman, <a href="http://www.kewpie.co.id/" target="_blank">KEWPIE INDONESIA</a> menyediakan produk-produk yang halal dan diharapkan dapat dinikmati oleh kalangan luas di seluruh Indonesia</div>\n<div>\n	&nbsp;</div>\n', NULL, NULL, 1, NULL, 1, 1433132157, 1444976835);
INSERT INTO `tbl_translations` (`id`, `table`, `field_id`, `lang_id`, `name`, `subject`, `url`, `synopsis`, `text`, `attribute`, `messages`, `user_id`, `count`, `status`, `added`, `modified`) VALUES
(52, 'tbl_news', 5, 1, NULL, 'Arti dari Lorem Ipsum', 'arti-dari-lorem-ipsum', '<p>\r\n	Di sisi lain, kami mencela dengan marah benar dan tidak suka laki-laki yang begitu terpedaya dan demoralisasi oleh pesona kesenangan saat ini, sehingga dibutakan oleh keinginan, bahwa mereka tidak dapat meramalkan rasa sakit dan kesulitan yang terikat untuk terjadi; dan menyalahkan sama milik mereka yang gagal dalam tugas mereka melalui kelemahan kehendak, yang sama dengan mengatakan melalui menyusut dari kerja keras dan nyeri. Kasus-kasus ini sangat sederhana dan mudah untuk membedakan.</p>\r\n', '<p>\r\n	Di sisi lain, kami mencela dengan marah benar dan tidak suka laki-laki yang begitu terpedaya dan demoralisasi oleh pesona kesenangan saat ini, sehingga dibutakan oleh keinginan, bahwa mereka tidak dapat meramalkan rasa sakit dan kesulitan yang terikat untuk terjadi; dan menyalahkan sama milik mereka yang gagal dalam tugas mereka melalui kelemahan kehendak, yang sama dengan mengatakan melalui menyusut dari kerja keras dan nyeri. Kasus-kasus ini sangat sederhana dan mudah untuk membedakan. Dalam jam gratis, ketika kekuatan kita pilihan adalah lepas dan ketika tidak ada yang mencegah kita mampu melakukan apa yang kita sukai, setiap kesenangan yang akan menyambut dan setiap rasa sakit dihindari. Tapi pada kondisi tertentu dan karena klaim dari tugas atau kewajiban bisnis sering akan terjadi bahwa kesenangan harus ditolak dan gangguan diterima. Orang bijak karena itu selalu memegang dalam hal ini prinsip ini seleksi: ia menolak kesenangan untuk mengamankan kesenangan yang lebih besar lainnya, atau dia bertahan sakit untuk menghindari rasa sakit yang lebih buruk.</p>\r\n', NULL, NULL, 1, NULL, 1, 1433132217, 1433132238),
(53, 'tbl_news', 4, 1, NULL, 'Lorem Ipsum adalah contoh teks atau dummy dalam industri percetakan dan typesetting', 'lorem-ipsum-adalah-contoh-teks-atau-dummy-dalam-industri-percetakan-dan-typesetting', '<p>\r\n	Lorem Ipsum adalah contoh teks atau dummy dalam industri percetakan dan typesetting. Lorem Ipsum telah menjadi standar industri teks dummy sejak tahun 1500-an, ketika sebuah printer yang tidak dikenal mengambil dapur jenis dan acak untuk membuat sebuah buku jenis spesimen.</p>\r\n', '<p>\r\n	Lorem Ipsum adalah contoh teks atau dummy dalam industri percetakan dan typesetting. Lorem Ipsum telah menjadi standar industri teks dummy sejak tahun 1500-an, ketika sebuah printer yang tidak dikenal mengambil dapur jenis dan acak untuk membuat sebuah buku jenis spesimen. Ini tidak hanya bertahan lima abad, tapi juga telah beralih ke penataan huruf elektronik, tanpa ada perubahan. Ini dipopulerkan pada tahun 1960 dengan merilis lembaran Letraset berisi ayat-ayat Lorem Ipsum, dan baru-baru dengan perangkat lunak desktop publishing seperti Aldus PageMaker juga memiliki versi Lorem Ipsum.</p>\r\n', NULL, NULL, 1, NULL, 1, 1433132259, 1433132272),
(54, 'tbl_product_recipes', 7, 1, NULL, 'Ayam Goreng dengan Celupan Mayo', 'ayam-goreng-dengan-celupan-mayo', NULL, '<ul>\n	<li>\n		Ayam Goreng</li>\n	<li>\n		Wortel</li>\n	<li>\n		Selada</li>\n	<li>\n		Brokoli</li>\n	<li>\n		Kentang kecil</li>\n	<li>\n		Jeruk Nipis</li>\n	<li>\n		Kewpie Mayonnaise Original</li>\n</ul>\n<p>\n	&nbsp;</p>\n', '<p>\n	Lebih enak di hidangkan panas</p>\n', '<ol>\n	<li>\n		Rebus kentang, wortel dan kentang.</li>\n	<li>\n		Atur selada di atas piring.</li>\n	<li>\n		Sajikan wortel, brokoli dan ayam goreng di atas piring.</li>\n	<li>\n		Tambahkan mayonnaise sebagai pelengkap</li>\n</ol>\n', 1, NULL, 1, 1433350827, 1433351663),
(55, 'tbl_product_recipes', 8, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, 0, 1433350918, NULL),
(59, 'tbl_product_categories', 6, 1, NULL, 'Bisnis Makanan', 'bisnis-makanan', NULL, '<p>\n	Produk Olahan Bisnis Makanan dari Kewpie</p>\n', NULL, NULL, 1, NULL, 1, 1434100596, 1441968348),
(60, 'tbl_product_recipes', 14, 1, NULL, 'Salad Kentang', 'salad-kentang', NULL, '<ul>\n	<li>\n		2 buah&nbsp;Kentang &nbsp; &nbsp;</li>\n	<li>\n		&frac14; buah Bawang Bombay</li>\n	<li>\n		&frac14; buah&nbsp;Wortel &nbsp; &nbsp;</li>\n	<li>\n		&frac14; buah&nbsp;Timun &nbsp; &nbsp;</li>\n	<li>\n		2 lembar&nbsp;Smoked Beef &nbsp; &nbsp;</li>\n	<li>\n		Garam secukupnya &nbsp;</li>\n	<li>\n		Lada secukupnya</li>\n	<li>\n		5 sdm KEWPIE MAYONAIS ORIGINAL&nbsp;</li>\n</ul>\n', '<div>\n	Dari kombinasi lezat kentang dan mayonais, tambahkan juga bahan lain untuk kreasi salad kentang Anda</div>\n<div>\n	&nbsp;</div>\n', '<ol>\n	<li>\n		Cuci kentang dan bungkus dalam keadaan basah* dengan tissue dapur kering, lalu bungkus lagi dengan plastic wrap.</li>\n	<li>\n		Panaskan dalam microwave (800W) selama sekitar 6 menit, lalu kupas kulitnya dan hancurkan dengan garpu.</li>\n	<li>\n		Potong tipis bawang bombay.</li>\n	<li>\n		Kupas kulit wortel dan potong berbentuk &frac14; lingkaran.</li>\n	<li>\n		Taruh bawang bombay dan wortel di pinggan tahan panas, lalu bungkus dengan plastik wrap.</li>\n	<li>\n		Panaskan dengan microwave (800 W) selama 2 menit.</li>\n	<li>\n		Iris tipis timun dan smoked beef.&nbsp;</li>\n	<li>\n		Campur semua bahan pada kentang yang sudah hancur.</li>\n	<li>\n		Campurkan KEWPIE MAYONAIS ORIGINAL setelah kentang dingin, lalu tambahkan garam dan lada.&nbsp;</li>\n</ol>\n<div>\n	&nbsp;</div>\n<div>\n	*) Sebagai alternatif, kentang juga bisa dibungkus dalam alumunium foil dan dikukus selama 20 menit.</div>\n<div>\n	&nbsp;</div>\n', 1, NULL, 1, 1438763891, 1440065829),
(61, 'tbl_product_recipes', 15, 1, NULL, 'Salad Buah', 'salad-buah', NULL, '<ul>\n	<li>\n		100 gram &nbsp;Semangka, potong dadu &nbsp; &nbsp;&nbsp;</li>\n	<li>\n		100 gram &nbsp;Melon, potong dadu</li>\n	<li>\n		1 buah &nbsp; Apel, potong dadu</li>\n	<li>\n		100 gram &nbsp; Selada, sobek-sobek</li>\n	<li>\n		&frac12; buah &nbsp; Buah Naga, potong dadu</li>\n	<li>\n		100 gram &nbsp; Tomat Ceri, belah dua</li>\n	<li>\n		6 buah &nbsp; Stroberi, belah dua</li>\n	<li>\n		6 buah &nbsp; Jeruk Kalengan &nbsp;</li>\n	<li>\n		KEWPIE MAYONAIS ORIGINAL RASA MANIS secukupnya, sesuai selera</li>\n</ul>\n', '<p>\n	KEWPIE MAYONAIS ORIGINAL RASA MANIS memberikan rasa manis dan lembut jika dicampurkan dengan buah yang tidak manis. Buat sendiri salad buah dengan buah-buahan kesukaan Anda.</p>\n', '<ol>\n	<li>\n		Campur semua bahan ke dalam mangkuk, tambahkan KEWPIE MAYONAIS ORIGINAL RASA MANIS di atasnya sesuai selera.</li>\n	<li>\n		Anda bisa membuat lining agar tampilannya lebih menarik.&nbsp;</li>\n	<li>\n		Sebelum disantap, campur mayonais dan buah dengan baik.</li>\n</ol>\n', 1, NULL, 1, 1438767805, 1440066732),
(62, 'tbl_product_recipes', 16, 1, NULL, 'Nasi Kepal Gurih Tuna dan Jagung', 'nasi-kepal-gurih-tuna-dan-jagung', NULL, '<ul>\n	<li>\n		400g Nasi &nbsp;&nbsp;</li>\n	<li>\n		Tuna Kalengan secukupnya</li>\n	<li>\n		1 lembar Smoked Beef &nbsp;&nbsp;</li>\n	<li>\n		2 sendok makan Jagung &nbsp;</li>\n	<li>\n		2 sdt KEWPIE SAUS MAYO GURIH</li>\n</ul>\n', '<p>\n	Mayonais membuat nasi kepal menjadi lebih gurih. Menu ini sangat cocok untuk dijadikan bekal si kecil.</p>\n', '<div>\n	<strong>Onigiri Tuna</strong></div>\n<ol>\n	<li>\n		Campur nasi dan tuna kalengan dengan saus mayo dalam satu mangkuk. Kepal-kepal sesuai selera.</li>\n</ol>\n<div>\n	<strong>Onigiri Jagung&nbsp;</strong></div>\n<ol>\n	<li>\n		Potong kotak-kotak smoked beef sebesar 1 cm.</li>\n	<li>\n		Campur nasi, smoked beef, jagung dan KEWPIE SAUS MAYO GURIH dalam satu mangkuk. Kepal-kepal sesuai selera.</li>\n</ol>\n', 1, NULL, 1, 1438773759, 1440067036),
(63, 'tbl_product_recipes', 17, 1, NULL, 'Tumis Ayam Wijen Sangrai ', 'tumis-ayam-wijen-sangrai', NULL, '<ul>\n	<li>\n		2 buah Daging Paha Ayam</li>\n	<li>\n		KEWPIE Salad Dressing dengan Wijen Sangrai secukupnya</li>\n	<li>\n		Garam secukupnya</li>\n</ul>\n<div>\n	&nbsp;</div>\n<div>\n	<strong>Bahan saus :</strong></div>\n<ul>\n	<li>\n		1/8 buah &nbsp;Bawang Bombay</li>\n	<li>\n		&frac14; buah Timun&nbsp;</li>\n	<li>\n		10 g &nbsp; Paprika Merah</li>\n	<li>\n		1 butir &nbsp; Telur</li>\n	<li>\n		KEWPIE Salad Dressing dengan Wijen Sangrai secukupnya</li>\n</ul>\n', '<div>\n	&nbsp;</div>\n<div>\n	KEWPIE Salad Dressing dengan Wijen Sangrai sangat lezat untuk berbagai masakan daging ayam</div>\n', '<div>\n	<strong>Membuat Saus:</strong></div>\n<ol>\n	<li>\n		Cincang kecil semua bahan sayuran, campurkan dengan telur di mangkuk, aduk rata.&nbsp;</li>\n	<li>\n		Panaskan wajan, masak adonan telur sampai sedikit padat. Setelah itu, angkat.</li>\n	<li>\n		Selagi panas, campur dengan KEWPIE Salad dressing dengan Wijen Sangrai, aduk rata hingga telur berbentuk gumpalan.</li>\n</ol>\n<div>\n	&nbsp;</div>\n<div>\n	<strong>Membuat Daging ayam:&nbsp;</strong></div>\n<ol>\n	<li>\n		Marinasi (rendam) daging ayam dengan KEWPIE Salad Dressing dengan Wijen Sangrai serta garam selama 1 jam.</li>\n	<li>\n		Setelah meresap dengan baik, panaskan wajan kemudian tumis ayam sampai kecokelatan. Angkat, sisihkan.&nbsp;</li>\n	<li>\n		Potong-potong daging, tata di atas piring, taruh bahan saus di atasnya. &nbsp;Jika suka, Anda dapat menambahkan lagi &nbsp;KEWPIE Salad Dressing dengan Wijen Sangrai.</li>\n</ol>\n', 1, NULL, 1, 1438853286, 1440479294),
(64, 'tbl_product_recipes', 18, 1, NULL, 'Salad Kurma', NULL, NULL, '<ul>\n	<li>\n		6 buah Kurma</li>\n	<li>\n		Daun Selada secukupnya</li>\n	<li>\n		1 pak &nbsp;Salad Campur dalam Kemasan</li>\n	<li>\n		2 buah &nbsp;Tomat Ceri</li>\n	<li>\n		Nanas potong secukupnya</li>\n	<li>\n		KEWPIE MAYONAIS ORIGINAL secukupnya</li>\n</ul>\n', '<p>\n	KEWPIE MAYONAIS ORIGINAL membuat sayuran terasa lebih lezat. Variasikan salad dengan menambahkan buah lain favorit Anda!</p>\n', '<ol>\n	<li>\n		Sobek-sobek selada menjadi ukuran yang mudah dimakan, tata di atas piring.&nbsp;</li>\n	<li>\n		Tambahkan kurma, salad campur, tomat ceri, nanas. Terakhir, tambahkan mayonais di atasnya.</li>\n	<li>\n		Sesaat sebelum disajikan, aduk terlebih dahulu.</li>\n</ol>\n', 1, NULL, 1, 1438854754, 1439267703),
(65, 'tbl_product_recipes', 19, 1, NULL, 'Sandwich Telur Orak Arik', 'sandwich-telur-orak-arik', NULL, '<ul>\n	<li>\n		2 buah &nbsp;Roti Bulat Tanpa Isi (Soft roll/Dinner roll), belah tengahnya</li>\n	<li>\n		4 potong &nbsp;Timun,potong menyerong</li>\n	<li>\n		2 buah &nbsp;Telur</li>\n	<li>\n		1 sdt &nbsp; Margarin</li>\n	<li>\n		2 sdt &nbsp; KEWPIE MAYONAIS ORIGINAL</li>\n	<li>\n		2 sdt &nbsp;&nbsp;KEWPIE OLESAN SANDWICH RASA KEJU</li>\n</ul>\n', '<div>\n	Campuran KEWPIE MAYONAIS ORIGINAL membuat telur menjadi lebih lembut meskipun sudah dingin.</div>\n<div>\n	Roti sandwich yang dioleskan KEWPIE OLESAN SANDWICH RASA KEJU pun memperkaya rasa sandwich Anda!</div>\n', '<ol>\n	<li>\n		Masukkan telur dan KEWPIE MAYONAIS ORIGINAL ke dalam mangkuk, kocok hingga merata.</li>\n	<li>\n		Panaskan margarin dalam wajan, masukkan telur.Orak arik telur sampai berbentuk gumpalan*. Setelah matang, angkat dan sisihkan.</li>\n	<li>\n		Oleskan KEWPIE OLESAN SANDWICH RASA KEJU pada bagian dalam roti yang sudah dibelah, kemudian isi roti dengan telur. Tambahkan timun, siap disajikan.</li>\n</ol>\n<div>\n	&nbsp;</div>\n<div>\n	<div>\n		*) Sebagai alternatif cara memasak, telur bisa juga diolah dengan cara mengocoknya di dalam mangkuk,</div>\n	<div>\n		kemudian menutup mangkuk dengan plastic wrap, lalu panaskan menggunakan microwave dengan daya 800w selama 1 menit</div>\n	<div>\n		&nbsp;</div>\n	<div>\n		&nbsp;</div>\n	<div>\n		&nbsp;</div>\n</div>\n<div>\n	&nbsp;</div>\n', 1, NULL, 1, 1438944598, 1440560836),
(66, 'tbl_product_recipes', 9, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, 1, 1438945521, NULL),
(67, 'tbl_product_recipes', 20, 1, NULL, 'Apel Karamel', 'apel-karamel', NULL, '<ul>\n	<li>\n		1 buah &nbsp; Apel</li>\n	<li>\n		2 sdt &nbsp;KEWPIE MAYONAIS ORIGINAL RASA MANIS</li>\n	<li>\n		2 sdm &nbsp;Gula Pasir &nbsp;&nbsp;</li>\n	<li>\n		5 sdm &nbsp; Air &nbsp;&nbsp;</li>\n	<li>\n		Es Krim Vanila &nbsp;secukupnya</li>\n</ul>\n', '<p>\n	KEWPIE MAYONAIS ORIGINAL RASA MANIS membuat tekstur buah menjadi lebih lembut serta menambah rasa manisnya.</p>\n', '<ul>\n	<li>\n		Kupas apel, buang bagian tengahnya, potong-potong memanjang.</li>\n	<li>\n		Masukkan KEWPIE MAYONAIS ORIGINAL RASA MANIS ke dalam wajan, nyalakan api. Panggang apel dengan api kecil sampai berubah warna.</li>\n	<li>\n		Setelah apel menjadi lembut, tambahkan air dan gula pasir. Masak sampai warnanya berubah menjadi warna karamel, campur merata.&nbsp;</li>\n	<li>\n		Angkat, sajikan di piring. Selagi panas, tambahkan es krim vanilla.</li>\n</ul>\n<div>\n	&nbsp;</div>\n', 1, NULL, 1, 1439265973, 1440069364),
(68, 'tbl_product_recipes', 22, 1, NULL, 'Salad Kurma ', 'salad-kurma', NULL, '<ul>\n	<li>\n		6 buah Kurma</li>\n	<li>\n		Daun Selada secukupnya</li>\n	<li>\n		1 pak &nbsp;Salad Campur dalam Kemasan</li>\n	<li>\n		2 buah &nbsp;Tomat Ceri</li>\n	<li>\n		Nanas potong secukupnya</li>\n	<li>\n		KEWPIE MAYONAIS ORIGINAL secukupnya</li>\n</ul>\n', '<p>\n	KEWPIE MAYONAIS ORIGINAL RASA MANIS memberikan rasa manis dan lembut jika dicampurkan dengan buah yang tidak manis. Buat sendiri salad buah dengan buah-buahan kesukaan Anda.</p>\n', '<ol>\n	<li>\n		Sobek-sobek selada menjadi ukuran yang mudah dimakan, tata di atas piring.&nbsp;</li>\n	<li>\n		Tambahkan kurma, salad campur, tomat ceri, nanas.</li>\n	<li>\n		Terakhir, tambahkan mayonais di atasnya.</li>\n	<li>\n		Sesaat sebelum disajikan, aduk terlebih dahulu.&nbsp;</li>\n</ol>\n', 1, NULL, 1, 1439267698, 1441262859),
(69, 'tbl_product_recipes', 23, 1, NULL, 'Tumis Kangkung Udang dengan Wijen Sangrai', 'tumis-kangkung-udang-dengan-wijen-sangrai', NULL, '<ul>\n	<li>\n		3 Ikat &nbsp;Kangkung</li>\n	<li>\n		&frac12; buah &nbsp;Bawang Bombay &nbsp;&nbsp;</li>\n	<li>\n		2 Siung Bawang Putih</li>\n	<li>\n		6 buah &nbsp;Udang, kupas kulitnya</li>\n	<li>\n		1 buah &nbsp;Cabai merah besar</li>\n	<li>\n		Minyak Goreng secukupnya</li>\n	<li>\n		KEWPIE Salad Dressing dengan Wijen Sangrai secukupnya</li>\n</ul>\n', '<div>\n	Selain nikmat dihidangkan bersama salad, KEWPIE Salad Dressing dengan Wijen Sangrai juga memberikan rasa yang khas pada masakan tumisan.&nbsp;</div>\n<div>\n	Dengan rasa favorit, menghadirkan pengalaman baru menikmati sayur!</div>\n', '<ol>\n	<li>\n		Petik kangkung dan cuci bersih.&nbsp;</li>\n	<li>\n		Iris tipis bawang bombai dan cabai. Cincang bawang putih.</li>\n	<li>\n		Panaskan minyak, tumis bahan bawang bombai, bawang putih dan cabei, lalu &nbsp;masukkan udang.&nbsp;</li>\n	<li>\n		Masukkan kangkung, masak sampai layu.</li>\n	<li>\n		Hidangkan diatas piring, tambahkan KEWPIE Salad Dressing dengan Wijen Sangrai di atasnya.</li>\n</ol>\n', 1, NULL, 1, 1439269004, 1440069474),
(70, 'tbl_product_recipes', 24, 1, NULL, 'Tumis Kangkung Seafood dengan Kecap Ala Jepang', 'tumis-kangkung-seafood-dengan-kecap-ala-jepang', NULL, '<ul>\n	<li>\n		3 Ikat &nbsp; Kangkung</li>\n	<li>\n		&frac12; Buah &nbsp; Bawang Bombay</li>\n	<li>\n		2 Siung &nbsp; Bawang Putih</li>\n	<li>\n		2 ekor &nbsp; Cumi, iris &frac12; cm</li>\n	<li>\n		6 buah &nbsp; Udang, kupas kulit sisakan ekor</li>\n	<li>\n		4 buah &nbsp; Bakso Ikan, belah dua</li>\n	<li>\n		Minyak Goreng secukupnya</li>\n	<li>\n		KEWPIE Salad Dressing&nbsp;dengan Kecap Ala Jepang secukupnya</li>\n</ul>\n', '<p>\n	KEWPIE Salad Dressing dengan Kecap Ala Jepang sangat cocok untuk masakan tumisan. Cukup tambahkan dan tumisan biasa pun menjadi lebih lezat.</p>\n', '<ol>\n	<li>\n		Petik kangkung dan cuci bersih.&nbsp;</li>\n	<li>\n		Iris tipis bawang bombai, dan cincang bawang putih.</li>\n	<li>\n		Panaskan minyak, tumis bawang bombai dan bawang putih lalu &nbsp;masukkan potongan cumi.&nbsp;</li>\n	<li>\n		Masukkan kangkung, masak sampai layu.</li>\n	<li>\n		Tambahkan KEWPIE Salad Dressing dengan Kecap Ala Jepang, aduk hingga rata. Sajikan selagi hangat.</li>\n</ol>\n', 1, NULL, 1, 1439270917, 1440478782),
(71, 'tbl_product_recipes', 25, 1, NULL, 'Salad Nanas dengan Kecap Ala Jepang', 'salad-nanas-dengan-kecap-ala-jepang', NULL, '<ul>\n	<li>\n		&frac12; buah &nbsp;Nanas</li>\n	<li>\n		3 Lembar &nbsp;Daun Selada</li>\n	<li>\n		&frac12; pak &nbsp; Salad Campur dalam Kemasan &nbsp;</li>\n	<li>\n		&frac14; buah &nbsp; Semangka, potong-potong</li>\n	<li>\n		&frac14; buah &nbsp; Pepaya, potong-potong</li>\n	<li>\n		2 buah &nbsp; Cabai Rawit Merah, iris-iris</li>\n	<li>\n		KEWPIE Salad Dressing dengan Kecap Ala Jepang secukupnya</li>\n</ul>\n<div>\n	&nbsp;</div>\n', '<div>\n	Nikmati lezatnya rujak buah dalam gaya baru!&nbsp;</div>\n<div>\n	Selain untuk tumisan, KEWPIE Salad Dressing dengan Kecap Ala Jepang juga cocok untuk dijadikan saus salad buah.&nbsp;</div>\n<div>\n	Bisa juga membuatnya tanpa cabai jika Anda tidak menyukai rasa pedas.</div>\n', '<div>\n	<em>Saus</em></div>\n<ol>\n	<li>\n		Masukkan KEWPIE Salad Dressing dengan Kecap Ala Jepang ke dalam mangkuk.</li>\n	<li>\n		Tambahkan irisan cabai.&nbsp;</li>\n</ol>\n<div>\n	&nbsp;</div>\n<div>\n	<em>Salad</em></div>\n<ol>\n	<li>\n		Tata selada dan salad campur di atas piring.</li>\n	<li>\n		Tambahkan semua buah-buahan lalu siramkan saus di atasnya.</li>\n</ol>\n', 1, NULL, 1, 1439271644, 1440069611),
(72, 'tbl_product_recipes', 26, 1, NULL, 'Pasta Sayuran Saus Tomat Pedas', 'pasta-sayuran-saus-tomat-pedas', NULL, '<ul>\n	<li>\n		150 g &nbsp; Fettucini &nbsp; &nbsp;3 siung &nbsp;Bawang Putih, cincang kasar</li>\n	<li>\n		&frac12; buah &nbsp;Bawang Bombay, cincang kasar</li>\n	<li>\n		2 lembar &nbsp;Smoked Beef, potong memanjang</li>\n	<li>\n		100 g &nbsp; Frozen Mixed Vegetables&nbsp;</li>\n	<li>\n		100 g &nbsp; Brokoli, potong per kuntum</li>\n	<li>\n		1000 ml &nbsp;Air &nbsp;</li>\n	<li>\n		100 ml KEWPIE Salad Dressing Tomat Pedas</li>\n</ul>\n', '<div>\n	Pasta dapat diganti dengan jenis lain yang Anda gemari. Tambahkan keju cheddar atau parmesan sebagai topping jika suka.&nbsp;</div>\n<div>\n	KEWPIE Salad Dressing Tomat Pedas dapat langsung dijadikan saus pasta tanpa tambahan bahan apapun.</div>\n', '<ol>\n	<li>\n		Didihkan air, 1/2 sendok teh garam, dan 1 sendok makan minyak goreng.</li>\n	<li>\n		Masukkan fettucini. Rebus sampai matang, kemudian angkat dan tiriskan.</li>\n	<li>\n		Tumis bawang putih dan bawang bombay sampai harum.</li>\n	<li>\n		Tambahkan daging asap, brokoli dan frozen mixed vegetables, aduk rata.</li>\n	<li>\n		Masukkan fettucini, aduk rata.</li>\n	<li>\n		Tambahkan KEWPIE Salad Dressing Tomat Pedas, aduk rata kembali. Angkat, sajikan.</li>\n</ol>\n', 1, NULL, 1, 1439282753, 1440478219),
(73, 'tbl_product_recipes', 27, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, 1, 1439282758, NULL),
(74, 'tbl_product_recipes', 28, 1, NULL, 'Ifumie Saus Caesar ', 'ifumie-saus-caesar', NULL, '<ul>\n	<li>\n		200 g &nbsp;Mie Telur &nbsp;</li>\n	<li>\n		1 buah Bawang Bombay, diiris panjang tebal</li>\n	<li>\n		3 siung Bawang Putih, cincang kasar</li>\n	<li>\n		75 g &nbsp;Udang, kupas sisakan ekor</li>\n	<li>\n		1 buah Wortel, iris miring</li>\n	<li>\n		100 g &nbsp;Brokoli, potong per kuntum</li>\n	<li>\n		100 g &nbsp;Jamur Merang, belah dua</li>\n	<li>\n		200 ml Air &nbsp;</li>\n	<li>\n		2 batang Daun Bawang, potong miring</li>\n	<li>\n		1 butir &nbsp;Telur &nbsp;</li>\n	<li>\n		2 sdm &nbsp;Minyak Goreng, untuk menumis</li>\n	<li>\n		100 ml KEWPIE Salad Dressing Caesar&nbsp;</li>\n</ul>\n', '<p>\n	Di menu ini, KEWPIE Salad Dressing Caesar menghasilkan perpaduan yang unik antara eastern dan western food, menghadirkan rasa yang baru.</p>\n', '<ol>\n	<li>\n		Rebus mie setengah matang, angkat.</li>\n	<li>\n		Masukkan mie ke dalam cetakan ifumie atau serok peniris gorengan, goreng hingga kering. Setelah matang, angkat, sisihkan.</li>\n	<li>\n		Panaskan minyak dalam wajan, masukkan bawang bombay dan bawang putih tumis sampai harum.</li>\n	<li>\n		Masukkan udang, masak hingga berubah warna, tambahkan sayuran dan KEWPIE Salad Dressing Caesar, aduk rata.</li>\n	<li>\n		Tuang air, masak sampai mendidih. Tambahkan telur, aduk hingga berserabut kemudian angkat.&nbsp;</li>\n	<li>\n		Menjelang diangkat, masukkan daun bawang, Aduk rata, siramkan ke atas ifumie.</li>\n</ol>\n', 1, NULL, 1, 1439284071, 1440478187),
(75, 'tbl_product_recipes', 29, 1, NULL, 'Nugget Ayam Brokoli Saus Thousand Island', 'nugget-ayam-brokoli-saus-thousand-island', NULL, '<ul>\n	<li>\n		200 g &nbsp;Brokoli, dikukus dan diblender halus</li>\n	<li>\n		250 g &nbsp;Ayam Giling&nbsp;</li>\n	<li>\n		50 g &nbsp;Tepung Panir Halus&nbsp;</li>\n	<li>\n		2 butir &nbsp;Telur, kocok lepas</li>\n	<li>\n		&frac34; sdt &nbsp;Garam &nbsp;</li>\n	<li>\n		&frac12; sdt &nbsp;Lada</li>\n</ul>\n<div>\n	&nbsp;</div>\n<div>\n	Bahan Pencelup:</div>\n<ul>\n	<li>\n		&frac14; sdt &nbsp;Gula Pasir</li>\n	<li>\n		2 Putih Telur</li>\n	<li>\n		1 sdt Bawang Putih Bubuk</li>\n	<li>\n		150 g &nbsp;Tepung Panir Kasar Warna Kuning</li>\n	<li>\n		50 g &nbsp;Keju Cheddar Parut</li>\n	<li>\n		KEWPIE Salad Dressing Thousand Island&nbsp;secukupnya</li>\n</ul>\n', '<div>\n	&nbsp;</div>\n<div>\n	Menu sehat yang cocok untuk pesta atau waktu kumpul bersama. Cocok juga untuk anak-anak yang sulit makan sayuran.&nbsp;</div>\n', '<ol>\n	<li>\n		Campur dan aduk rata semua bahan</li>\n	<li>\n		Tuang di loyang segi empat (ukuran 22x22x3 cm) yang diolesi minyak dan dialasi plastik.</li>\n	<li>\n		Kukus 30 menit di atas api sedang sampai matang. Biarkan dingin.</li>\n	<li>\n		Potong-potong sekitar 1.5x5 cm.</li>\n	<li>\n		Celup ke bahan pencelup. Gulingkan di tepung panir*.&nbsp;</li>\n	<li>\n		Goreng dalam minyak yang sudah dipanaskan di atas api sedang sampai matang.</li>\n	<li>\n		Sajikan dengan saus Thousand Island.</li>\n</ol>\n<p>\n	*) Tepung panir halus dapat diganti dengan tepung roti kasar berwarna&nbsp;</p>\n', 1, NULL, 1, 1439284818, 1440478598),
(76, 'tbl_product_recipes', 30, 1, NULL, 'Kentang Iris dengan Caesar ', 'kentang-iris-dengan-caesar', NULL, '<ul>\n	<li>\n		3 buah &nbsp; Kentang&nbsp;</li>\n	<li>\n		10 buah &nbsp;Pepperoni, cincang kasar</li>\n	<li>\n		50 g &nbsp; Keju Mozzarella &nbsp;</li>\n	<li>\n		100 ml &nbsp; KEWPIE Salad Dressing Caesar&nbsp;</li>\n</ul>\n<div>\n	&nbsp;</div>\n', '<p>\n	Menu yang cocok untuk pesta atau waktu kumpul bersama. Anda bisa mengganti keju mozzarella dengan keju mudah meleleh.&nbsp;</p>\n', '<ol>\n	<li>\n		Iris tipis kentang menjadi beberapa bagian, tapi tidak putus.&nbsp;</li>\n	<li>\n		Panaskan oven dengan suhu 175 derajat, siram kentang dengan KEWPIE Salad Dressing Caesar, &nbsp;kemudian masukkan ke dalam oven, panggang selama kurang lebih 30 menit atau hingga matang.&nbsp;</li>\n	<li>\n		Angkat, taburi keju mozzarella dan peperoni di atas kentang.&nbsp;</li>\n	<li>\n		Panggang kembali selama 5 menit hingga keju meleleh.</li>\n	<li>\n		Setelah matang, angkat dan taburi &nbsp;dengan daun bawang. Siap disajikan.</li>\n</ol>\n<div>\n	&nbsp;</div>\n<div>\n	*) Kentang iris dapat dinikmati juga dengan dicelupkan ke dalam KEWPIE Salad Dressing Caesar.</div>\n', 1, NULL, 1, 1439288198, 1440069818),
(77, 'tbl_product_recipes', 31, 1, NULL, 'Sandwich Tomat dan Telur', 'sandwich-tomat-dan-telur', NULL, '<ul>\n	<li>\n		4 lembar &nbsp;Roti Tawar dengan Kulit &nbsp;</li>\n	<li>\n		1 butir &nbsp; Telur Rebus &nbsp;&nbsp;</li>\n	<li>\n		2 lembar &nbsp;Keju Lembaran &nbsp;&nbsp;</li>\n	<li>\n		&frac12; buah &nbsp;Tomat &nbsp; &nbsp;</li>\n	<li>\n		1 lembar &nbsp;Selada lettuce &nbsp;&nbsp;</li>\n	<li>\n		KEWPIE OLESAN SANDWICH ORIGINAL secukupnya</li>\n</ul>\n', '<div>\n	Dengan KEWPIE OLESAN SANDWICH ORIGINAL, Anda dapat membuat sendiri sandwich sehat nan lezat di rumah. Cocok untuk sarapan maupun untuk bekal.&nbsp;</div>\n<div>\n	&nbsp;</div>\n', '<ol>\n	<li>\n		Potong tipis telur dan tomat.&nbsp;</li>\n	<li>\n		Cuci selada, tiriskan airnya. Sobek selada menjadi ukuran yang mudah dimakan. &nbsp;</li>\n	<li>\n		Oleskan KEWPIE OLESAN SANDWICH ORIGINAL pada sisi &ndash;sisi dalam roti yang akan ditumpuk, kemudian susun selada, telur rebus tomat dan keju. Tutup dengan roti di atasnya.</li>\n</ol>\n<div>\n	&nbsp;</div>\n<div>\n	*) Bungkus sandwich dengan plastic wrap (plastik pembungkus), tindih dengan piring atau barang lain yang rata selama 10 menit. Ini akan membuat isi sandwich menempel dengan baik pada roti.</div>\n', 1, NULL, 1, 1439289828, 1440069893),
(78, 'tbl_product_recipes', 32, 1, NULL, 'Menggambar di Atas Roti', 'menggambar-di-atas-roti', NULL, '<ul style="font-size: 11.9999990463257px;">\n	<li>\n		Roti Tawar&nbsp;</li>\n	<li>\n		KEWPIE SAUS MANIS (Semua Rasa Cokelat &amp; Vanila)</li>\n</ul>\n', '<div>\n	Dengan kemasan tube praktis, berkreasi di atas roti pun kini menjadi lebih menyenangkan!</div>\n<div>\n	<span style="font-size: 12px;">Tulis pesan atau gambar wajah, membuat makan roti semakin ceria.</span></div>\n', '<ol style="font-size: 12px;">\n	<li>\n		Siapkan roti tawar, gambar atau tulis pesan di atas roti sesuai selera.</li>\n</ol>\n<p style="font-size: 12px;">\n	(Jenis roti, gambar dan pesan yang ditulis bisa bermacam-macam sesuai selera Anda)</p>\n', 1, NULL, 1, 1439291310, 1440069941),
(79, 'tbl_product_recipes', 33, 1, NULL, 'Pisang Pelangi Saus Manis', 'pisang-pelangi-saus-manis', NULL, '<ul>\n	<li>\n		6 buah Pisang Raja&nbsp;</li>\n	<li>\n		6 buah &nbsp;Tusuk Sate&nbsp;</li>\n	<li>\n		Meises secukupnya&nbsp;</li>\n	<li>\n		KEWPIE SAUS MANIS (Semua Rasa Cokelat dan Vanila)</li>\n</ul>\n', '<p>\n	Rasa dan tampilan pisang lebih menarik dengan Saus Manis dari KEWPIE, cocok untuk anak-anak dan keluarga.</p>\n', '<ol>\n	<li>\n		Kupas pisang, lalu tusuk seperti sate.&nbsp;</li>\n	<li>\n		Tambahkan KEWPIE SAUS MANIS (Semua Rasa Cokelat dan Vanila) sesuai selera, tambahkan juga meises di atasnya.</li>\n</ol>\n', 1, NULL, 1, 1439292764, 1440069977),
(80, 'tbl_product_recipes', 34, 1, NULL, 'Martabak Mini  ', 'martabak-mini', NULL, '<ul>\n	<li>\n		225 g &nbsp;Tepung Terigu Protein Sedang&nbsp;</li>\n	<li>\n		75 g &nbsp;Gula Pasir &nbsp;</li>\n	<li>\n		&frac14; sdt &nbsp;Baking Powder &nbsp;</li>\n	<li>\n		&frac14; sdt &nbsp;Garam &nbsp;</li>\n	<li>\n		250 ml &nbsp;Air &nbsp;</li>\n	<li>\n		1 butir &nbsp;Telur&nbsp;</li>\n	<li>\n		&frac14; sdt &nbsp;Soda Kue&nbsp;</li>\n	<li>\n		1 sdm &nbsp;Margarin, lelehkan</li>\n	<li>\n		75 g &nbsp;Keju Cheddar, parut&nbsp;</li>\n	<li>\n		100 g &nbsp;KEWPIE SAUS MANIS (Semua Rasa Cokelat)&nbsp;</li>\n</ul>\n', '<div>\n	Martabak manis buatan sendiri dengan rasa cokelat yang berbeda dengan martabak manapun yang Anda temui di luar. Pas untuk cemilan saat kumpul bersama keluarga atau teman.&nbsp;</div>\n<div>\n	&nbsp;</div>\n', '<div>\n	Untuk membuat kulit:</div>\n<ol>\n	<li>\n		Ayak tepung terigu dan baking powder.</li>\n	<li>\n		Masukkan 25 g gula pasir dan garam. Aduk rata.</li>\n	<li>\n		Tuang air sedikit demi sedikit sambal kocok perlahan. Setelah itu, diamkan selama 20 menit.&nbsp;</li>\n	<li>\n		Masukkan telur, soda kue, dan 25 g gula pasir, kocok rata. Tambahkan margarin leleh, aduk rata.</li>\n	<li>\n		Tuang adonan ke dalam cetakan martabak mini yang sudah diolesi margarin dan dipanaskan.</li>\n	<li>\n		Lalu, tabur dengan sisa gula pasir. Biarkan adonannya berlubang, tutup dan biarkan matang.&nbsp;<span style="font-size: 12px;">Angkat.</span></li>\n	<li>\n		<span style="font-size: 12px;"><span style="font-size: 12px;">Oleskan margarin di atas permukaan kue dan kulitnya. Taburkan keju cheddar parut di atasnya, kemudian tambahkan KEWPIE SAUS MANIS sebagai topping.</span></span></li>\n</ol>\n<div>\n	&nbsp;</div>\n', 1, NULL, 1, 1439293281, 1440070011),
(81, 'tbl_product_recipes', 35, 1, NULL, 'Nasi Goreng Omelet Mayonais', 'nasi-goreng-omelet-mayonais', NULL, '<div>\n	Bahan telur</div>\n<ul>\n	<li>\n		2 butir telur dikocok dan bidadar dengan lebar 20cm&nbsp;</li>\n	<li>\n		4 sdm KEWPIE MAYONAIS ORIGINAL&nbsp;</li>\n</ul>\n<div>\n	Bahan untuk nasi</div>\n<ul>\n	<li>\n		400 gram &nbsp;Nasi Putih &nbsp;&nbsp;</li>\n	<li>\n		50 gram &nbsp;Udang Kupas Kecil&nbsp;</li>\n	<li>\n		3 sdm Kecap Manis&nbsp;</li>\n	<li>\n		4 buah &nbsp;Bakso Sapi masing-masing dibelah dua, dipotong-potong</li>\n	<li>\n		1 batang &nbsp;Daun Bawang, iris halus</li>\n	<li>\n		1 sdm &nbsp;KEWPIE MAYONAIS ORIGINAL untuk menumis</li>\n	<li>\n		Bumbu halus</li>\n	<li>\n		3 siung Bawang merah &nbsp;</li>\n	<li>\n		3 siung &nbsp;Bawang Putih &nbsp;</li>\n	<li>\n		Garam secukupnya</li>\n</ul>\n<div>\n	&nbsp;</div>\n', '<div>\n	Masukkan mayonais ke dalam telur untuk tekstur yang lembut walaupun sudah dingin.&nbsp;</div>\n<div>\n	Mayonais yang dicampurkan ke dalam nasi membuat rasanya lebih enak.&nbsp;</div>\n<div>\n	Buat lining mayonais juga agar tampilan lebih cantik.</div>\n', '<ol>\n	<li>\n		Panaskan wajan, masukkan KEWPIE MAYONAIS ORIGINAL.&nbsp;</li>\n	<li>\n		Tumis bumbu halus sampai harum. Masukkan udang, tumis sampai &nbsp;berubah warna, kemudian tambahkan bakso. Aduk rata.</li>\n	<li>\n		Masukkan nasi, kecap dan daun bawang. Aduk sampai matang</li>\n	<li>\n		Ambil telur yang sudah didadar, isi dengan nasi dan lipat.</li>\n</ol>\n', 1, NULL, 1, 1439356749, 1440070021),
(82, 'tbl_news', 6, 1, NULL, 'BARU DI KELUARGA KEWPIE', 'baru-di-keluarga-kewpie', '<p>\n	<a href="http://www.kewpie.co.id/" target="_blank">KEWPIE INDONESIA</a> meluncurkan 6 produk terbaru pada bulan Agustus 2015 di AEON Supermarket BSD.</p>\n', '<p>\n	<a href="http://www.kewpie.co.id/" target="_blank">KEWPIE INDONESIA</a> meluncurkan 6 produk terbaru pada bulan Agustus 2015 di AEON Supermarket BSD, terdiri dari produk dressing, mayo dan olesan untuk roti. Produk-produk tersebut di antaranya adalah KEWPIE Salad Dressing dengan Kecap Ala Jepang, KEWPIE Salad Dressing Caesar, KEWPIE SAUS MAYO GURIH, KEWPIE OLESAN SANDWICH ORIGINAL, KEWPIE SAUS MANIS Rasa Cokelat Pisang dan KEWPIE SAUS MANIS Rasa Cokelat Kopi. Produk olesan roti khususnya, dengan rasa yang unik dan baru, diharapkan dapat menambah variasi cara makan roti masyarakat Indonesia.</p>\n', NULL, NULL, 1, NULL, 0, 1440480188, 1444977021),
(83, 'tbl_product_recipes', 36, 1, NULL, 'Salad Kentang Brokoli Pohon Natal ', 'salad-kentang-brokoli-pohon-natal', NULL, '<ul>\n	<li>\n		1 buah &nbsp; Brokoli</li>\n	<li>\n		3 buah &nbsp; Kentang&nbsp;</li>\n	<li>\n		&frac12; buah &nbsp; Paprika Kuning</li>\n	<li>\n		2 buah &nbsp;Tomat Sedang</li>\n	<li>\n		6 lembar &nbsp;Smoked Beef</li>\n	<li>\n		Garam secukupnya</li>\n	<li>\n		Lada secukupnya</li>\n	<li>\n		Jamur Kaleng secukupnya</li>\n	<li>\n		4 sdm &nbsp; KEWPIE MAYONAIS ORIGINAL</li>\n</ul>\n', NULL, '<p>\n	Salad Kentang :</p>\n<ol>\n	<li>\n		Cuci kentang, lalu bungkus dalam keadaan basah dengan kitchen towel, lalu bungkus kembali dengan plastic wrap. &nbsp;Panaskan dalam microwave (800 w) &nbsp;selama 6 menit. Setelah matang, keluarkan dan kupas kulitnya. Hancurkan dengan garpu selagi panas.</li>\n	<li>\n		Campur salad kentang dengan 4 sdm KEWPIE MAYONAIS ORIGINAL, garam dan lada.&nbsp;</li>\n</ol>\n<div>\n	&nbsp;</div>\n<div>\n	Pohon :</div>\n<ol>\n	<li>\n		Tata 2/3 kentang yang sudah dihancurkan tadi pada piring membentuk kerucut. Susun brokoli menutupi kentang.&nbsp;</li>\n	<li>\n		Gulung smoked beef, buat menjadi bentuk mawar. Bentuk paprika dengan cetakan kue berbentuk bintang, susun di atas brokoli.</li>\n	<li>\n		Hias kentang dan brokoli yang sudah berbentuk pohon dengan mayonais.&nbsp;</li>\n</ol>\n<p>\n	Sinterklas:</p>\n<ol>\n	<li>\n		belah tomat 1:3, keruk bagian dalamnya, isikan dengan sisa bahan salad kentang, hias sesuai selera.</li>\n</ol>\n<div>\n	&nbsp;</div>\n', 1, NULL, 1, 1450351942, 1450408816),
(84, 'tbl_product_recipes', 37, 1, NULL, 'Ayam Panggang Tomat Pedas', 'ayam-panggang-tomat-pedas', NULL, '<div>\n	Bahan-bahan:</div>\n<ul>\n	<li>\n		1 ekor<span class="Apple-tab-span" style="white-space:pre"> </span>Ayam</li>\n	<li>\n		2 buah <span class="Apple-tab-span" style="white-space:pre"> </span>Jeruk Nipis</li>\n	<li>\n		3 siung<span class="Apple-tab-span" style="white-space:pre"> </span>Bawang Putih Halus<span class="Apple-tab-span" style="white-space:pre"> </span></li>\n	<li>\n		KEWPIE Salad Dressing Tomat Pedas</li>\n</ul>\n<div>\n	&nbsp;</div>\n<div>\n	Bahan pelengkap:</div>\n<ul>\n	<li>\n		Brokoli secukupnya, rebus matang&nbsp;</li>\n	<li>\n		5 buah <span class="Apple-tab-span" style="white-space:pre"> </span>kentang baby, rebus matang&nbsp;</li>\n	<li>\n		6 buah <span class="Apple-tab-span" style="white-space:pre"> </span>Tomat Cherry</li>\n	<li>\n		&frac12; buah<span class="Apple-tab-span" style="white-space:pre"> </span>Paprika Merah, potong-potong</li>\n	<li>\n		&frac12; buah<span class="Apple-tab-span" style="white-space:pre"> </span>Paprika Kuning, potong-potong&nbsp;</li>\n	<li>\n		&frac12; buah<span class="Apple-tab-span" style="white-space:pre"> </span>Bombay Merah, iris tipis</li>\n</ul>\n', NULL, '<ol>\n	<li>\n		Lumuri ayam dengan air jeruk nipis dan bawang putih, diamkan selama 15 menit.</li>\n	<li>\n		Letakkan ayam dalam loyang, lumuri &nbsp;KEWPIE Salad Dressing Tomat Pedas.</li>\n	<li>\n		Tusuk-tusuk ayam dengan garpu agar bumbu meresap, diamkan selama satu malam.&nbsp;</li>\n	<li>\n		Panggang dalam oven selama 60 menit dengan suhu 150&deg;c hingga matang.</li>\n	<li>\n		Sajikan ayam di atas piring, lengkapi dengan sayuran. &nbsp;</li>\n</ol>\n<div>\n	&nbsp;</div>\n', 1, NULL, 1, 1450352399, 1450352400),
(85, 'tbl_product_recipes', 38, 1, NULL, ' Salad Ayam Saus Caesar ', 'salad-ayam-saus-caesar', NULL, '<ul>\n	<li>\n		300 gr<span class="Apple-tab-span" style="white-space:pre"> </span>Ayam Fillet<span class="Apple-tab-span" style="white-space:pre"> </span></li>\n	<li>\n		1 pak<span class="Apple-tab-span" style="white-space:pre"> </span>Salad Campur</li>\n	<li>\n		1 buah<span class="Apple-tab-span" style="white-space:pre"> </span>Timun Jepang, belah dua lalu iris tipis</li>\n	<li>\n		1 buah <span class="Apple-tab-span" style="white-space:pre"> </span>Wortel</li>\n	<li>\n		10 buah <span class="Apple-tab-span" style="white-space:pre"> </span>Tomat Cherry</li>\n	<li>\n		Daun Dil secukupnya</li>\n	<li>\n		Garam dan Lada secukupnyaKEWPIE Salad Dressing Caesar</li>\n</ul>\n', NULL, '<ol>\n	<li>\n		Lumuri ayam dengan garam dan lada, rebus hingga matang. Angkat, sisihkan lalu potong dadu.</li>\n	<li>\n		Iris tipis wortel, cetak dengan cetakan (cookie cutter) bentuk bintang. Rebus sebentar, angkat dan tiriskan.</li>\n	<li>\n		Tata salad campur, ayam dan sayuran lainnya di piring. &nbsp;&nbsp;</li>\n	<li>\n		Sajikan bersama KEWPIE Salad Dressing Caesar sebagai sausnya.&nbsp;</li>\n</ol>\n<div>\n	&nbsp;</div>\n', 1, NULL, 1, 1450353442, 1450353442),
(86, 'tbl_product_recipes', 39, 1, NULL, 'Mangkuk Salad Buah ', 'mangkuk-salad-buah', NULL, '<ul>\n	<li>\n		1 buah<span class="Apple-tab-span" style="white-space:pre"> </span>Melon</li>\n	<li>\n		200 gr <span class="Apple-tab-span" style="white-space:pre"> </span>Stroberi<span class="Apple-tab-span" style="white-space:pre"> </span></li>\n	<li>\n		1 buah <span class="Apple-tab-span" style="white-space:pre"> </span>Buah Naga<span class="Apple-tab-span" style="white-space:pre"> </span></li>\n	<li>\n		100 gr<span class="Apple-tab-span" style="white-space:pre"> </span>Jeruk Kaleng</li>\n	<li>\n		200 gr<span class="Apple-tab-span" style="white-space:pre"> </span>Anggur Merah</li>\n	<li>\n		200 gr<span class="Apple-tab-span" style="white-space:pre"> </span>Anggur Hijau</li>\n	<li>\n		1 buah <span class="Apple-tab-span" style="white-space:pre"> </span>Nanas</li>\n	<li>\n		KEWPIE MAYONAIS ORIGINAL RASA MANIS</li>\n</ul>\n', NULL, '<ol>\n	<li>\n		Cuci bersih melon, bentuk bergerigi dengan pisau. Keruk bagian dalamnya, sisihkan.</li>\n	<li>\n		Potong-potong buah menjadi ukuran yang mudah dimakan.</li>\n	<li>\n		Masukkan buah-buahan dalam mangkuk melon.</li>\n	<li>\n		Tambahkan KEWPIE MAYONAIS ORIGINAL RASA MANIS di atasnya. Salad siap disajikan.</li>\n</ol>\n', 1, NULL, 1, 1450353690, 1450353694),
(87, 'tbl_product_recipes', 40, 1, NULL, 'Aneka Gorengan ', 'aneka-gorengan', NULL, '<div>\n	Nugget Tofu:</div>\n<ul>\n	<li>\n		300 gr<span class="Apple-tab-span" style="white-space:pre"> </span>Tofu/Tahu Sutra&nbsp;</li>\n	<li>\n		200 gr<span class="Apple-tab-span" style="white-space:pre"> </span>Ayam Cincang</li>\n	<li>\n		2 butir<span class="Apple-tab-span" style="white-space:pre"> </span>Telur</li>\n	<li>\n		1 sdm <span class="Apple-tab-span" style="white-space:pre"> </span>Tepung Terigu</li>\n	<li>\n		5 batang <span class="Apple-tab-span" style="white-space:pre"> </span>Buncis</li>\n	<li>\n		1 buah <span class="Apple-tab-span" style="white-space:pre"> </span>Wortel</li>\n	<li>\n		Garam dan Lada secukupnya&nbsp;</li>\n	<li>\n		Tepung Panir Kasar secukupnya</li>\n</ul>\n<div>\n	&nbsp;</div>\n<div>\n	<div>\n		Ebi Fry:</div>\n	<ul>\n		<li>\n			10 ekor <span class="Apple-tab-span" style="white-space:pre"> </span>Udang</li>\n		<li>\n			150 gr <span class="Apple-tab-span" style="white-space:pre"> </span>Tepung Tempura</li>\n		<li>\n			150 ml <span class="Apple-tab-span" style="white-space:pre"> </span>Air Es</li>\n		<li>\n			Minyak Goreng secukupnya</li>\n		<li>\n			KEWPIE MAYONAIS ORIGINAL&nbsp;</li>\n		<li>\n			KEWPIE SAUS MAYO GURIH&nbsp;</li>\n		<li>\n			KEWPIE Salad Dressing dengan Tomat Pedas</li>\n	</ul>\n	<div>\n		&nbsp;</div>\n</div>\n<div>\n	Ekado:</div>\n<ul>\n	<li>\n		100 gr<span class="Apple-tab-span" style="white-space:pre"> </span>Ayam Cincang</li>\n	<li>\n		100 gr <span class="Apple-tab-span" style="white-space:pre"> </span>Udang Cincang</li>\n	<li>\n		1 buah <span class="Apple-tab-span" style="white-space:pre"> </span>Wortel</li>\n	<li>\n		1 batang <span class="Apple-tab-span" style="white-space:pre"> </span>Daun Bawang</li>\n	<li>\n		1 butir <span class="Apple-tab-span" style="white-space:pre"> </span>Telur</li>\n	<li>\n		10 lembar<span class="Apple-tab-span" style="white-space:pre"> </span>Spring Roll/Kulit Lumpia</li>\n</ul>\n', NULL, '<div>\n	Nugget Tofu:</div>\n<ol>\n	<li>\n		Campur tofu, 1 butir telur dan bahan lainnya, beri lada dan garam.</li>\n	<li>\n		Masukkan dalam loyang, kukus hingga matang. Angkat, potong dadu.</li>\n	<li>\n		Siapkan 1 butir telur lainnya di dalam mangkuk, kocok lepas.</li>\n	<li>\n		Masukkan adonan nugget ke dalam telur, gulingkan ke dalam tepung roti kasar.</li>\n	<li>\n		Ulangi sekali lagi. Setelah itu, goreng hingga matang.</li>\n</ol>\n<div>\n	&nbsp;</div>\n<div>\n	Ekado:</div>\n<ol>\n	<li>\n		Campur semua bahan hingga tercampur dengan rata.</li>\n	<li>\n		Ambil spring roll/kulit lumpia, beri isian di tengahnya, lalu satukan ujung-ujung kulit di tengah.</li>\n	<li>\n		Ikat dengan benang kasur, goreng dalam minyak panas hingga kecoklatan, angkat.</li>\n</ol>\n<div>\n	&nbsp;</div>\n<div>\n	Ebi Fry:</div>\n<ol>\n	<li>\n		Siapkan 50 gr tepung tempura dalam mangkuk, gulingkan udang di atasnya.</li>\n	<li>\n		Campur dan aduk rata 100 gr tepung tempura dan air es dalam wadah terpisah.</li>\n	<li>\n		Kemudian, celupkan udang ke dalam campuran tepung, goreng dalam minyak panas hingga matang, angkat.</li>\n	<li>\n		Sajikan dengan KEWPIE MAYONAIS ORIGINAL, KEWPIE SAUS MAYO GURIH, KEWPIE Salad Dressing dengan Tomat Pedas.</li>\n</ol>\n<div>\n	&nbsp;</div>\n', 1, NULL, 1, 1450410870, 1450410870),
(88, 'tbl_product_recipes', 41, 1, NULL, 'Salad Pasta Ayam Tomat Pedas', 'salad-pasta-ayam-tomat-pedas', NULL, '<ul>\n	<li>\n		150 gr<span class="Apple-tab-span" style="white-space:pre"> </span>Pasta Farfalle</li>\n	<li>\n		200 gr<span class="Apple-tab-span" style="white-space:pre"> </span>Ayam Fillet<span class="Apple-tab-span" style="white-space:pre"> </span></li>\n	<li>\n		200 gr, <span class="Apple-tab-span" style="white-space:pre"> </span>Brokoli <span class="Apple-tab-span" style="white-space:pre"> </span></li>\n	<li>\n		1 buah<span class="Apple-tab-span" style="white-space:pre"> </span>Paprika Kuning</li>\n	<li>\n		8 buah<span class="Apple-tab-span" style="white-space:pre"> </span>Tomat Cherry</li>\n	<li>\n		1 pak <span class="Apple-tab-span" style="white-space:pre"> </span> Selada Hijau&nbsp;</li>\n	<li>\n		Garam dan Lada secukupnya</li>\n	<li>\n		Minyak Goreng secukupnya</li>\n	<li>\n		KEWPIE MAYONAIS ORIGINAL</li>\n	<li>\n		KEWPIE Salad Dressing Tomat Pedas</li>\n</ul>\n', NULL, '<ol>\n	<li>\n		Lumuri ayam dengan garam dan lada, rebus hingga matang. Angkat, tiriskan.</li>\n	<li>\n		Didihkan air, tambahkan minyak goreng, masukkan pasta, masak hingga matang.</li>\n	<li>\n		Kemudian angkat, tiriskan.</li>\n	<li>\n		Panaskan wajan, tuangkan KEWPIE Salad Dressing Tomat Pedas. Tambahkan pasta, masak hingga meresap, angkat.</li>\n	<li>\n		Bersihkan brokoli, potong per kuntum. Rebus hingga matang, angkat dan tiriskan.&nbsp;</li>\n	<li>\n		Tata selada di piring, tambakan bahan lainnya.</li>\n	<li>\n		Sajikan dengan KEWPIE MAYONAIS ORIGINAL di atasnya.</li>\n</ol>\n<div>\n	&nbsp;</div>\n', 1, NULL, 1, 1450442592, 1450442593),
(89, 'tbl_product_recipes', 42, 1, NULL, 'Makaroni Panggang Tomat Pedas', 'makaroni-panggang-tomat-pedas', NULL, '<ul>\n	<li style="font-size: 12px;">\n		2 sdm<span class="Apple-tab-span" style="white-space: pre;"> </span>Margarin</li>\n	<li style="font-size: 12px;">\n		1 buah<span class="Apple-tab-span" style="white-space: pre;"> </span>Bawang Bombay</li>\n	<li style="font-size: 12px;">\n		3 siung<span class="Apple-tab-span" style="white-space: pre;"> </span>Bawang Putih</li>\n	<li style="font-size: 12px;">\n		100 gr<span class="Apple-tab-span" style="white-space: pre;"> </span>Daging Cincang</li>\n	<li style="font-size: 12px;">\n		100 gr<span class="Apple-tab-span" style="white-space: pre;"> </span>Makaroni</li>\n	<li style="font-size: 12px;">\n		50 gr<span class="Apple-tab-span" style="white-space: pre;"> </span>Mix vegetable</li>\n	<li style="font-size: 12px;">\n		50 gr<span class="Apple-tab-span" style="white-space: pre;"> </span>Jamur Kancing</li>\n	<li style="font-size: 12px;">\n		5 butir<span class="Apple-tab-span" style="white-space: pre;"> </span>Telur</li>\n	<li style="font-size: 12px;">\n		300 ml<span class="Apple-tab-span" style="white-space: pre;"> </span>Susu Cair</li>\n	<li style="font-size: 12px;">\n		50 gr<span class="Apple-tab-span" style="white-space: pre;"> </span>Keju Cheddar, parut&nbsp;</li>\n	<li style="font-size: 12px;">\n		Minyak Goreng secukupnya</li>\n	<li style="font-size: 12px;">\n		KEWPIE Salad Dressing Tomat Pedas.</li>\n</ul>\n', NULL, '<ol>\n	<li>\n		Didihkan air dan minyak, masukkan makaroni, rebus selama 15 menit atau hingga matang. Angkat, tiriskan.</li>\n	<li>\n		Panaskan margarin, tumis bawang bombay dan bawang putih hingga harum, masukkan daging cincang, masak hingga berubah warna. Tambahkan mix vegetable dan jamur kancing, aduk rata.</li>\n	<li>\n		Tambahkan KEWPIE Salad Dressing Tomat Pedas, aduk rata, angkat.</li>\n	<li>\n		Masukkan tumisan daging dalam mangkuk, tambahkan makaroni, telur dan susu cair, aduk hingga rata.</li>\n	<li>\n		Kemudian, masukkan adonan ke dalam pinggan tahan panas yang telah diolesi margarin, taburi keju parut.</li>\n	<li>\n		Panggang dengan suhu 150&deg; C selama kira-kira 30 menit atau hingga matang.</li>\n</ol>\n<div>\n	&nbsp;</div>\n', 1, NULL, 1, 1450443076, 1450443077),
(90, 'tbl_product_recipes', 43, 1, NULL, ' Aneka Canapé', 'aneka-canap', NULL, '<div>\n	Canap&eacute; Nugget Ayam:</div>\n<ul>\n	<li>\n		4 lembar<span class="Apple-tab-span" style="white-space:pre"> </span>Roti Tawar</li>\n	<li>\n		16 buah <span class="Apple-tab-span" style="white-space:pre"> </span>Nugget Ayam Bentuk Coin</li>\n	<li>\n		Selada Hijau secukupnya, sobek-sobek kecil</li>\n	<li>\n		&frac12; buah <span class="Apple-tab-span" style="white-space:pre"> </span>Wortel, parut halus, rebus sebentar&nbsp;</li>\n	<li>\n		Minyak Goreng secukupnya</li>\n	<li>\n		KEWPIE OLESAN SANDWICH ORIGINAL/KEWPIE OLESAN SANDWICH RASA KEJU</li>\n</ul>\n<div>\n	Canap&eacute; Ayam Mayonais:</div>\n<ul>\n	<li>\n		&frac12; buah <span class="Apple-tab-span" style="white-space:pre"> </span>Timun Jepang, iris tipis</li>\n	<li>\n		8 buah <span class="Apple-tab-span" style="white-space:pre"> </span>Daging Dada Ayam Asap</li>\n	<li>\n		4 buah<span class="Apple-tab-span" style="white-space:pre"> </span>Tomat Cherry, belah dua</li>\n	<li>\n		KEWPIE MAYONAIS ORIGINAL</li>\n</ul>\n<div>\n	<div>\n		Pie Ayam Sayuran :</div>\n	<ul>\n		<li>\n			10 buah<span class="Apple-tab-span" style="white-space:pre"> </span>Kulit Pie Siap Pakai</li>\n		<li>\n			&frac12; buah <span class="Apple-tab-span" style="white-space:pre"> </span>Bawang Bombay, cincang halus&nbsp;</li>\n		<li>\n			2 siung <span class="Apple-tab-span" style="white-space:pre"> </span>Bawang Putih, cincang halus</li>\n		<li>\n			200 gr<span class="Apple-tab-span" style="white-space:pre"> </span>Ayam Fillet, cincang halus</li>\n		<li>\n			&frac12; buah <span class="Apple-tab-span" style="white-space:pre"> </span>Wortel, potong dadu kecil&nbsp;</li>\n		<li>\n			5 buah<span class="Apple-tab-span" style="white-space:pre"> </span>Buncis, iris halus</li>\n		<li>\n			Minyak Goreng secukupnya</li>\n		<li>\n			KEWPIE &nbsp;SAUS MAYO GURIH</li>\n	</ul>\n	<div>\n		Scallop Bumbu Tomat Pedas:</div>\n	<ul>\n		<li>\n			200 gr<span class="Apple-tab-span" style="white-space:pre"> </span>Scallop</li>\n		<li>\n			1 buah<span class="Apple-tab-span" style="white-space:pre"> </span>Cabai Merah, cincang halus</li>\n		<li>\n			KEWPIE Salad Dressing Tomat Pedas</li>\n	</ul>\n</div>\n<p>\n	&nbsp;</p>\n<p>\n	&nbsp;</p>\n', NULL, '<div>\n	Pie Ayam Sayuran:</div>\n<ol>\n	<li>\n		Tumis bawang bombay dan bawang putih dalam wajan hingga harum, masukkan ayam fillet, masak hingga berubah warna.</li>\n	<li>\n		Tambahkan sayuran, masak hingga matang, angkat.</li>\n	<li>\n		Setelah itu, masukkan KEWPIE SAUS MAYO GURIH, aduk merata.</li>\n	<li>\n		Taruh adonan di atas kulit pie, sajikan.&nbsp;</li>\n</ol>\n<div>\n	&nbsp;</div>\n<div>\n	Scallop Bumbu Tomat Pedas:</div>\n<ol>\n	<li>\n		Rendam scallop selama kurang lebih 1 jam dengan KEWPIE Salad Dressing Tomat Pedas, pangang hingga matang.</li>\n	<li>\n		Sajikan dengan taburan cabai merah dan KEWPIE Salad Dressing Tomat Pedas di atasnya.&nbsp;</li>\n</ol>\n<div>\n	&nbsp;</div>\n<div>\n	Canap&eacute; Nugget Ayam :</div>\n<ol>\n	<li>\n		Potong roti tawar bentuk segi empat kecil, beri selada diatasnya.</li>\n	<li>\n		Susun nugget ayam di atasnya, tambahkan OLESAN SANDWICH ORIGINAL/RASA KEJU , serta taburkan wortel di atasnya.</li>\n</ol>\n<div>\n	&nbsp;</div>\n<div>\n	Canap&eacute; Ayam Mayonais:</div>\n<ol>\n	<li>\n		Panggang dada ayam asap dalam wajan anti lengket hingga matang di kedua sisinya, angkat.</li>\n	<li>\n		Setelah dingin, letakkan di atas irisan timun jepang, beri KEWPIE MAYONAIS ORIGINAL dan tomat cherry di atasnya.&nbsp;</li>\n</ol>\n<div>\n	&nbsp;</div>\n', 1, NULL, 1, 1450443553, 1450443555),
(91, 'tbl_product_recipes', 44, 1, NULL, 'Sosis dan Jagung Bakar Mayonais', 'sosis-dan-jagung-bakar-mayonais', NULL, '<ul>\n	<li>\n		1 buah<span class="Apple-tab-span" style="white-space:pre"> </span>Jagung</li>\n	<li>\n		2 buah <span class="Apple-tab-span" style="white-space:pre"> </span>Sosis Sapi</li>\n	<li>\n		8 buah <span class="Apple-tab-span" style="white-space:pre"> </span>Udang</li>\n	<li>\n		8 buah<span class="Apple-tab-span" style="white-space:pre"> </span>Kentang baby</li>\n	<li>\n		8 buah<span class="Apple-tab-span" style="white-space:pre"> </span>Tomat Cherry</li>\n</ul>\n<div>\n	Bahan Bumbu:</div>\n<ul>\n	<li>\n		2 sdt<span class="Apple-tab-span" style="white-space:pre"> </span>Lada Hitam</li>\n	<li>\n		Garam secukupnya</li>\n	<li>\n		1 sdt<span class="Apple-tab-span" style="white-space:pre"> </span>Peterseli Cincang</li>\n	<li>\n		KEWPIE MAYONAIS ORIGINAL</li>\n</ul>\n', NULL, '<ol>\n	<li>\n		Potong-potong jagung sesuai selera dan potong sosis menjadi 4 bagian.</li>\n	<li>\n		Kukus kentang hingga setengah matang, angkat.</li>\n	<li>\n		Tusuk dengan tusukan sate secara berurutan: jagung, sosis, udang, kentang, tomat cherry.</li>\n	<li>\n		Campur dan aduk rata KEWPIE MAYONAIS ORIGINAL, lada hitam, garam dan peterseli cincang.&nbsp;</li>\n	<li>\n		Olesi bahan-bahan yang sudah ditusuk dengan bahan olesan, bakar hingga matang sambil sesekali diolesi bumbu.</li>\n</ol>\n<div>\n	&nbsp;</div>\n', 1, NULL, 1, 1450444314, 1450444314),
(92, 'tbl_product_recipes', 45, 1, NULL, 'Salad Daging Sayuran ', 'salad-daging-sayuran', NULL, '<ul>\n	<li>\n		300 gr<span class="Apple-tab-span" style="white-space:pre"> </span>Daging Sapi Has Dalam</li>\n	<li>\n		1 pak<span class="Apple-tab-span" style="white-space:pre"> </span>Selada Hijau</li>\n	<li>\n		1 buah<span class="Apple-tab-span" style="white-space:pre"> </span>Mangga Muda</li>\n	<li>\n		1 buah<span class="Apple-tab-span" style="white-space:pre"> </span>Timun Jepang</li>\n	<li>\n		&frac12; buah <span class="Apple-tab-span" style="white-space:pre"> </span>Bombay Merah</li>\n	<li>\n		4 buah<span class="Apple-tab-span" style="white-space:pre"> </span>Cabai Rawit Merah</li>\n	<li>\n		4 buah<span class="Apple-tab-span" style="white-space:pre"> </span>Cabai Keriting Merah</li>\n	<li>\n		Daun Ketumbar secukupnya</li>\n	<li>\n		KEWPIE Salad Dressing dengan Kecap Ala Jepang</li>\n</ul>\n', '<p>\n	Apabila tidak menyukai rasa pedas, cabai tidak perlu digunakan</p>\n', '<ol>\n	<li>\n		Lumuri daging dengan KEWPIE Salad Dressing dengan Kecap Ala Jepang, diamkan selama kurang lebih 1 jam, panggang daging hingga matang kemudian angkat.&nbsp;</li>\n	<li>\n		Potong-potong mangga dan timun jepang menjadi ukuran yang mudah di makan.</li>\n	<li>\n		Iris tipis daging. Lalu, tata &nbsp;selada hijau, daging, mangga muda, timun jepang, dan bombay merah di piring.</li>\n	<li>\n		Campur cabai rawit dan cabai keriting merah dengan KEWPIE Salad Dressing dengan Kecap Ala Jepang, siramkan di atas salad. Sajikan.</li>\n</ol>\n<div>\n	&nbsp;</div>\n', 1, NULL, 1, 1450444665, 1450444666);
INSERT INTO `tbl_translations` (`id`, `table`, `field_id`, `lang_id`, `name`, `subject`, `url`, `synopsis`, `text`, `attribute`, `messages`, `user_id`, `count`, `status`, `added`, `modified`) VALUES
(93, 'tbl_product_recipes', 46, 1, NULL, ' Sushi Goreng dengan Wijen Sangrai ', 'sushi-goreng-dengan-wijen-sangrai', NULL, '<ul>\n	<li>\n		300 gr<span class="Apple-tab-span" style="white-space:pre"> </span>Nasi</li>\n	<li>\n		2 lembar<span class="Apple-tab-span" style="white-space:pre"> </span>Rumput Laut Kering/Nori</li>\n	<li>\n		50 gr<span class="Apple-tab-span" style="white-space:pre"> </span>Tepung Terigu</li>\n	<li>\n		2 butir<span class="Apple-tab-span" style="white-space:pre"> </span>Telur</li>\n	<li>\n		200 gr<span class="Apple-tab-span" style="white-space:pre"> </span>Tepung Panir Kasar</li>\n	<li>\n		Minyak Goreng secukupnya</li>\n	<li>\n		Bahan Isian</li>\n	<li>\n		150 gr<span class="Apple-tab-span" style="white-space:pre"> </span>Ayam Fillet, iris tipis</li>\n	<li>\n		1 buah<span class="Apple-tab-span" style="white-space:pre"> </span>Wortel</li>\n	<li>\n		1 buah<span class="Apple-tab-span" style="white-space:pre"> </span>Timun Jepang</li>\n	<li>\n		KEWPIE Salad Dressing dengan Wijen Sangrai</li>\n	<li>\n		KEWPIE MAYONAIS ORIGINAL</li>\n</ul>\n', NULL, '<ol>\n	<li>\n		Tumis ayam hingga berubah warna, masukkan KEWPIE Salad Dressing dengan Wijen Sangrai, masak hingga bumbu meresap. Angkat sisihkan.</li>\n	<li>\n		Potong memanjang wortel dan timun jepang, rebus wortel hingga lunak, angkat.</li>\n	<li>\n		Ambil 1 lembar nori, letakkan di atas penggulung sushi, beri nasi diatasnya dan ratakan. Tambahkan tumisan ayam, wortel, dan timun jepang, gulung dengan sedikit ditekan hingga padat.</li>\n	<li>\n		Gulingkan &nbsp;gulungan nasi &nbsp;diatas tepung &nbsp;terigu, masukkan ke dalam kocokan telur, gulingkan ke dalam tepung panir, ratakan. Goreng dalam minyak panas hingga matang, angkat, tiriskan.</li>\n	<li>\n		Sajikan dengan KEWPIE MAYONAIS ORIGINAL dan potongan nori di atasnya.</li>\n</ol>\n<div>\n	&nbsp;</div>\n', 1, NULL, 1, 1450445026, 1450445027),
(99, 'tbl_product_recipes', 48, 1, NULL, 'Mie Ayam Jamur', 'mie-ayam-jamur', '<p>\n	Didihkan air, masukkan mie, rebus sebentar. Angkat, tiriskan.</p>\n<p>\n	Tumis bumbu halus hingga harum, masukkan ayam, masak hingga berubah warna.</p>\n<p>\n	Tambahkan KEWPIE Salad Dressing dengan Kecap Ala Jepang, aduk rata.</p>\n', '<ul>\n	<li>\n		400 gr<span class="Apple-tab-span" style="white-space:pre"> </span>Lo Mie</li>\n	<li>\n		150 gr<span class="Apple-tab-span" style="white-space:pre"> </span>Ayam Fillet</li>\n	<li>\n		&frac12; buah <span class="Apple-tab-span" style="white-space:pre"> </span>Wortel</li>\n	<li>\n		100 gr <span class="Apple-tab-span" style="white-space:pre"> </span>Kol</li>\n	<li>\n		1 bungkus<span class="Apple-tab-span" style="white-space:pre"> </span>Jamur Enoki</li>\n	<li>\n		2 batang<span class="Apple-tab-span" style="white-space:pre"> </span>Daun Bawang</li>\n	<li>\n		Bahan Bumbu untuk Dihaluskan</li>\n	<li>\n		3 suing<span class="Apple-tab-span" style="white-space:pre"> </span>Bawang Putih</li>\n	<li>\n		4 buah<span class="Apple-tab-span" style="white-space:pre"> </span>Cabai Merah</li>\n	<li>\n		KEWPIE Salad Dressing dengan Kecap Ala Jepang</li>\n</ul>\n<div>\n	&nbsp;</div>\n', NULL, '<ol>\n	<li>\n		Didihkan air, masukkan mie, rebus sebentar. Angkat, tiriskan.</li>\n	<li>\n		Tumis bumbu halus hingga harum, masukkan ayam, masak hingga berubah warna.</li>\n	<li>\n		Tambahkan KEWPIE Salad Dressing dengan Kecap Ala Jepang, aduk rata.</li>\n	<li>\n		Masukkan mie dan sayuran, aduk hingga rata. Masak hingga semua bahan matang.</li>\n	<li>\n		Sajikan mie dalam mangkuk, taburi wijen, sajikan hangat.</li>\n</ol>\n<div>\n	&nbsp;</div>\n', 1, NULL, 1, 1453984969, 1454043981),
(98, 'tbl_product_recipes', 47, 1, NULL, 'Yee Sang', 'yee-sang', '<p>\n	Serut halus timun jepang, wortel, lobak dan bengkuang.</p>\n<p>\n	Warnai bengkuang dengan pewarna makanan merah dan hijau.</p>\n', '<ul>\n	<li>\n		1 buah <span class="Apple-tab-span" style="white-space:pre"> </span>Timun Jepang</li>\n	<li>\n		1 buah <span class="Apple-tab-span" style="white-space:pre"> </span>Wortel</li>\n	<li>\n		50 gr <span class="Apple-tab-span" style="white-space:pre"> </span>Jahe Merah Jepang<span class="Apple-tab-span" style="white-space:pre"> </span></li>\n	<li>\n		1 buah <span class="Apple-tab-span" style="white-space:pre"> </span>Lobak</li>\n	<li>\n		1 buah <span class="Apple-tab-span" style="white-space:pre"> </span>Bengkuang</li>\n	<li>\n		200 gr <span class="Apple-tab-span" style="white-space:pre"> </span>Jeruk Bali</li>\n	<li>\n		100 gr <span class="Apple-tab-span" style="white-space:pre"> </span>Salmon Asap</li>\n	<li>\n		Pewarna Makanan Merah dan Hijau</li>\n	<li>\n		KEWPIE Salad Dressing dengan Wijen Sangrai</li>\n	<li>\n		KEWPIE Salad Dressing dengan Kecap Ala Jepang</li>\n</ul>\n', '<p>\n	Anda bisa menggunakan salmon segar, atau salmon yang ditumis, sesuai selera Anda.&nbsp;</p>\n', '<ol>\n	<li>\n		Serut halus timun jepang, wortel, lobak dan bengkuang.</li>\n	<li>\n		Warnai bengkuang dengan pewarna makanan merah dan hijau.&nbsp;</li>\n	<li>\n		Susun semua bahan di piring, beri salmon di tengahnya.</li>\n	<li>\n		Sajikan bersama KEWPIE Salad Dressing dengan Wijen Sangrai dan KEWPIE Salad Dressing dengan Kecap Ala Jepang sebagai saus.</li>\n</ol>\n', 1, NULL, 1, 1453971495, 1454056224),
(97, 'tbl_news', 8, 1, NULL, '15 Produk KEWPIE Sudah di Pasaran', '15-produk-kewpie-sudah-di-pasaran', '<p>\n	Pada September 2015 yang lalu, produk KEWPIE MAYONAIS ORIGINAL RASA MANIS, KEWPIE SAUS MAYO GURIH, KEWPIE SAUS MANIS Rasa Vanila Stroberi pertama kali diluncurkan ke pasaran.</p>\n', '<p>\n	Pada September 2015 yang lalu, produk KEWPIE MAYONAIS ORIGINAL RASA MANIS, KEWPIE SAUS MAYO GURIH, KEWPIE SAUS MANIS Rasa Vanila Stroberi pertama kali diluncurkan ke pasaran.Berselang 2 bulan kemudian, produk KEWPIE OLESAN SANDWICH RASA KEJU, KEWPIE SAUS MANIS Rasa Cokelat Jeruk dan KEWPIE SAUS MANIS Rasa Vanila Nanas hadir untuk melengkapi jajaran produk retail KEWPIE INDONESIA di pasaran.</p>\n<p>\n	Dengan lengkapnya produk retail di pasaran, KEWPIE INDONESIA berharap dapat memberikan kepuasan serta agar dapat mengembangkan produk-produk baru yang lebih baik ke depannya</p>\n', NULL, NULL, 1, NULL, 1, 1453104994, 1453117319),
(100, 'tbl_product_recipes', 51, 1, NULL, 'Salad Ayam Sayuran ', 'salad-ayam-sayuran', NULL, '<ul>\n	<li>\n		1 buah<span class="Apple-tab-span" style="white-space:pre"> </span>Lettuce <span class="Apple-tab-span" style="white-space:pre"> </span></li>\n	<li>\n		200 gr<span class="Apple-tab-span" style="white-space:pre"> </span>Ayam Fillet</li>\n	<li>\n		100 gr<span class="Apple-tab-span" style="white-space:pre"> </span>Toge Jepang</li>\n	<li>\n		&frac12; buah <span class="Apple-tab-span" style="white-space:pre"> </span>Timun Jepang</li>\n	<li>\n		&frac12; buah <span class="Apple-tab-span" style="white-space:pre"> </span>Wortel</li>\n	<li>\n		1 buah<span class="Apple-tab-span" style="white-space:pre"> </span>Jagung Manis</li>\n	<li>\n		Irisan Almond secukupnya</li>\n	<li>\n		Cabai Merah secukupnya, iris tipis</li>\n	<li>\n		Margarin<span class="Apple-tab-span" style="white-space:pre"> </span>secukupnya</li>\n	<li>\n		KEWPIE Salad Dressing Tomat Pedas</li>\n	<li>\n		KEWPIE Salad Dressing Thousand Island</li>\n</ul>\n<div>\n	&nbsp;</div>\n', NULL, '<ol>\n	<li>\n		Rendam ayam fillet dengan KEWPIE Salad Dressing Tomat Pedas selama sekitar satu jam hingga meresap.</li>\n	<li>\n		Panggang dalam wajan anti lengket yang telah diberi sedikit margarin, hingga matang di kedua sisinya.</li>\n	<li>\n		Setelah matang, angkat dan potong sesuai selera.&nbsp;</li>\n	<li>\n		Rebus jagung hingga matang, angkat, pipil. Potong-potong sayuran sesuai selera.</li>\n	<li>\n		Susun dalam mangkuk lettuce, sayuran, cabai merah dan irisan almond, siram dengan KEWPIE Salad Dressing Thousand island. Sajikan.</li>\n</ol>\n<div>\n	&nbsp;</div>\n', 1, NULL, 1, 1453985191, 1453985191),
(101, 'tbl_product_recipes', 52, 1, NULL, 'Lumpia Pisang Mangga Saus Manis', 'lumpia-pisang-mangga-saus-manis', NULL, '<ul>\n	<li>\n		10 lembar<span class="Apple-tab-span" style="white-space:pre"> </span>Spring Roll/Kulit Lumpia</li>\n	<li>\n		1 buah<span class="Apple-tab-span" style="white-space:pre"> </span>Mangga</li>\n	<li>\n		3 buah<span class="Apple-tab-span" style="white-space:pre"> </span>Pisang Raja</li>\n	<li>\n		1 butir <span class="Apple-tab-span" style="white-space:pre"> </span>Putih Telur<span class="Apple-tab-span" style="white-space:pre"> </span></li>\n	<li>\n		Minyak Goreng secukupnya</li>\n	<li>\n		KEWPIE SAUS MANIS Rasa Cokelat Pisang</li>\n	<li>\n		KEWPIE SAUS MANIS Rasa Cokelat Kopi</li>\n	<li>\n		KEWPIE SAUS MANIS Rasa Cokelat Jeruk</li>\n	<li>\n		KEWPIE SAUS MANIS Rasa Vanila Stroberi&nbsp;</li>\n	<li>\n		KEWPIE SAUS MANIS Rasa Vanila Nanas</li>\n</ul>\n', NULL, '<ol>\n	<li>\n		Potong-potong mangga dan pisang menjadi ukuran sekitar 5 cm x 2 cm, sisihkan.</li>\n	<li>\n		Ambil 1 lembar spring roll/kulit lumpia, beri pisang dan mangga di atasnya, lipat membentuk amplop, gulung hingga rapi. Rekatkan bagian ujungnya dengan putih telur.&nbsp;</li>\n	<li>\n		Goreng dalam minyak panas hingga warnanya berubah kuning kecoklatan dan matang. Angkat, tiriskan.&nbsp;</li>\n	<li>\n		Sajikan lumpia dengan KEWPIE SAUS MANIS rasa kesukaan Anda.&nbsp;</li>\n</ol>\n', 1, NULL, 1, 1453985657, 1453985657),
(102, 'tbl_product_recipes', 53, 1, NULL, ' Nasi Ayam Kukus Wijen Sangrai', 'nasi-ayam-kukus-wijen-sangrai', NULL, '<ul>\n	<li>\n		400 gr <span class="Apple-tab-span" style="white-space:pre"> </span>Nasi<span class="Apple-tab-span" style="white-space:pre"> </span></li>\n	<li>\n		1 buah<span class="Apple-tab-span" style="white-space:pre"> </span>Daging Dada Ayam Utuh</li>\n	<li>\n		1 buah<span class="Apple-tab-span" style="white-space:pre"> </span>Timun Jepang</li>\n	<li>\n		2 batang<span class="Apple-tab-span" style="white-space:pre"> </span>Daun Bawang</li>\n	<li>\n		1 buah<span class="Apple-tab-span" style="white-space:pre"> </span>Cabai Merah</li>\n	<li>\n		&frac14; buah <span class="Apple-tab-span" style="white-space:pre"> </span>Wortel<span class="Apple-tab-span" style="white-space:pre"> </span></li>\n	<li>\n		KEWPIE Salad Dressing dengan Wijen Sangrai</li>\n</ul>\n<div>\n	&nbsp;</div>\n', NULL, '<ol>\n	<li>\n		Lumuri ayam dengan &nbsp;KEWPIE Salad Dressing dengan Wijen Sangrai, diamkan selama 30 menit, kukus hingga matang.Potong sesuai selera.&nbsp;</li>\n	<li>\n		Iris tipis memanjang daun bawang dan wortel. Rebus wortel hingga matang, angkat.</li>\n	<li>\n		Siapkan nasi di piring, taburi wortel, sajikan bersama irisan ayam dan timun jepang. Taburi daun bawang dan cinncangan cabai merah.</li>\n	<li>\n		Siram ayam dengan KEWPIE Salad Dressing dengan Wijen Sangrai, sajikan.</li>\n</ol>\n', 1, NULL, 1, 1453985879, 1453985879),
(103, 'tbl_product_recipes', 54, 1, NULL, 'Salad Kentang Hati', 'salad-kentang-hati', '<div>\n	Campur semua bahan pada kentang yang sudah hancur.</div>\n<div>\n	Campurkan KEWPIE MAYONAIS ORIGINAL</div>\n<div>\n	setelah kentang dingin,</div>\n<div>\n	lalu tambahkan garam dan lada.</div>\n', '<ul>\n	<li>\n		2 buah<span class="Apple-tab-span" style="white-space:pre"> </span>Kentang <span class="Apple-tab-span" style="white-space:pre"> </span></li>\n	<li>\n		&frac14; buah <span class="Apple-tab-span" style="white-space:pre"> </span>Wortel</li>\n	<li>\n		&frac14; buah <span class="Apple-tab-span" style="white-space:pre"> </span>Timun Jepang</li>\n	<li>\n		1 buah <span class="Apple-tab-span" style="white-space:pre"> </span>Tomat</li>\n	<li>\n		1 buah<span class="Apple-tab-span" style="white-space:pre"> </span>Telur Rebus, potong-potong</li>\n	<li>\n		&frac14; buah <span class="Apple-tab-span" style="white-space:pre"> </span>Bawang Bombay Merah</li>\n	<li>\n		Selada Hijau secukupnya, sobek-sobek</li>\n	<li>\n		6 buah <span class="Apple-tab-span" style="white-space:pre"> </span>Zaitun Hitam</li>\n	<li>\n		Garam, dan Lada secukupnya</li>\n	<li>\n		KEWPIE MAYONAIS ORIGINAL</li>\n</ul>\n', NULL, '<ol>\n	<li>\n		Cuci kentang dan bungkus dalam keadaan basah dengan tissue dapur kering, lalu bungkus lagi dengan plastic wrap. Panaskan dalam microwave (800W) selama sekitar 6 menit, lalu kupas kulitnya dan hancurkan dengan garpu.</li>\n	<li>\n		Iris tipis wortel yang sudah dikupas kulitnya dan timun jepang. &nbsp;Taruh wortel di pinggan tahan panas, lalu bungkus dengan plastic wrap. Panaskan dengan microwave (800 W) selama 2 menit.</li>\n	<li>\n		Campur semua bahan pada kentang yang sudah hancur. Campurkan KEWPIE MAYONAIS ORIGINAL setelah kentang dingin, lalu tambahkan garam dan lada.&nbsp;</li>\n	<li>\n		Siapkan piring, cetak &nbsp;salad kentang dengan cetakan bentuk hati, belah tomat sesuai selera, susun di pinggiran salad kentang.</li>\n	<li>\n		Hias dengan selada, kentang, zaitun hitam, bombay merah dan telur, tambahkan juga KEWPIE MAYONAIS ORIGINAL di atasnya.&nbsp;</li>\n</ol>\n<div>\n	&nbsp;</div>\n', 1, NULL, 1, 1455002900, 1455009305),
(104, 'tbl_product_recipes', 55, 1, NULL, 'Sandwich Hati Saus Manis', 'sandwich-hati-saus-manis', '<div>\n	Siapkan dua buah roti, satu lembar diolesi dengan KEWPIE SAUS MANIS (sesuai selera), taburi buah-buahan, keju atau sprinkle.</div>\n<div>\n	Satu lembar roti lagi, cetak dengan cetakan berentuk hati (cookie cutter) di bagian tengahnya.</div>\n<div>\n	Cetak roti dengan cetakan sandwich, tekan hingga berbentuk pillow bread, lepaskan dari cetakan, rapikan.</div>\n', '<ul>\n	<li>\n		8 lembar<span class="Apple-tab-span" style="white-space: pre;"> </span>Roti Tawar</li>\n	<li>\n		2 buah<span class="Apple-tab-span" style="white-space:pre"> </span>Stroberi</li>\n	<li>\n		1 buah<span class="Apple-tab-span" style="white-space:pre"> </span>Kiwi</li>\n	<li>\n		25 gr <span class="Apple-tab-span" style="white-space:pre"> </span>Keju</li>\n	<li>\n		Sprinkle/meses secukupnya</li>\n	<li>\n		KEWPIE SAUS MANIS Rasa Cokelat Pisang</li>\n	<li>\n		KEWPIE SAUS MANIS Rasa Cokelat Kopi&nbsp;</li>\n	<li>\n		KEWPIE SAUS MANIS Rasa Cokelat Jeruk&nbsp;</li>\n	<li>\n		KEWPIE SAUS MANIS Rasa Vanila Stroberi&nbsp;</li>\n	<li>\n		KEWPIE SAUS MANIS Rasa Vanila Nanas</li>\n</ul>\n', '<div>\n	Jika tidak ada cetakan sandwich, roti dapat dicetak menggunakan cookie cutter berbentuk persegi empat.&nbsp;</div>\n', '<ol>\n	<li>\n		Siapkan dua buah roti, satu lembar diolesi dengan KEWPIE SAUS MANIS (sesuai selera), taburi buah-buahan, keju atau sprinkle. Satu lembar roti lagi, cetak dengan cetakan berentuk hati (cookie cutter) di bagian tengahnya. Tumpuk kedua roti.&nbsp;</li>\n	<li>\n		Cetak roti dengan cetakan sandwich, tekan hingga berbentuk pillow bread, lepaskan dari cetakan, rapikan. Sandwich siap disajikan.&nbsp;</li>\n</ol>\n', 1, NULL, 1, 1455004621, 1455004893),
(105, 'tbl_product_recipes', 56, 1, NULL, 'Cupcake Topping Saus Manis ', 'cupcake-topping-saus-manis', NULL, '<ul>\n	<li>\n		175 gr<span class="Apple-tab-span" style="white-space:pre"> </span>Mentega</li>\n	<li>\n		120 gr<span class="Apple-tab-span" style="white-space:pre"> </span>Gula Halus<span class="Apple-tab-span" style="white-space:pre"> </span></li>\n	<li>\n		5 butir<span class="Apple-tab-span" style="white-space:pre"> </span>Kuning Telur</li>\n	<li>\n		5 butir<span class="Apple-tab-span" style="white-space:pre"> </span>Putih Telur</li>\n	<li>\n		150 gr<span class="Apple-tab-span" style="white-space:pre"> </span>Tepung Terigu</li>\n	<li>\n		25 gr<span class="Apple-tab-span" style="white-space:pre"> </span>Cokelat Bubuk</li>\n	<li>\n		1 sdt<span class="Apple-tab-span" style="white-space:pre"> </span>Baking Powder</li>\n	<li>\n		KEWPIE SAUS MANIS Rasa Cokelat Pisang</li>\n	<li>\n		KEWPIE SAUS MANIS Rasa Cokelat Kopi&nbsp;</li>\n	<li>\n		KEWPIE SAUS MANIS Rasa Cokelat Jeruk&nbsp;</li>\n	<li>\n		KEWPIE SAUS MANIS Rasa Vanila Stroberi&nbsp;</li>\n	<li>\n		KEWPIE SAUS MANIS Rasa Vanila Nanas</li>\n</ul>\n', '<div>\n	Agar lebih mudah menghias, KEWPIE SAUS MANIS dapat ditaruh di piping bag yang telah diberi spuit bergerigi. Bisa juga memakai cup cake mix atau cup cake siap pakai.</div>\n<div>\n	&nbsp;</div>\n<div>\n	Poin: KEWPIE SAUS MANIS dapat digunakan sebagai pengganti butter cream untuk topping cake</div>\n<div>\n	&nbsp;</div>\n', '<div>\n	<strong>Hiasan</strong>:</div>\n<ol>\n	<li>\n		Masukkan KEWPIE SAUS MANIS ke dalam cetakan praline atau cetakan cokelat aneka bentuk sesuai selera. Bekukan sampai mengeras.&nbsp;</li>\n</ol>\n<div>\n	<strong>Cupcake:</strong></div>\n<ol>\n	<li>\n		Kocok mentega dan gula halus hingga lembut. Masukkan kuning telur, kocok hingga rata, sisihkan. Kocok putih telur dalam wadah terpisah hingga kaku. Masukkan putih telur ke dalam kocokan mentega, tambahkan tepung terigu, cokelat bubuk dan baking powder. Aduk hingga rata menggunakan sendok kayu. &nbsp;</li>\n	<li>\n		Masukkan adonan ke dalam cetakan cup cake yang sudah dialasi dengan paper cup. Panggang dalam oven dengan suhu 180&deg;C selama 25 menit atau hingga matang. Angkat, keluarkan dari cetakan. Biarkan dingin.&nbsp;</li>\n	<li>\n		Olesi cup cake dengan KEWPIE SAUS MANIS pilihan Anda hingga rata. Semprotkan KEWPIE SAUS MANIS rasa lainnya di atasnya. Hias sesuai selera.</li>\n</ol>\n<div>\n	&nbsp;</div>\n', 1, NULL, 1, 1455006042, 1455006042),
(106, 'tbl_product_recipes', 57, 1, NULL, 'Pancake Buah Saus Manis', 'pancake-buah-saus-manis', NULL, '<ul>\n	<li>\n		330 gr<span class="Apple-tab-span" style="white-space:pre"> </span>Terigu</li>\n	<li>\n		&frac14; sdt <span class="Apple-tab-span" style="white-space:pre"> </span>Garam</li>\n	<li>\n		2 sdt<span class="Apple-tab-span" style="white-space:pre"> </span>Baking powder</li>\n	<li>\n		6 sdm<span class="Apple-tab-span" style="white-space:pre"> </span>Gula pasir</li>\n	<li>\n		3 butir<span class="Apple-tab-span" style="white-space:pre"> </span>Telur</li>\n	<li>\n		120 ml <span class="Apple-tab-span" style="white-space:pre"> </span>Canola oil</li>\n	<li>\n		240 ml<span class="Apple-tab-span" style="white-space:pre"> </span>Susu cair</li>\n	<li>\n		Stroberi secukupnya</li>\n	<li>\n		Kiwi secukupnya</li>\n	<li>\n		Jeruk Sunkist secukupnya</li>\n	<li>\n		KEWPIE SAUS MANIS Rasa Cokelat Kopi</li>\n</ul>\n', '<div>\n	KEWPIE SAUS MANIS dapat digunakan sebagai pengganti sirup topping pancake</div>\n', '<ol>\n	<li>\n		Campur &nbsp;semua bahan pancake, aduk hingga tercampur dengan rata, saring jika perlu.</li>\n	<li>\n		Potong buah-buahan menjadi ukuran kecil, sisihkan.&nbsp;</li>\n	<li>\n		Panaskan pan dadar, olesi mentega, letakkan cookie cutter berbentuk hati, tuang sedikit adonan, setelah setelah setengah matang, angkat cutter, balikkan pancake, panggang kembali hingga matang, angkat.</li>\n	<li>\n		Siapkan pancake, tambahkan dengan KEWPIE SAUS MANIS Rasa Cokelat Kopi, taburi buah-buahan di atasnya, sajikan.</li>\n</ol>\n', 1, NULL, 1, 1455006552, 1455006552),
(107, 'tbl_product_recipes', 59, 1, NULL, 'Salad Kentang Mawar', 'salad-kentang-mawar', NULL, '<ul>\n	<li>\n		2 buah<span class="Apple-tab-span" style="white-space:pre"> </span>Kentang <span class="Apple-tab-span" style="white-space:pre"> </span></li>\n	<li>\n		&frac14; buah <span class="Apple-tab-span" style="white-space:pre"> </span>Wortel</li>\n	<li>\n		&frac14; buah <span class="Apple-tab-span" style="white-space:pre"> </span>Timun Jepang</li>\n	<li>\n		2 lembar<span class="Apple-tab-span" style="white-space:pre"> </span>Smoked Beef</li>\n	<li>\n		1 buah <span class="Apple-tab-span" style="white-space:pre"> </span>Tomat</li>\n	<li>\n		Selada Hijau secukupnya, sobek-sobek</li>\n	<li>\n		Peterseli secukupnya</li>\n	<li>\n		Garam dan Lada secukupnya</li>\n	<li>\n		KEWPIE MAYONAIS ORIGINAL</li>\n</ul>\n', NULL, '<ol>\n	<li>\n		Cuci kentang dan bungkus dalam keadaan basah dengan tissue dapur kering, lalu bungkus lagi dengan plastic wrap. Panaskan dalam microwave (800W) selama sekitar 6 menit, lalu kupas kulitnya dan hancurkan dengan garpu.</li>\n	<li>\n		Iris tipis wortel yang sudah dikupas kulitnya, smoked beef dan timun jepang. &nbsp;Taruh wortel dan smoked beef di pinggan tahan panas, lalu bungkus dengan plastic wrap. Panaskan dengan microwave (800 W) selama 2 menit.</li>\n	<li>\n		Campur semua bahan pada kentang yang sudah hancur. Campurkan KEWPIE MAYONAIS ORIGINAL setelah kentang dingin, lalu tambahkan garam dan lada.&nbsp;</li>\n	<li>\n		Tata selada di atas piring, taruh kira-kira 1 sdm salad kentang, kemudian susun irisan tomat mengelilingi salad hingga membentuk mawar. Setelah itu, tambahkan KEWPIE MAYONAIS ORIGINAL di atasnya, hias dengan daun peterseli. Sajikan.</li>\n</ol>\n', 1, NULL, 1, 1455007106, 1455007106),
(108, 'tbl_product_recipes', 58, 1, NULL, 'Sandwich Smoked Beef dengan Olesan Rasa Keju ', 'sandwich-smoked-beef-dengan-olesan-rasa-keju', NULL, '<ul>\n	<li>\n		4 lembar<span class="Apple-tab-span" style="white-space:pre"> </span>Roti Tawar</li>\n	<li>\n		Selada secukupnya, sobek-sobek&nbsp;</li>\n	<li>\n		&frac12; &nbsp;buah <span class="Apple-tab-span" style="white-space:pre"> </span>Timun Jepang</li>\n	<li>\n		1 buah<span class="Apple-tab-span" style="white-space:pre"> </span>Tomat</li>\n	<li>\n		4 lembar<span class="Apple-tab-span" style="white-space:pre"> </span>Smoked Beef</li>\n	<li>\n		Margarin<span class="Apple-tab-span" style="white-space:pre"> </span>secukpnya</li>\n	<li>\n		KEWPIE OLESAN SANDWICH RASA KEJU</li>\n</ul>\n', NULL, '<ol>\n	<li>\n		Cetak roti tawar dengan cetakan (cookie cutter) berbentuk hati, olesi roti tawar dengan margarin di kedua sisinya. Panggang dalam pan dadar bergerigi hingga kuning kecokelatan, angkat.</li>\n	<li>\n		Panaskan margarin dalam wajan, masak smoked beef hingga layu, angkat.</li>\n	<li>\n		Olesi roti dengan KEWPIE OLESAN SANDWICH RASA KEJU, susun selada, timun jepang, tomat dan smoked beef, tumpuk kembali dengan roti. Sajikan selagi hangat.&nbsp;</li>\n</ol>\n<div>\n	&nbsp;</div>\n', 1, NULL, 1, 1455008322, 1455011283);
